(1, 41, 'Module Positions', 'module-positions', '', '<div class="module-title "><h2 class="title">Module Positions Diagram</h2></div>\r\n<p class="notice">If no modules are published to a position, the entire area or row will not appear/collapse.</p>\r\n<img src="images/stories/demo/general/position-3.jpg" alt="Module Positions" class="rt-image" height="948" width="424" />\r\n<div class="rt-center"><a class="readon"  href="http://www.gantry-framework.org/documentation/joomla/configure/layouts"><span>Documentation: Gantry Framework Layouts</span></a></div>', '', 1, 0, 0, 11, '2012-01-30 21:50:23', 42, '', '0000-00-00 00:00:00', 0, 42, '2015-08-26 01:31:35', '2012-01-30 21:50:23', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":null,"urlatext":"","targeta":"","urlb":null,"urlbtext":"","targetb":"","urlc":null,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 1, 0, 10, '', '', 1, 173, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(2, 42, 'Module Variations', 'module-variations', '', '<p>There are 12 stylistic module class suffixes, these add a unique style variation to the module: <strong>box1-7</strong> and <strong>title1-5</strong>; and 26 structural suffixes, these affect the layout and metrics of the module.</p>\r\n\r\n<div class="title5"><div class="module-title"><h2 class="title">Module Suffix "title"</h2><div class="clear"></div></div></div>\r\n<p class="nomarginbottom">There are 5 variations to change the module title: title1-5.</p>\r\n\r\n<div class="title1 nomarginleft nomarginbottom nomargintop rt-demo-grid-3"><div class="rt-block"><div class="module-surround">\r\n<div class="module-title "><div class="arrow-box"></div>\r\n<h2 class="title"> Title1</h2></div>\r\n<div class="module-content">\r\n<p class="nomarginbottom">An example module using the <strong>title1</strong> module class suffix.</p>\r\n<div class="clear"></div>\r\n</div></div></div></div>\r\n<div class="title2 nomarginbottom nomargintop rt-demo-grid-3"><div class="rt-block"><div class="module-surround">\r\n<div class="module-title "><div class="arrow-box"></div>\r\n<h2 class="title"> Title2</h2></div>\r\n<div class="module-content">\r\n<p class="nomarginbottom">An example module using the <strong>title2</strong> module class suffix.</p>\r\n<div class="clear"></div>\r\n</div></div></div></div>\r\n<div class="title3 nomarginbottom nomargintop rt-demo-grid-3"><div class="rt-block"><div class="module-surround">\r\n<div class="module-title "><div class="arrow-box"></div>\r\n<h2 class="title"> title3</h2></div>\r\n<div class="module-content">\r\n<p class="nomarginbottom">An example module using the <strong>title3</strong> module class suffix.</p>\r\n<div class="clear"></div>\r\n</div></div></div></div>\r\n<div class="title4 nomarginleft nomargintop rt-demo-grid-3"><div class="rt-block"><div class="module-surround">\r\n<div class="module-title "><div class="arrow-box"></div>\r\n<h2 class="title"> Title4</h2></div>\r\n<div class="module-content">\r\n<p class="nomarginbottom">An example module using the <strong>title4</strong> module class suffix.</p>\r\n<div class="clear"></div>\r\n</div></div></div></div>\r\n<div class="title5 nomargintop rt-demo-grid-3"><div class="rt-block"><div class="module-surround">\r\n<div class="module-title "><div class="arrow-box"></div>\r\n<h2 class="title"> Title5</h2></div>\r\n<div class="module-content">\r\n<p class="nomarginbottom">An example module using the <strong>title5</strong> module class suffix.</p>\r\n<div class="clear"></div>\r\n</div></div></div></div>\r\n\r\n<div class="clear"></div>\r\n\r\n<div class="title5"><div class="module-title"><h2 class="title">Module Suffix "box"</h2><div class="clear"></div></div></div>\r\n<p class="nomarginbottom">There are 7 variations to change the module background: box1-7.</p>\r\n\r\n<div class="box1 nomarginleft rt-demo-grid-3"><div class="rt-block"><div class="module-surround">\r\n<div class="module-title ">\r\n<h2 class="title"> Box1</h2></div>\r\n<div class="module-content">\r\n<p class="nomarginbottom">An example module using the <strong>box1</strong> module class suffix.</p>\r\n<div class="clear"></div>\r\n</div></div></div></div>\r\n<div class="box2 rt-demo-grid-3 smallpaddingleft"><div class="rt-block"><div class="module-surround">\r\n<div class="module-title ">\r\n<h2 class="title"> Box2</h2></div>\r\n<div class="module-content">\r\n<p class="medmarginbottom">An example module using the <strong>box2</strong> module class suffix.</p>\r\n<div class="clear"></div>\r\n</div></div></div></div>\r\n<div class="box3 largemargintop rt-demo-grid-3"><div class="rt-block"><div class="module-surround">\r\n<div class="module-title ">\r\n<h2 class="title"> box3</h2></div>\r\n<div class="module-content">\r\n<p class="nomarginbottom">An example module using the <strong>box3</strong> module class suffix.</p>\r\n<div class="clear"></div>\r\n</div></div></div></div>\r\n<div class="clear"></div>\r\n<div class="box4 nomarginleft rt-demo-grid-3"><div class="rt-block"><div class="module-surround">\r\n<div class="module-title ">\r\n<h2 class="title"> Box4</h2></div>\r\n<div class="module-content">\r\n<p class="nomarginbottom">An example module using the <strong>box4</strong> module class suffix.</p>\r\n<div class="clear"></div>\r\n</div></div></div></div>\r\n<div class="box5 rt-demo-grid-3"><div class="rt-block"><div class="module-surround">\r\n<div class="module-title ">\r\n<h2 class="title"> Box5</h2></div>\r\n<div class="module-content">\r\n<p class="nomarginbottom">An example module using the <strong>box5</strong> module class suffix.</p>\r\n<div class="clear"></div>\r\n</div></div></div></div>\r\n<div class="box6 rt-demo-grid-3"><div class="rt-block"><div class="module-surround">\r\n<div class="module-title ">\r\n<h2 class="title"> Box6</h2></div>\r\n<div class="module-content">\r\n<p class="nomarginbottom">An example module using the <strong>box6</strong> module class suffix.</p>\r\n<div class="clear"></div>\r\n</div></div></div></div>\r\n<div class="clear"></div>\r\n<div class="box7 nomarginleft nomarginbottom rt-demo-grid-3"><div class="rt-block"><div class="module-surround">\r\n<div class="module-title ">\r\n<h2 class="title"> Box7</h2></div>\r\n<div class="module-content">\r\n<p class="nomarginbottom">An example module using the <strong>box7</strong> module class suffix.</p>\r\n<div class="clear"></div>\r\n</div></div></div></div>\r\n\r\n<div class="clear"></div>', '', 1, 0, 0, 11, '2012-01-30 21:50:34', 42, '', '0000-00-00 00:00:00', 0, 42, '2013-09-17 23:16:27', '2012-01-30 21:50:34', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":null,"urlatext":"","targeta":"","urlb":null,"urlbtext":"","targetb":"","urlc":null,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 1, 0, 9, '', '', 1, 539, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(3, 43, 'Integrated Extensions', 'integrated-extensions', '', '<div class="module-title">\r\n	<h1 class="title"><span>Integrated</span> Extensions</h1>\r\n</div>\r\n\r\n<h4>Styled Support for RocketTheme Extensions and K2</h4>\r\n\r\n<div class="rt-demo-grid-6 standardcase nomarginleft rt-center">\r\n\r\n	<a href="images/stories/demo/general/extensions/k2-big.jpg" title="K2 Styled" rel="rokbox[336 700]"><img class="rt-image" src="images/stories/demo/general/extensions/k2-screenshot.jpg" alt="K2" width="423" height="170" /></a><br />\r\n\r\n	<a href="images/stories/demo/general/extensions/rokgallery-big.jpg" title="RokGallery Styled" rel="rokbox[800 548]"><img class="rt-image" src="images/stories/demo/general/extensions/rokgallery-screenshot.jpg" alt="RokGallery" width="423" height="170" /></a>\r\n\r\n	<p class="alert">RocketTheme Extensions do not support K2 content in J! 2.5</p>\r\n\r\n</div>\r\n\r\n<div class="rt-demo-grid-6 standardcase">\r\n	<div class="rt-demo-grid-3 nomarginright nomarginleft">\r\n		<div class="module-title nomarginbottom largemarginleft">\r\n			<h3 class="title"><span>K2</span> Styled</h3>\r\n		</div>\r\n		<img class="rt-image largemarginleft" src="images/stories/demo/general/extensions/top-getk2.jpg" alt="K2" width="190" height="80" />\r\n		<ul class="circle blue nomarginbottom">\r\n			<li><strong>CCK-Like</strong><br />Integrated solution for Joomla! similar to CCK for those acquainted with Drupal.</li>\r\n			<li><strong>Magazine Style</strong><br />Using K2, you can transform your Joomla! website to a news or magazine site.</li>\r\n			<li><strong>Extensible</strong><br />Easily create category specific content and add extra fields to its base item form.</li>\r\n		</ul>\r\n		<a href="#" class="readon largemarginleft" target="_blank"><span style="width: 160px; text-align: center;">Download : K2</span></a>\r\n	</div>\r\n\r\n	<div class="rt-demo-grid-3 nomarginright">\r\n		<div class="module-title nomarginbottom largemarginleft">\r\n			<h3 class="title"><span>RokGallery</span> Styled</h3>\r\n		</div>\r\n		<img class="rt-image largemarginleft" src="images/stories/demo/general/extensions/top-rokgallery.jpg" alt="K2" width="190" height="80" />	\r\n		<ul class="circle blue nomarginbottom">\r\n			<li><strong>Versatile</strong><br />A revolutionary gallery extension, developed to be hugely flexible &amp; user friendly.</li>\r\n			<li><strong>Interactive</strong><br />Multi-selection via selection drag, or “shift” clicking multiple images.</li>\r\n			<li><strong>Flexible</strong><br />Gallery view component with various view options: 3x3, 4x4, slideshow, etc.</li>\r\n			</ul>		\r\n		<a href="#" class="readon largemarginleft" target="_blank"><span style="width: 160px; text-align: center;">Download : RokGallery</span></a>\r\n	</div>\r\n</div>\r\n\r\n<div class="clear"></div>\r\n\r\n<div class="title5 largepaddingbottom"><div class="module-title"><div class="title">&nbsp;</div></div></div>\r\n\r\n<div class="rt-demo-grid-6 title5">\r\n	<div class="module-title">\r\n		<h1 class="title"><span>RokTabs</span> Module</h1>\r\n	</div>	\r\n	<p class="medmarginbottom"><strong>RokTabs</strong> is a tabbed content module, standalone and themed. Content is transitioned, either by fade or scroll, powered by Mootools, which can be automatic or manual.</p>\r\n\r\n	<p>\r\n	<a href="http://www.rockettheme.com/extensions-joomla/roktabs" class="readon smallmarginright" target="_blank"><span>Details</span></a>\r\n	<a href="http://www.rockettheme.com/extensions-downloads/club/1011-roktabs" class="readon smallmarginright" target="_blank"><span>Download</span></a>\r\n	<a href="http://www.rockettheme.com/forum/index.php?f=207&amp;rb_v=viewforum" class="readon" target="_blank"><span>Support</span></a>\r\n</p>\r\n\r\n</div>\r\n\r\n<div class="rt-demo-grid-6 title5 floatright">\r\n	<img src="images/stories/demo/general/extensions/roktabs.jpg" alt="RokTabs" width="400" height="142" />\r\n</div>\r\n\r\n<div class="clear"></div><br /><br />\r\n\r\n<div class="rt-demo-grid-6 title5">\r\n	<img class="rt-image" src="images/stories/demo/general/extensions/rokfeaturetable.jpg" alt="RokFeatureTable" width="400" height="257" />\r\n</div>\r\n\r\n<div class="rt-demo-grid-6 title5 floatright">\r\n	<div class="module-title">\r\n		<h1 class="title"><span>RokFeatureTable</span> Module</h1>\r\n	</div>	\r\n\r\n	<p><strong>RokFeatureTable</strong> offers a stylistic and user friendly solution for displaying tabular based data. It is perfect for price or product comparisons, or essentially, any type of data display that suits a matrix format.</p>\r\n\r\n	<p>A simple, yet dynamic, interface provides you with the tools to quickly edit the contents of the module. There are a series of parameters allowing for unlimited row, with options for text, link, class and much more, which allows for extensive control.</p>\r\n\r\n	<p>\r\n		<a href="http://www.rockettheme.com/extensions-joomla/rokfeaturetable" class="readon smallmarginright" target="_blank"><span>Details</span></a>\r\n		<a href="http://www.rockettheme.com/extensions-downloads/club/1656-rokfeaturetable" class="readon smallmarginright" target="_blank"><span>Download</span></a>\r\n		<a href="http://www.rockettheme.com/forum/index.php?f=410&amp;rb_v=viewforum" class="readon" target="_blank"><span>Support</span></a>\r\n	</p>\r\n\r\n</div>\r\n\r\n<div class="clear"></div><br /><br />\r\n\r\n<div class="rt-demo-grid-6 title5">\r\n	<div class="module-title">\r\n		<h1 class="title"><span>RokNewsPager</span> Module</h1>\r\n	</div>	\r\n\r\n	<p><strong>RokNewsPager</strong> is an article previewer and rotator. It displays content articles, in a summarised form and, using mootools based javascript transition, rotates through a series of pages displaying articles in a contracted list format.</p>\r\n\r\n	<ul class="checkmark green normalfont">\r\n	    <li><strong>Javascript Transitions:</strong> using the power of mootools, the module fades between lists of your content articles</li>\r\n	    <li><strong>Previews:</strong> set the number of characters you wish to display from your articles</li>\r\n	    <li>Section Control: choose all articles, or those from particular sections or categories</li>\r\n	    <li><strong>Auto Update:</strong> select whether the module auto-updates using AJAX</li>\r\n	</ul>\r\n\r\n	<p>\r\n		<a href="http://www.rockettheme.com/extensions-joomla/roknewspager" class="readon smallmarginright" target="_blank"><span>Details</span></a>\r\n		<a href="http://www.rockettheme.com/extensions-downloads/club/999-roknewspager" class="readon smallmarginright" target="_blank"><span>Download</span></a>\r\n		<a href="http://www.rockettheme.com/forum/index.php?f=214&amp;rb_v=viewforum" class="readon" target="_blank"><span>Support</span></a>\r\n	</p>\r\n\r\n</div>\r\n\r\n<div class="rt-demo-grid-6 title5 floatright">\r\n	<img src="images/stories/demo/general/extensions/roknewspager.png" alt="RokNewsPager" width="400" height="355" />\r\n</div>\r\n\r\n<div class="clear"></div><br /><br />\r\n\r\n<div class="rt-demo-grid-6 title5">\r\n	<img class="rt-image" src="images/stories/demo/general/extensions/roktwittie.jpg" alt="RokTwittie" width="400" height="250" />\r\n</div>\r\n\r\n<div class="rt-demo-grid-6 title5 floatright">\r\n	<div class="module-title">\r\n		<h1 class="title"><span>RokTwittie</span> Module</h1>\r\n	</div>	\r\n\r\n	<p><strong>RokTwittie</strong> is a module that integrates Twitter into your Joomla site. Display tweets of any username, or even by search terms, as well as your profile information and various other elements from Twitter itself.</p>\r\n\r\n	<ul class="checkmark green normalfont">\r\n	    <li>Real Time Tweets: Tweets update live from Twitter</li>\r\n	    <li>Search: Use the inbuilt search to scan for usernames or keywords</li>\r\n	    <li>Highly configurable: Options to control every aspect of RokTwittie</li>\r\n	</ul>\r\n\r\n	<p>\r\n		<a href="http://www.rockettheme.com/extensions-joomla/roktwittie" class="readon smallmarginright" target="_blank"><span>Details</span></a>\r\n		<a href="http://www.rockettheme.com/extensions-downloads/club/1002-roktwittie" class="readon smallmarginright" target="_blank"><span>Download</span></a>\r\n		<a href="http://www.rockettheme.com/forum/index.php?f=221&amp;rb_v=viewforum" class="readon" target="_blank"><span>Support</span></a>\r\n	</p>\r\n\r\n</div>\r\n\r\n<div class="clear"></div><br /><br />\r\n\r\n<div class="rt-demo-grid-6 title5">\r\n	<div class="module-title">\r\n		<h1 class="title"><span>RokMiniEvents</span> Module</h1>\r\n	</div>	\r\n\r\n	<p>The module is very intuitive, automatically adjusting itself based on your events and event ranges; simply set the number of events and the time range, and RokMiniEvents will do the rest.</p>\r\n\r\n	<ul class="checkmark green normalfont nomarginbottom">\r\n	    <li><strong>Sources:</strong> Choose between Google Calendar, JomSocial, RSEvents, JEvents, EventList</li>\r\n	    <li><strong>Animation:</strong> Transitions, durations, offsets</li>\r\n	</ul>\r\n\r\n	<p>\r\n		<a href="http://www.rockettheme.com/extensions-joomla/rokminievents" class="readon smallmarginright" target="_blank"><span>Details</span></a>\r\n		<a href="http://www.rockettheme.com/extensions-downloads/club/1886-rokminievents" class="readon smallmarginright" target="_blank"><span>Download</span></a>\r\n		<a href="http://www.rockettheme.com/forum/index.php?f=474&amp;rb_v=viewforum" class="readon" target="_blank"><span>Support</span></a>\r\n	</p>\r\n\r\n</div>\r\n\r\n<div class="rt-demo-grid-6 title5 floatright">\r\n	<img class="rt-image" src="images/stories/demo/general/extensions/rokminievents.jpg" alt="RokMiniEvents" width="400" height="224" />\r\n</div>\r\n\r\n<div class="clear"></div><br /><br />\r\n\r\n<div class="rt-demo-grid-6 title5">\r\n	<img class="rt-image" src="images/stories/demo/general/extensions/rokajaxsearch.jpg" alt="RokTwittie" width="400" height="440" />\r\n</div>\r\n\r\n<div class="rt-demo-grid-6 title5 floatright">\r\n	<div class="module-title">\r\n		<h1 class="title"><span>RokAjaxSearch</span> Module</h1>\r\n	</div>	\r\n\r\n	<p>RokAjaxSearch is a truly powerful module that brings fantastic search functionality to Joomla, using the powerful and versatile javascript library, Mootools as well as full Google Search integration.</p>\r\n\r\n	<p>RokAjaxSearch offers AJAX powered real time search results for both your Joomla site content as well Google Search. There are various configuration options and parameters allowing you to enable not only Google web search, but Google Blog search, Google Image search, and Google Video search.</p>\r\n\r\n	<ul class="checkmark green normalfont">\r\n	    <li>Real Time Search: AJAX loads search results in real time.</li>\r\n	    <li>Multiple Sources: Search your local Joomla site or the web at large.</li>\r\n	    <li>Search Options: Even more search options with Blog, Video and Images.</li>\r\n	    <li>Advanced usability: Script enhancements for intuitive navigation.</li>\r\n	</ul>\r\n\r\n	<p>\r\n		<a href="http://www.rockettheme.com/extensions-joomla/rokajaxsearch" class="readon smallmarginright" target="_blank"><span>Details</span></a>\r\n		<a href="http://www.rockettheme.com/extensions-downloads/club/1004-rokajaxsearch" class="readon smallmarginright" target="_blank"><span>Download</span></a>\r\n		<a href="http://www.rockettheme.com/forum/index.php?f=204&amp;rb_v=viewforum" class="readon" target="_blank"><span>Support</span></a>\r\n	</p>\r\n\r\n</div>\r\n\r\n<div class="clear"></div>\r\n\r\n<div class="title5 largepaddingbottom"><div class="module-title"><div class="title">&nbsp;</div></div></div>\r\n\r\n<h4>Standard Used Extensions</h4>\r\n\r\n<div class="rt-demo-grid-6 standardcase">\r\n	<img class="floatleft largepaddingbottom medmarginbottom" src="images/stories/demo/general/extensions/rokbox.png" alt="RokBox" width="47" height="42" />\r\n	<div class="module-title nomarginbottom">\r\n		<h1 class="title nopaddingbottom"><span>RokBox</span></h1>\r\n		<em>The Ultimate JavaScript Powered Multimedia Box</em>\r\n	</div>\r\n	<a target="_blank" href="http://www.rockettheme.com/extensions-joomla/rokbox">+ More Information</a>\r\n</div>\r\n\r\n<div class="rt-demo-grid-6 standardcase nomarginright">\r\n	<img class="floatleft largepaddingbottom medmarginbottom" src="images/stories/demo/general/extensions/rokcandy.png" alt="RokCandy" width="47" height="42" />\r\n	<div class="module-title nomarginbottom">\r\n		<h1 class="title nopaddingbottom"><span>RokCandy</span></h1>\r\n		<em>WYSIWYG Friendly Typography and Styling</em>\r\n	</div>\r\n	<a target="_blank" href="http://www.rockettheme.com/extensions-joomla/rokcandy">+ More Information</a>\r\n</div>\r\n\r\n<div class="clear"></div><br />\r\n\r\n<div class="rt-demo-grid-6 standardcase">\r\n	<img class="floatleft largepaddingbottom medmarginbottom" src="images/stories/demo/general/extensions/rokpad.png" alt="RokPad" width="47" height="42" />\r\n	<div class="module-title nomarginbottom">\r\n		<h1 class="title nopaddingbottom"><span>RokPad</span></h1>\r\n		<em>Simple &amp; Advanced Joomla Text Editor</em>\r\n	</div>\r\n	<a target="_blank" href="http://www.rockettheme.com/extensions-joomla/rokpad">+ More Information</a>\r\n</div>\r\n\r\n<div class="rt-demo-grid-6 standardcase nomarginright">\r\n	<img class="floatleft largepaddingbottom medmarginbottom" src="images/stories/demo/general/extensions/rokgzipper.png" alt="RokGZipper" width="47" height="42" />\r\n	<div class="module-title nomarginbottom">\r\n		<h1 class="title nopaddingbottom"><span>RokGZipper</span></h1>\r\n		<em>Powerful CSS and JavaScript Compression System</em>\r\n	</div>\r\n	<a target="_blank" href="http://www.rockettheme.com/extensions-joomla/rokgzipper">+ More Information</a>\r\n</div>', '', 1, 0, 0, 11, '2012-01-30 21:50:43', 42, '', '2012-01-31 17:04:38', 42, 42, '2015-08-26 01:30:10', '2012-01-30 21:50:43', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":null,"urlatext":"","targeta":"","urlb":null,"urlbtext":"","targetb":"","urlc":null,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 3, 0, 8, '', '', 1, 1440, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', '');
INSERT INTO `jos_content` (`id`, `asset_id`, `title`, `alias`, `title_alias`, `introtext`, `fulltext`, `state`, `sectionid`, `mask`, `catid`, `created`, `created_by`, `created_by_alias`, `modified`, `modified_by`, `checked_out`, `checked_out_time`, `publish_up`, `publish_down`, `images`, `urls`, `attribs`, `version`, `parentid`, `ordering`, `metakey`, `metadesc`, `access`, `hits`, `metadata`, `featured`, `language`, `xreference`) VALUES
(4, 44, 'Template Typography', 'template-typography', '', '<div class="module-title">\r\n	<h1 class="title"><span>Template</span> Typography</h1>\r\n</div>\r\n\r\n<h4>Creating Beautiful Content With Simple Code</h4>\r\n\r\n<p>Typography is a fundamental part of a template, providing you with the tools to characterise your content and bring it to life. There is a vast array of typography available with Clarion template, as is with our previous releases, from list styles, notice blocks and a diverse number of other elements. </p>\r\n\r\n<p class="notice">If you are using the TinyMCE editor for HTML typography, go to <strong>Extensions &rarr; Plugin Manager &rarr; TinyMCE 2.0 &rarr; Set Code Clean-up on Save to Never</strong>.</p>\r\n\r\n<div class="rt-demo-grid-6 title5">\r\n	<div class="module-title">\r\n		<h3 class="title">&lt;h1&gt; Heading Styles</h3>\r\n	</div>	\r\n	<h1>H1. Heading 1</h1>\r\n	<h2>H2. Heading 2</h2>\r\n	<h3>H3. Heading 3</h3>\r\n	<h4>H4. Heading 4</h4>\r\n	<h5>H5. Heading 5</h5>\r\n	<h1 class="rt-pagetitle">H1. Component Page Title</h1>\r\n	<h1 class="title nomarginbottom">H1. Component Content Title</h1>\r\n</div>\r\n\r\n<div class="rt-demo-grid-6 floatright title5">\r\n	<div class="module-title">\r\n		<h3 class="title">&lt;ul&gt; List Styles</h3>\r\n	</div>	\r\n	<ul>\r\n		<li><em>This is an example of a standard list style.</em> Lorem ipsum dolor sit amet, consectetur adipiscing elit. Donec sit amet nibh.</li>\r\n		<li><em>This is an example of a standard list style.</em> Lorem ipsum dolor sit amet, consectetur adipiscing elit. Donec sit amet nibh.</li>\r\n	</ul>\r\n	<br /><br />\r\n	<ul class="dots">\r\n	    <li>To use this style create a list in the following format: <strong>&lt;ul class="</strong><em class="normal">dots</em><strong>"&gt;&lt;li&gt;....&lt;/li&gt;&lt;li&gt;....&lt;/li&gt;...&lt;/ul&gt; (HTML)</strong>.</li>\r\n	    <li>To use this style create a list in the following format: <strong>&#91;list class=" dots"&#93;&#91;li&#93;....&#91;/li&#93;&#91;li....&#91;/li&#93;&#91;/list&#93; (ROKCANDY)</strong>.</li>\r\n	</ul>\r\n</div>\r\n<div class="clear"></div>\r\n\r\n<div class="title5 largepaddingbottom"><div class="module-title"><div class="title">&nbsp;</div></div></div>\r\n\r\n<div class="rt-demo-grid-6 title5">\r\n	<div class="module-title">\r\n		<h3 class="title">&lt;p&gt; DropCap Styles</h3>\r\n	</div>	\r\n	<p class="dropcap">Praesent rutrum sapien ac felis. Phasellus elementum dolor quis turpis. Vestibulum nec mi vitae pede tincidunt nonummy. Vestibulum facilisis mollis neque. Sed orci. Cum sociis natoque penatibu. Pellentesque vel enim urna, sit amet blandit ipsum. Maecenas quis sem sit amet nunc pretium mattis. Sed dapibus semper est, sed pretium erat.</p>\r\n\r\n	<p>Use the following format: <strong>&lt;p class="dropcap"&gt;...&lt;/p&gt; (HTML)</strong> or <strong>&#91;dropcap class="dropcap"&#93;...&#91;/dropcap&#93; (ROKCANDY)</strong>. You can use any letter, symbol or number.</p>\r\n\r\n	<p class="dropcap2">Praesent rutrum sapien ac felis. Use this format: <strong>&lt;p class="dropcap2"&gt;...&lt;/p&gt; (HTML)</strong> or <strong>&#91;dropcap class="dropcap2"&#93; ... &#91;/dropcap&#93; (ROKCANDY)</strong></p>\r\n\r\n	<p class="dropcap3">Praesent rutrum sapien ac felis. Use this format: <strong>&lt;p class="dropcap3"&gt;...&lt;/p&gt; (HTML)</strong> or <strong>&#91;dropcap class="dropcap3"&#93; ... &#91;/dropcap&#93; (ROKCANDY)</strong></p>\r\n\r\n	<p class="dropcap4">Praesent rutrum sapien ac felis. Use this format: <strong>&lt;p class="dropcap4"&gt;...&lt;/p&gt; (HTML)</strong> or <strong>&#91;dropcap class="dropcap4"&#93; ... &#91;/dropcap&#93; (ROKCANDY)</strong></p>\r\n\r\n	<p class="dropcap5 nomarginbottom">Praesent rutrum sapien ac felis. Use this format: <strong>&lt;p class="dropcap5"&gt;...&lt;/p&gt; (HTML)</strong> or <strong>&#91;dropcap class="dropcap5"&#93; ... &#91;/dropcap&#93; (ROKCANDY)</strong></p>\r\n</div>\r\n\r\n<div class="rt-demo-grid-6 floatright title5">\r\n	<div class="module-title">\r\n		<h3 class="title">&lt;blockquote&gt;  Styles</h3>\r\n	</div>	\r\n	\r\n	<blockquote><p>To replicate, use the following formatting: <strong>&lt;blockquote&gt;&lt;p&gt;....&lt;/p&gt;&lt;/blockquote&gt; (HTML)</strong> or <strong>&#91;blockquote class="default"&#93;...&#91;/blockquote&#93; (ROKCANDY)</strong>.</p></blockquote>\r\n	<br />\r\n	<blockquote class="alignleft"><p>Praesent rutrum sapien ac felis. Phasellus elementum dolor quis turpis.</p></blockquote>\r\n\r\n	<p>To replicate, use the following formatting: <strong>&lt;blockquote class=&quot;alignleft&quot;&gt;&lt;p&gt;....&lt;/p&gt;&lt;/blockquote&gt; (HTML)</strong> or <strong>&#91;blockquote class="alignleft"&#93;...&#91;/blockquote&#93; (ROKCANDY)</strong>.</p>\r\n\r\n	<p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Mauris metus tortor.</p>\r\n	<br />\r\n	<blockquote class="alignright nomarginbottom"><p>Praesent rutrum sapien ac felis. Phasellus elementum dolor quis turpis.</p></blockquote>\r\n\r\n	<p>To replicate, use the following formatting: <strong>&lt;blockquote class=&quot;alignright&quot;&gt;&lt;p&gt;....&lt;/p&gt;&lt;/blockquote&gt; (HTML)</strong> or <strong>&#91;blockquote class="alignright"&#93;...&#91;/blockquote&#93; (ROKCANDY)</strong>.</p>\r\n\r\n	<p class="nomarginbottom">Lorem ipsum dolor sit amet, consectetur adipiscing elit. Mauris metus tortor.</p>\r\n</div>\r\n<div class="clear"></div>\r\n\r\n<div class="title5 largepaddingbottom"><div class="module-title"><div class="title">&nbsp;</div></div></div>\r\n\r\n<div class="rt-demo-grid-6 title5">\r\n	<div class="module-title">\r\n		<h3 class="title">&lt;pre&gt; Code Styles</h3>\r\n	</div>	\r\n<pre class="lines">This is a sample <strong>&lt;pre class=&quot;lines&quot;&gt;...&lt;/pre&gt; (HTML)</strong> or,\r\n<strong>&#91;pre2 class="{lines}"&#93; ... &#91;/pre2&#93; (ROKCANDY)</strong> tag:\r\n\r\ndiv.modulebox-black div.bx1 {\r\n  background: url(../images/box_bl.png) 0 100% repeat;\r\n}\r\n\r\ndiv.modulebox-black div.bx2 {\r\n  background: url(../images/box_tr.png) 100% 0 repeat;\r\n}\r\n</pre>\r\n\r\n<pre class="nomarginbottom">This is a sample <strong>&lt;pre&gt;...&lt;/pre&gt; (HTML)</strong> or, \r\n<strong>&#91;pre class="{lines}"&#93; ... &#91;/pre&#93; (ROKCANDY)</strong> tag:\r\n\r\ndiv.modulebox-black div.bx1 {\r\n  background: url(../images/box_bl.png) 0 100% repeat;\r\n}\r\n\r\ndiv.modulebox-black div.bx2 {\r\n  background: url(../images/box_tr.png) 100% 0 repeat;\r\n}\r\n</pre>\r\n</div>\r\n\r\n<div class="rt-demo-grid-6 floatright title5">\r\n	<div class="module-title">\r\n		<h3 class="title">&lt;p&gt; Notice Styles</h3>\r\n	</div>	\r\n	<p class="approved">This is a <a href="javascript:void(0);">sample</a> of the <em>Approved</em> style. To replicate, use the following syntax: <em>&lt;p class="approved"&gt;....&lt;/p&gt;</em> (HTML) or <em>&#91;notice class="approved"&#93; <em class="normal">...</em> &#91;/notice&#93;</em> (ROKCANDY).</p>\r\n\r\n	<p class="attention">This is a <a href="javascript:void(0);">sample</a> of the <em>Attention</em> style. To replicate, use the following syntax: <em>&lt;p class="attention"&gt;....&lt;/p&gt;</em> (HTML) or <em>&#91;notice class="attention"&#93; <em class="normal">...</em> &#91;/notice&#93;</em> (ROKCANDY).</p>\r\n\r\n	<p class="notice">This is a <a href="javascript:void(0);">sample</a> of the <em>Notice</em> style. To replicate, use the following syntax: <em>&lt;p class="notice"&gt;....&lt;/p&gt;</em> (HTML) or <em>&#91;notice class="notice"&#93; <em class="normal">...</em> &#91;/notice&#93;</em> (ROKCANDY).</p>\r\n\r\n	<p class="alert nomarginbottom">This is a <a href="javascript:void(0);">sample</a> of the <em>Alert</em> style. To replicate, use the following syntax: <em>&lt;p class="alert"&gt;....&lt;/p&gt;</em> (HTML) or <em>&#91;notice class="alert"&#93; <em class="normal">...</em> &#91;/notice&#93;</em> (ROKCANDY).</p>\r\n</div>\r\n<div class="clear"></div>\r\n\r\n<div class="title5 largepaddingbottom"><div class="module-title"><div class="title">&nbsp;</div></div></div>\r\n\r\n<div class="rt-demo-grid-6 title5">\r\n	<div class="module-title">\r\n		<h3 class="title">&lt;span&gt; Text Icon Styles</h3>\r\n	</div>	\r\n	<p>To replicate, the following format: <strong>&lt;span class="text-icon iconname"&gt;...&lt;/span&gt; (HTML)</strong> or <strong>&#91;icon class=&quot;icon name&quot;&#93;...&#91;/icon&#93; (ROKCANDY)</strong>. The class names are listed below, such as "<strong>text-icon email</strong>".</p>\r\n\r\n	<div class="rt-demo-grid-3 nomarginleft nomarginright">\r\n		<span class="text-icon email">Text with an email icon</span><br /><br />\r\n		<span class="text-icon phone">Text with a phone icon</span><br /><br />\r\n		<span class="text-icon quote">Text with a quote icon</span><br /><br />\r\n		<span class="text-icon cart">Text with a cart icon</span><br /><br />\r\n		<span class="text-icon rss">Text with a rss icon</span><br /><br />\r\n		<span class="text-icon tags">Text with a tags icon</span><br /><br />\r\n		<span class="text-icon write">Text with a write icon</span><br /><br />\r\n		<span class="text-icon info">Text with an info icon</span><br /><br />\r\n		<span class="text-icon sound">Text with a sound icon</span><br /><br />\r\n		<span class="text-icon rightarrow">Text with a rightarrow icon</span><br /><br />\r\n		<span class="text-icon leftarrow">Text with a leftarrow icon</span><br /><br />\r\n		<span class="text-icon circlearrow">Text with a circlearrow icon</span><br /><br />\r\n		<span class="text-icon downarrow">Text with a downarrow icon</span><br /><br />\r\n		<span class="text-icon uparrow">Text with an uparrow icon</span><br /><br />\r\n		<span class="text-icon person">Text with a person icon</span><br /><br />\r\n		<span class="text-icon calendar">Text with a calendar icon</span><br /><br />\r\n		<span class="text-icon doc">Text with a doc icon</span>\r\n	</div>\r\n	<div class="rt-demo-grid-3 nomarginright">\r\n		<span class="text-icon bulb">Text with a bulb icon</span><br /><br />\r\n		<span class="text-icon twitter">Text with a twitter icon</span><br /><br />\r\n		<span class="text-icon youtube">Text with a youtube icon</span><br /><br />\r\n		<span class="text-icon skype">Text with a skype icon</span><br /><br />\r\n		<span class="text-icon facebook">Text with a facebook icon</span><br /><br />\r\n		<span class="text-icon like">Text with a like icon</span><br /><br />\r\n		<span class="text-icon video">Text with a video icon</span><br /><br />\r\n		<span class="text-icon dropbox">Text with a dropbox icon</span><br /><br />\r\n		<span class="text-icon vimeo">Text with a vimeo icon</span><br /><br />\r\n		<span class="text-icon paypal">Text with a paypal icon</span>\r\n	</div>\r\n</div>\r\n\r\n<div class="rt-demo-grid-6 floatright title5">\r\n	<div class="module-title">\r\n		<h3 class="title">&lt;em&gt; Emphasis Styles</h3>\r\n	</div>	\r\n	\r\n	<p>This is a emphasis tag that allows you to <em class="italic">highlight words or phrases</em>. Use the following format: <strong>&lt;em class=&quot;italic&quot;&gt;...&lt;/em&gt; (HTML)</strong> or <strong>&#91;emphasis&#93;...&#91;/emphasis&#93; (ROKCANDY)</strong></p>\r\n\r\n	<p>This is a emphasis tag that allows you to <em class="bold">highlight words or phrases</em>. Use the following format: <strong>&lt;em class=&quot;bold&quot;&gt;...&lt;/em&gt; (HTML)</strong> or <strong>&#91;emphasisbold&#93;...&#91;/emphasisbold&#93; (ROKCANDY)</strong></p>\r\n\r\n	<p>This is a emphasis tag that allows you to <em class="bold2">highlight words or phrases</em>. Use the following format: <strong>&lt;em class=&quot;bold2&quot;&gt;...&lt;/em&gt; (HTML)</strong> or <strong>&#91;emphasisbold2&#93;...&#91;/emphasisbold2&#93; (ROKCANDY)</strong></p>\r\n\r\n	<p>This is a emphasis tag that allows you to <em class="highlight">highlight words or phrases</em>. Use the following format: <strong>&lt;em class=&quot;highlight&quot;&gt;...&lt;/em&gt; (HTML)</strong> or <strong>&#91;highlight class=&quot;default&quot;&#93;...&#91;/highlight&#93; (ROKCANDY)</strong></p>\r\n\r\n	<p>This is a emphasis tag that allows you to <em class="highlight white">highlight words or phrases</em>. Use the following format: <strong>&lt;em class=&quot;highlight white&quot;&gt;...&lt;/em&gt; (HTML)</strong> or <strong>&#91;highlight class=&quot;white&quot;&#93;...&#91;/highlight&#93; (ROKCANDY)</strong></p>\r\n\r\n	<p>This is a emphasis tag that allows you to <em class="highlight black">highlight words or phrases</em>. Use the following format: <strong>&lt;em class=&quot;highlight black&quot;&gt;...&lt;/em&gt; (HTML)</strong> or <strong>&#91;highlight class=&quot;black&quot;&#93;...&#91;/highlight&#93; (ROKCANDY)</strong></p>\r\n\r\n	<p>This is a emphasis tag that allows you to <em class="highlight green">highlight words or phrases</em>. Use the following format: <strong>&lt;em class=&quot;highlight green&quot;&gt;...&lt;/em&gt; (HTML)</strong> or <strong>&#91;highlight class=&quot;green&quot;&#93;...&#91;/highlight&#93; (ROKCANDY)</strong></p>\r\n\r\n	<p>This is a emphasis tag that allows you to <em class="highlight yellow">highlight words or phrases</em>. Use the following format: <strong>&lt;em class=&quot;highlight yellow&quot;&gt;...&lt;/em&gt; (HTML)</strong> or <strong>&#91;highlight class=&quot;yellow&quot;&#93;...&#91;/highlight&#93; (ROKCANDY)</strong></p>\r\n\r\n	<p>This is a emphasis tag that allows you to <em class="highlight blue">highlight words or phrases</em>. Use the following format: <strong>&lt;em class=&quot;highlight blue&quot;&gt;...&lt;/em&gt; (HTML)</strong> or <strong>&#91;highlight class=&quot;blue&quot;&#93;...&#91;/highlight&#93; (ROKCANDY)</strong></p>\r\n\r\n	<p class="nomarginbottom">This is a emphasis tag that allows you to <em class="highlight red">highlight words or phrases</em>. Use the following format: <strong>&lt;em class=&quot;highlight red&quot;&gt;...&lt;/em&gt; (HTML)</strong> or <strong>&#91;highlight class=&quot;red&quot;&#93;...&#91;/highlight&#93; (ROKCANDY)</strong></p>\r\n</div>\r\n<div class="clear"></div>\r\n\r\n<div class="title5 largepaddingbottom"><div class="module-title"><div class="title">&nbsp;</div></div></div>\r\n\r\n<div class="title5">\r\n	<div class="module-title">\r\n		<h3 class="title">&lt;ul&gt; List Styles (Icons)</h3>\r\n	</div>	\r\n</div>\r\n\r\n<p>To replicate, use the following format: <strong>&lt;ul class="list-icon icon_name"&gt;&lt;li&gt;....&lt;/li&gt;&lt;li&gt;....&lt;/li&gt;...&lt;/ul&gt; (HTML)</strong> or <strong>&#91;list class="list-icon icon_name"&#93;&#91;li&#93;....&#91;/li&#93;&#91;li....&#91;/li&#93;&#91;/list&#93; (ROKCANDY)</strong>. The icon names are listed below, such as "<strong>cart</strong>".</p>\r\n\r\n<div class="rt-demo-grid-3">\r\n  <ul class="list-icon email">\r\n    <li>A list item using the <strong>list-icon email</strong> class.</li>\r\n    <li>A list item using the <strong>list-icon email</strong> class.</li>  </ul>\r\n  <br />\r\n  <ul class="list-icon phone">\r\n    <li>A list item using the <strong>list-icon phone</strong> class.</li>\r\n    <li>A list item using the <strong>list-icon phone</strong> class.</li>\r\n  </ul>\r\n  <br />\r\n  <ul class="list-icon quote">\r\n    <li>A list item using the <strong>list-icon quote</strong> class.</li>\r\n    <li>A list item using the <strong>list-icon quote</strong> class.</li>  </ul>\r\n  <br />\r\n  <ul class="list-icon twitter">\r\n    <li>A list item using the <strong>list-icon twitter</strong> class.</li>\r\n    <li>A list item using the <strong>list-icon twitter</strong> class.</li>\r\n  </ul>\r\n  <br />\r\n  <ul class="list-icon youtube">\r\n    <li>A list item using the <strong>list-icon youtube</strong> class.</li>\r\n    <li>A list item using the <strong>list-icon youtube</strong> class.</li>\r\n  </ul>\r\n  <br />\r\n  <ul class="list-icon facebook">\r\n    <li>A list item using the <strong>list-icon facebook</strong> class.</li>\r\n    <li>A list item using the <strong>list-icon facebook</strong> class.</li>  </ul>\r\n  <br />\r\n  <ul class="list-icon cart nomarginbottom">\r\n    <li>A list item using the <strong>list-icon cart</strong> class.</li>\r\n    <li>A list item using the <strong>list-icon cart</strong> class.</li>  </ul>\r\n</div>\r\n<div class="rt-demo-grid-3">\r\n  <ul class="list-icon tags">\r\n    <li>A list item using the <strong>list-icon tags</strong> class.</li>\r\n    <li>A list item using the <strong>list-icon tags</strong> class.</li>  </ul>\r\n  <br />\r\n  <ul class="list-icon write">\r\n    <li>A list item using the <strong>list-icon write</strong> class.</li>\r\n    <li>A list item using the <strong>list-icon write</strong> class.</li>  </ul>\r\n  <br />\r\n  <ul class="list-icon info">\r\n    <li>A list item using the <strong>list-icon info</strong> class.</li>\r\n    <li>A list item using the <strong>list-icon info</strong> class.</li>  </ul>\r\n  <br />\r\n  <ul class="list-icon sound">\r\n    <li>A list item using the <strong>list-icon sound</strong> class.</li>\r\n    <li>A list item using the <strong>list-icon sound</strong> class.</li>  </ul>\r\n  <br />\r\n  <ul class="list-icon rightarrow">\r\n    <li>A list item using the <strong>list-icon rightarrow</strong> class.</li>\r\n    <li>A list item using the <strong>list-icon rightarrow</strong> class.</li>\r\n  </ul>\r\n  <br />\r\n  <ul class="list-icon skype">\r\n    <li>A list item using the <strong>list-icon skype</strong> class.</li>\r\n    <li>A list item using the <strong>list-icon skype</strong> class.</li>\r\n  </ul>\r\n  <br />\r\n  <ul class="list-icon rss nomarginbottom">\r\n    <li>A list item using the <strong>list-icon rss</strong> class.</li>\r\n    <li>A list item using the <strong>list-icon rss</strong> class.</li>\r\n  </ul>\r\n</div>\r\n<div class="rt-demo-grid-3">\r\n  <ul class="list-icon leftarrow">\r\n    <li>A list item using the <strong>list-icon leftarrow</strong> class.</li>\r\n    <li>A list item using the <strong>list-icon leftarrow</strong> class.</li>\r\n  </ul>\r\n  <br />\r\n  <ul class="list-icon circlearrow">\r\n    <li>A list item using the <strong>list-icon circlearrow</strong> class.</li>\r\n    <li>A list item using the <strong>list-icon circlearrow</strong> class.</li>\r\n  </ul>\r\n  <br />\r\n  <ul class="list-icon dropbox">\r\n    <li>A list item using the <strong>list-icon dropbox</strong> class.</li>\r\n    <li>A list item using the <strong>list-icon dropbox</strong> class.</li>\r\n  </ul>\r\n  <br />\r\n<ul class="list-icon vimeo">\r\n    <li>A list item using the <strong>list-icon vimeo</strong> class.</li>\r\n    <li>A list item using the <strong>list-icon vimeo</strong> class.</li>\r\n  </ul>\r\n  <br />\r\n  <ul class="list-icon downarrow">\r\n    <li>A list item using the <strong>list-icon downarrow</strong> class.</li>\r\n    <li>A list item using the <strong>list-icon downarrow</strong> class.</li>\r\n  </ul>\r\n  <br />\r\n  <ul class="list-icon video">\r\n    <li>A list item using the <strong>list-icon video</strong> class.</li>\r\n    <li>A list item using the <strong>list-icon video</strong> class.</li>\r\n  </ul>\r\n  <br />\r\n  <ul class="list-icon like nomarginbottom">\r\n    <li>A list item using the <strong>list-icon like</strong> class.</li>\r\n    <li>A list item using the <strong>list-icon like</strong> class.</li>\r\n  </ul>\r\n</div>\r\n<div class="rt-demo-grid-3">\r\n  <ul class="list-icon uparrow">\r\n    <li>A list item using the <strong>list-icon uparrow</strong> class.</li>\r\n    <li>A list item using the <strong>list-icon uparrow</strong> class.</li>\r\n  </ul>\r\n  <br />\r\n  <ul class="list-icon person">\r\n    <li>A list item using the <strong>list-icon person</strong> class.</li>\r\n    <li>A list item using the <strong>list-icon person</strong> class.</li>\r\n  </ul>\r\n  <br />\r\n  <ul class="list-icon calendar">\r\n    <li>A list item using the <strong>list-icon calendar</strong> class.</li>\r\n    <li>A list item using the <strong>list-icon calendar</strong> class.</li>\r\n  </ul>\r\n  <br />\r\n  <ul class="list-icon bulb">\r\n    <li>A list item using the <strong>list-icon bulb</strong> class.</li>\r\n    <li>A list item using the <strong>list-icon bulb</strong> class.</li>\r\n  </ul>\r\n  <br />\r\n<ul class="list-icon paypal">\r\n    <li>A list item using the <strong>list-icon paypal</strong> class.</li>\r\n    <li>A list item using the <strong>list-icon paypal</strong> class.</li>\r\n  </ul>\r\n  <br />\r\n  <ul class="list-icon doc nomarginbottom">\r\n    <li>A list item using the <strong>list-icon doc</strong> class.</li>\r\n    <li>A list item using the <strong>list-icon doc</strong> class.</li>\r\n  </ul>\r\n</div>\r\n\r\n<div class="clear"></div>\r\n\r\n<div class="title5 largepaddingbottom"><div class="module-title"><div class="title">&nbsp;</div></div></div>\r\n\r\n<div class="title5">\r\n	<div class="module-title">\r\n		<h3 class="title">&lt;ul&gt; List Styles (CSS3)</h3>\r\n	</div>	\r\n</div>\r\n\r\n<p>These list styles are based on the latest CSS3 techniques and are designed to work in modern browsers (will not display properly in IE6-IE8).</p>\r\n\r\n<p>To replicate, use the following format: <strong>&lt;ul class="class name"&gt;&lt;li&gt;....&lt;/li&gt;&lt;li&gt;....&lt;/li&gt;...&lt;/ul&gt; (HTML)</strong> or <strong>&#91;list class=&quot;class name&quot;&#93;&#91;li&#93;....&#91;/li&#93;&#91;li....&#91;/li&#93;&#91;/list&#93; (ROKCANDY)</strong>. The class names are listed below, such as "<strong>checkmark red</strong>".</p>\r\n\r\n<div class="rt-demo-grid-3">\r\n	<ul class="checkmark">\r\n	<li>Checkmark</li>\r\n	<li>Checkmark</li>\r\n	</ul>\r\n\r\n	<ul class="circle-checkmark">\r\n	<li>Circle-Checkmark</li>\r\n	<li>Circle-Checkmark</li>\r\n	</ul>\r\n\r\n	<ul class="square-checkmark">\r\n	<li>Square-Checkmark</li>\r\n	<li>Square-Checkmark</li>\r\n	</ul>\r\n\r\n	<ul class="checkmark green">\r\n	<li>Checkmark Green</li>\r\n	<li>Checkmark Green</li>\r\n	</ul>\r\n\r\n	<ul class="checkmark yellow">\r\n	<li>Checkmark Yellow</li>\r\n	<li>Checkmark Yellow</li>\r\n	</ul>\r\n\r\n	<ul class="checkmark red nomarginbottom">\r\n	<li>Checkmark Red</li>\r\n	<li>Checkmark Red</li>\r\n	</ul>\r\n</div>\r\n<div class="rt-demo-grid-3">\r\n	<ul class="checkmark blue">\r\n	<li>Checkmark Blue</li>\r\n	<li>Checkmark Blue</li>\r\n	</ul>\r\n\r\n	<ul class="checkmark white">\r\n	<li>Checkmark White</li>\r\n	<li>Checkmark White</li>\r\n	</ul>\r\n\r\n	<ul class="triangle-small">\r\n	<li>Triangle-Small</li>\r\n	<li>Triangle-Small</li>\r\n	</ul>\r\n\r\n	<ul class="triangle">\r\n	<li>Triangle</li>\r\n	<li>Triangle</li>\r\n	</ul>\r\n\r\n	<ul class="triangle-large">\r\n	<li>Triangle-Large</li>\r\n	<li>Triangle-Large</li>\r\n	</ul>\r\n\r\n	<ul class="triangle green nomarginbottom">\r\n	<li>Triangle Green</li>\r\n	<li>Triangle Green</li>\r\n	</ul>\r\n</div>\r\n<div class="rt-demo-grid-3">\r\n	<ul class="triangle yellow">\r\n	<li>Triangle Yellow</li>\r\n	<li>Triangle Yellow</li>\r\n	</ul>\r\n\r\n	<ul class="triangle red">\r\n	<li>Triangle Red</li>\r\n	<li>Triangle Red</li>\r\n	</ul>\r\n\r\n	<ul class="triangle blue">\r\n	<li>Triangle Blue</li>\r\n	<li>Triangle Blue</li>\r\n	</ul>\r\n\r\n	<ul class="triangle white">\r\n	<li>Triangle White</li>\r\n	<li>Triangle White</li>\r\n	</ul>\r\n\r\n	<ul class="circle-small">\r\n	<li>Circle-Small</li>\r\n	<li>Circle-Small</li>\r\n	</ul>\r\n\r\n	<ul class="circle nomarginbottom">\r\n	<li>Circle</li>\r\n	<li>Circle</li>\r\n	</ul>\r\n</div>\r\n<div class="rt-demo-grid-3">\r\n	<ul class="circle-large">\r\n	<li>Circle-Large</li>\r\n	<li>Circle-Large</li>\r\n	</ul>\r\n\r\n	<ul class="circle green">\r\n	<li>Circle Green</li>\r\n	<li>Circle Green</li>\r\n	</ul>\r\n\r\n	<ul class="circle yellow">\r\n	<li>Circle Yellow</li>\r\n	<li>Circle Yellow</li>\r\n	</ul>\r\n\r\n	<ul class="circle red">\r\n	<li>Circle Red</li>\r\n	<li>Circle Red</li>\r\n	</ul>\r\n\r\n	<ul class="circle blue">\r\n	<li>Circle Blue</li>\r\n	<li>Circle Blue</l