(5, 45, 'Menu Options', 'menu-options', '', '<div class="module-title nomarginbottom"><h2 class="title medmargintop">Fusion with MegaMenu</h2><div class="clear"></div></div>\r\n\r\n<p><strong>Fusion Menu</strong> is a menu theme of the <strong>RokNavMenu</strong> extension, the addon that drives all RocketTheme template menus. It is primarily a javascript enhanced CSS dropdown menu, that combines standard suckerfish type functionality with animations, transitions and other advanced effects powered by Mootools.</p>\r\n\r\n<img class="rt-image" src="images/stories/demo/menu-options/fusionmenu-screenshot.jpg" alt="FusionMenu" width="585" height="260" />\r\n\r\n<div class="module-title nomarginbottom"><h2 class="title medmargintop"><span>SplitMenu</span></h2><div class="clear"></div></div>\r\n\r\n<p>A static menu system that displays 1st and 2nd level items in the main horizontal menu and further children in the Sidebar.</p>\r\n\r\n<img class="rt-image" src="images/stories/demo/menu-options/splitmenu-screenshot.jpg" alt="SplitMenu" width="585" height="260" />\r\n\r\n<p class="notice">All Menu Items can be edited from <strong>Admin &rarr; Menu &rarr; <em>Menu Name</em> &rarr; <em>Menu Item</em></strong>.</p>\r\n\r\n<div class="module-title nomarginbottom"><h2 class="title medmargintop">How to create Child Menu Items</h2><div class="clear"></div></div>\r\n\r\n<p>Go to <strong>Admin &rarr; Menu &rarr; <em>A Menu</em> &rarr; <em>A Menu Item</em> &rarr; Select a <em>Parent Item</em></strong>, and it will appear as a child of it.</p>\r\n\r\n<p>\r\n	<img src="images/stories/demo/menu-options/tutmenu1.jpg" alt="Image" width="280" height="215" class="rt-image floatleft" />\r\n	<img src="images/stories/demo/menu-options/tutmenu2.jpg" alt="Image" width="280" height="215" class="rt-image floatleft nomarginright" />	\r\n</p>\r\n\r\n<p>\r\n	<img src="images/stories/demo/menu-options/tutmenu3.jpg" alt="Image" width="280" height="215" class="rt-image floatleft" />\r\n	<img src="images/stories/demo/menu-options/tutmenu4.jpg" alt="Image" width="280" height="215" class="rt-image floatleft nomarginright" />	\r\n</p>', '', 1, 0, 0, 11, '2012-01-30 21:51:01', 42, '', '0000-00-00 00:00:00', 0, 42, '2015-08-26 01:30:54', '2012-01-30 21:51:01', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":null,"urlatext":"","targeta":"","urlb":null,"urlbtext":"","targetb":"","urlc":null,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 1, 0, 6, '', '', 1, 1061, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(6, 46, 'Tutorials and Guides', 'tutorials-and-guides', '', '<div class="module-title">\r\n	<h1 class="title"><span>Tutorials</span> and Guides</h1>\r\n</div>\r\n\r\n<h4>Learn How to Install &amp; Configure Clarion</h4>\r\n\r\n<div class="rt-demo-grid-3 nomarginleft largemarginright largepaddingright rt-center">\r\n	<img class="rt-image" src="images/stories/demo/tutorials/installation.jpg" alt="Installation" width="190" height="80" />\r\n	<div class="module-title nomarginbottom">\r\n		<h3 class="title"><span>Installation</span></h3>\r\n	</div>		\r\n	<p>An overview of template files and instructions for installing and activating the template.</p>\r\n	<a href="index.php?option=com_content&amp;view=article&amp;id=7&amp;Itemid=123" class="readon"><span>Read More</span></a>\r\n</div>\r\n\r\n<div class="rt-demo-grid-3 nomarginright largemarginleft rt-center">\r\n	<img class="rt-image" src="images/stories/demo/tutorials/logoediting.jpg" alt="K2" width="190" height="80" />\r\n	<div class="module-title nomarginbottom">\r\n		<h3 class="title"><span>Logo</span> Editing</h3>\r\n	</div>		\r\n	<p>An overview for customizing your logo with your organization or company name and logo.</p>\r\n	<a href="index.php?option=com_content&amp;view=article&amp;id=8&amp;Itemid=124" class="readon"><span>Read More</span></a>\r\n</div>\r\n\r\n<div class="clear"></div><br />\r\n\r\n<p class="notice">Go to <strong>Extensions → Template Manager → <em>(J! 1.5) rt_clarion_j15 or (J! 2.5) rt_clarion</em></strong>. Mouseover the labels to view a description of each template parameter.</p>', '', 1, 0, 0, 11, '2012-01-30 21:51:09', 42, '', '2012-01-31 17:07:52', 42, 0, '0000-00-00 00:00:00', '2012-01-30 21:51:09', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":null,"urlatext":"","targeta":"","urlb":null,"urlbtext":"","targetb":"","urlc":null,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 2, 0, 5, '', '', 1, 997, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(7, 47, 'Installation Instructions', 'installation-instructions', '', '<div class="module-title">\r\n	<h1 class="title"><span>Installation</span> Instruction</h1>\r\n</div>\r\n\r\n<p>The following is a guide that covers how to set up your new Clarion template on your Joomla! site. Here you can find an overview of the files included in the Clarion release and instructions on installing and activating the template in your Joomla! install.</p>\r\n\r\n<p class="notice"><strong>Note:</strong> The <strong>Bundle</strong> Template is only necessary if the Gantry Library is not installed at <strong>/components/com_gantry (J! 1.5)</strong> or <strong>/libraries/gantry (J! 2.5)</strong>.</p>\r\n\r\n<br />\r\n\r\n<h3>Step 1 - Installation</h3>\r\n\r\n<ul>\r\n  <li><strong>(J! 1.5)</strong> Install from <strong>Admin &rarr; Extensions &rarr; Install/Uninstall &rarr; Choose File &rarr; Select file &rarr; Upload File &amp; Install</strong></li>\r\n  <li><strong>(J! 2.5)</strong> Install from <strong>Admin &rarr; Extensions &rarr; Extensions Manager &rarr; Choose File &rarr; Select file &rarr; Upload File &amp; Install</strong></li>  \r\n</ul>\r\n\r\n<p class="rt-relative">\r\n  <img width="275" height="160" class="rt-image floatleft" alt="Image" src="images/stories/demo/general/install1-j15.jpg" />\r\n  <img width="275" height="160" class="rt-image" alt="Image" src="images/stories/demo/general/install1-j17.jpg" />\r\n</p>\r\n\r\n<div class="clear"></div>\r\n\r\n<h3>Step 1 - Template Default</h3>\r\n\r\n<ul>\r\n  <li><strong>(J! 1.5)</strong> Make the template default at <strong>Admin &rarr; Extensions &rarr; Template Manager &rarr; rt_clarion_j15 &rarr; Default</strong></li>\r\n  <li><strong>(J! 2.5)</strong> Make the template default at <strong>Admin &rarr; Extensions &rarr; Template Manager &rarr; rt_clarion &rarr; Make Default</strong></li> \r\n</ul>\r\n\r\n<p class="rt-relative">\r\n  <img width="275" height="172" class="rt-image floatleft" alt="Image" src="images/stories/demo/general/install2-j15.jpg" />\r\n  <img width="275" height="172" class="rt-image" alt="Image" src="images/stories/demo/general/install2-j17.jpg" />\r\n</p>\r\n\r\n<div class="clear"></div>\r\n\r\n<div class="module-title"><h2 class="title">RocketLauncher Instructions</h2><div class="clear"></div></div>\r\n\r\n<p>We always recommend installing a RocketLauncher first to trial and understand the template more efficiently. It must be installed as <strong>new</strong>, and <strong>not</strong> over an existing Joomla install.</p>\r\n\r\n<h3>Step 1 - Upload</h3>\r\n\r\n<ul class="medmarginbottom">\r\n  <li><strong>Download</strong> the RocketLauncher</li>\r\n  <li><strong>Unzip</strong></li>\r\n  <li><strong>Upload</strong> the created folder to your server</li>\r\n</ul>\r\n\r\n<p class="notice"><strong>Note:</strong> You can upload all the files via FTP, or use cPanel or SSH to upload the zip and unzip directly onto the server. Enquire with your hosting provider.</p>\r\n\r\n<h3>Step 2 - Installation</h3>\r\n\r\n<ul>\r\n  <li>Go to <a href="#">www.yoursite.com/<em>*folder name*</em></a></li>\r\n  <li>Follow the Installation instructions</li>\r\n  <li>Ensure you click <em class="bold2">Install Sample Data</em> during installation</li>\r\n  <li><strong>(J! 1.5)</strong> Delete the <strong>/installation</strong> directory on your server</li>\r\n  <li><strong>(J! 2.5)</strong> Remove the installation folder in the Installation interface</li>\r\n</ul>', '', 1, 0, 0, 11, '2012-01-30 21:51:17', 42, '', '0000-00-00 00:00:00', 0, 42, '2015-08-26 01:27:15', '2012-01-30 21:51:17', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":null,"urlatext":"","targeta":"","urlb":null,"urlbtext":"","targetb":"","urlc":null,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 1, 0, 4, '', '', 1, 526, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(8, 48, 'Logo Editing', 'logo-editing', '', '<div class="module-title">\r\n	<h1 class="title"><span>Logo</span> Editing</h1>\r\n</div>\r\n\r\n<p>The following is a step by step guide to customising your Clarion logo image by replacing the logo text with your own organization or company''s name and logo.</p>\r\n\r\n<p class="notice">Gantry sets the dimensions of the logo, so CSS modification is unnecessary.</p>\r\n\r\n<h3>Step 1 - Open the File</h3>\r\n\r\n<img src="images/stories/demo/logo/logo1.jpg" alt="Logo" width="220" height="90" class="rt-image floatleft" />\r\n\r\n<ul style="margin-left: 240px;">\r\n	<li>Open the <strong>logo-source.png</strong> file in Adobe&reg; Fireworks.</li>\r\n</ul>\r\n\r\n<ul style="margin-left: 240px;">\r\n	<li>In the right column, find <strong>Layers</strong>. Select the <strong>Web layers</strong> directory and click the eye icon to the left of the logo slice (the green object). This will make the slice invisible so you can edit the file.</li>\r\n</ul>\r\n\r\n<div class="clear"></div><br />\r\n\r\n<h3 class="nomargintop">Step 2 - Text/Slogan/Icon Editing</h3>\r\n\r\n<ul>\r\n	<li>Double click on the logo text. Now you can edit the text of logo to your choosing. Edit the icon as desired.</li>\r\n</ul>\r\n	<img src="images/stories/demo/logo/logo2.jpg" alt="Logo" width="220" height="90" class="rt-image floatleft" />\r\n	<img src="images/stories/demo/logo/logo3.jpg" alt="Logo" width="220" height="90" class="rt-image floatleft" />\r\n	<div class="clear"></div>\r\n	<br />\r\n	<img src="images/stories/demo/logo/logo4.jpg" alt="Logo" width="220" height="90" class="rt-image floatleft" />\r\n	<img src="images/stories/demo/logo/logo5.jpg" alt="Logo" width="220" height="90" class="rt-image floatleft" />	\r\n\r\n<div class="clear"></div><br />\r\n\r\n<img src="images/stories/demo/logo/logo6.jpg" alt="Logo" width="220" height="90" class="rt-image floatleft largemarginbottom" />\r\n\r\n<h3 class="nomargintop">Step 3 - Slice Modification</h3>\r\n\r\n<ul style="margin-left: 240px;">\r\n	<li>Reactivate the Slice in the Web Layers column, this will place a green rectangle over the logo image. Change the size of the slice (or move it) to match the new size if applicable.</li>\r\n</ul>\r\n<div class="clear"></div>\r\n\r\n<div class="clear"></div><br />\r\n\r\n<img src="images/stories/demo/logo/logo7.jpg" alt="Logo" width="220" height="90"  class="rt-image floatleft largemarginbottom" />\r\n\r\n<h3 class="nomargintop">Step 4 - Export</h3>\r\n\r\n<ul style="margin-left: 240px;">\r\n	<li>Now you will want to export the logo. Right click on the image slice and select <strong>Exported Selected Slices...</strong> from the contextual menu. Export it to your computer.</li>\r\n</ul>\r\n<div class="clear"></div>', '', 1, 0, 0, 11, '2012-01-30 21:51:26', 42, '', '0000-00-00 00:00:00', 0, 42, '2015-08-26 01:30:59', '2012-01-30 21:51:26', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":null,"urlatext":"","targeta":"","urlb":null,"urlbtext":"","targetb":"","urlc":null,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 1, 0, 3, '', '', 1, 498, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(9, 49, 'Preset Styles', 'preset-styles', '', '<p class="attention">Access the Style Control settings from: <strong>Admin → Extensions → Template Manager → <em>(J! 1.5) rt_clarion_j15</em> or <em>(J! 2.5) rt_clarion</em> → Settings</strong></p>\r\n\r\n<p>Simple configure the options, then save and Gantry will automatically load the modified preset to your site.</p>\r\n\r\n<div class="module-title"><h2 class="title">Style Setting</h2><div class="clear"></div></div>\r\n\r\n<ul>\r\n	<li><strong>Body Style:</strong> Light - Dark; Determine the body shade/style</li>\r\n	<li><strong>Background Style:</strong> <em>wavy-lines-light, wavy-lines-dark, diagonal-lines-light, diagonal-lines-dark, cube-light, cube-dark , diamond-light, diamond-dark, carbon-light, carbon-dark, noise-light, noise-dark, paper-light, paper-dark, plaid-light, plaid-dark, rubber-ligh, rubber-dark, squares-light, squares-dark, textile-light, textile-dark, triangles-light, triangles-dark, elegant-light, elegant-dark, grunge-light, grunge-dark, dustnscratches-light, dustnscratches-dark, fibers-light, or fibers-dark</em>; Set which background style set you wish to load</li>\r\n	<li><strong>Load Transition:</strong> On - Off; Enable or disable the page loading transition animation effects</li>\r\n	<li><strong>Web Fonts:</strong> <em>On - Off, Google Font Directory</em>; WebFonts allow you to use 3rd party WebFonts from providers such as Google. You must SAVE then APPLY before the new fonts will show up in the Font Family dropdown.</li>\r\n	<li><strong>Font Settings</strong>: Select a font family from the available options and also choose a default font size\r\n		<ul>\r\n			<li><strong>Font Family:</strong> Clarion, Geneva, Optima, Helvetica, Trebuchet, Lucida, Georgia, Palatino, or <strong>Various Google Fonts</strong> <em>(dropdown)</em></li>\r\n			<li><strong>Font Size:</strong> Default, Extra Large, Large, Small, Extra Small <em>(dropdown)</em></li>\r\n		</ul>\r\n	</li>\r\n</ul>\r\n\r\n<div class="module-title"><h2 class="title">Assigning a Style to a Specific Page</h2><div class="clear"></div></div>\r\n\r\n<p>With Gantry, the ability to assign a certain style to an individual page has never been easier and/or more efficient. Just follow these simple steps:</p>\r\n\r\n<ul>\r\n	<li><strong>(J! 1.5)</strong> Go to <strong>Extensions → Template Manager → rt_clarion_j15 &rarr; Menu Items &rarr; <em>*Menu Item*</em></strong></li>\r\n	<li><strong>(J! 2.5)</strong> Go to <strong>Extensions → Template Manager → rt_clarion &rarr; Assignments &rarr; <em>*Menu Item*</em></strong><br /><br /></li>	\r\n\r\n	<li><strong>(J! 1.5)</strong> Select your preset from <strong>Presets → Style Presets</strong>, configure and save.</li>\r\n	<li><strong>(J! 2.5)</strong> Select your preset from <strong>Show Presets</strong>, configure and save.</li>\r\n</ul>\r\n\r\n<a href="http://gantry-framework.org/documentation/joomla/configure/per-menu-item-configuration" class="readon"><span>Gantry Framework: Per Menu Item Controls</span></a>', '', 1, 0, 0, 11, '2012-01-30 21:51:38', 42, '', '0000-00-00 00:00:00', 0, 42, '2015-08-26 01:26:17', '2012-01-30 21:51:38', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":null,"urlatext":"","targeta":"","urlb":null,"urlbtext":"","targetb":"","urlc":null,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 1, 0, 2, '', '', 1, 684, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', '');
