(19, 60, 'Frontpage Article', 'frontpage-article', '', '<img class="rt-image floatright medmarginbottom"  alt="image" src="images/stories/demo/frontpage/fp-mainbody-1.jpg" width="320" height="210" />\r\n<div class="title5 floatleft"><div class="module-title"><h2 class="title">Professional Template</h2></div></div>\r\n<p>Built on the <strong>Gantry Framework</strong>, Clarion has a range of powerful, flexible and intuitive features and functions.</p>\r\n<p>The administrative interface offers a user friendly control panel for intricately customizing the <strong>template layouts</strong>.</p>\r\n<a href="index.php?option=com_content&amp;view=article&amp;id=25&amp;Itemid=107" class="nobold"><span>View All Features +</span></a>', '', 1, 0, 0, 11, '2012-01-30 21:56:21', 42, '', '2012-01-31 23:33:12', 42, 42, '2015-08-26 01:28:00', '2012-01-30 21:56:21', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":null,"urlatext":"","targeta":"","urlb":null,"urlbtext":"","targetb":"","urlc":null,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 3, 0, 1, '', '', 1, 357, '{"robots":"","author":"","rights":"","xreference":""}', 1, '*', ''),
(21, 63, 'RokGallery', 'rokgallery', '', '<div class="rt-demo-grid-3">\r\n	<div class="rt-center rt-upper">\r\n		<img class="rt-image medmarginbottom medmargintop" src="images/stories/demo/frontpage/fp-roktabs-1.jpg" alt="RocketTheme" width="100" height="85" />\r\n		<strong>Gallery</strong>\r\n	</div>\r\n</div>\r\n<div class="rt-demo-grid-5 nomarginright">\r\n	<h3 class="medmarginbottom medmargintop">RokGallery Styled Template</h3>\r\n	<p>RokGallery is an advanced photo gallery solution for Joomla, that rests on a custom tagging architecture.It supports a native application style slice editor (non-destructive) to individually control and edit uploaded images/slices.</p>\r\n	<p><a href="index.php?option=com_content&amp;view=article&amp;id=3&amp;Itemid=112" class="readon"><span>More Information</span></a></p>\r\n</div>\r\n<div class="clear"></div>', '', 1, 0, 0, 13, '2012-01-30 22:01:01', 42, '', '2012-01-31 16:52:08', 42, 42, '2012-10-25 20:33:15', '2012-01-30 22:01:01', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":null,"urlatext":"","targeta":"","urlb":null,"urlbtext":"","targetb":"","urlc":null,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 2, 0, 1, '', '', 1, 491, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(22, 64, 'RokTabs', 'roktabs', '', '<div class="rt-demo-grid-3">\r\n	<div class="rt-center rt-upper">\r\n		<img class="rt-image medmarginbottom medmargintop" src="images/stories/demo/frontpage/fp-roktabs-2.jpg" alt="RocketTheme" width="100" height="85" />\r\n		<strong>Tabs</strong>\r\n	</div>\r\n</div>\r\n<div class="rt-demo-grid-5 nomarginright">\r\n	<h3 class="medmarginbottom medmargintop">Tabbed Content Modules</h3>\r\n	<p> RokTabs is a tabbed content module, standalone and sporting its own themes (light and dark). Content is transitions, either by fade or scroll, and is powered by mootools. The module can be fully automated, switching based on time or manually by user interaction.</p>\r\n	<p><a href="index.php?option=com_content&amp;view=article&amp;id=3&amp;Itemid=112" class="readon"><span>More Information</span></a></p>\r\n</div>\r\n<div class="clear"></div>', '', 1, 0, 0, 13, '2012-01-30 22:01:08', 42, '', '2012-01-31 16:52:13', 42, 42, '2013-09-17 23:15:40', '2012-01-30 22:01:08', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":null,"urlatext":"","targeta":"","urlb":null,"urlbtext":"","targetb":"","urlc":null,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 2, 0, 2, '', '', 1, 333, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(23, 65, 'RokNewsPager', 'roknewspager', '', '<div class="rt-demo-grid-3">\r\n	<div class="rt-center rt-upper">\r\n		<img class="rt-image medmarginbottom medmargintop" src="images/stories/demo/frontpage/fp-roktabs-3.jpg" alt="RocketTheme" width="100" height="85" />\r\n		<strong>Accordion</strong>\r\n	</div>\r\n</div>\r\n<div class="rt-demo-grid-5 nomarginright">\r\n	<h3 class="medmarginbottom medmargintop">Paged Content Module</h3>\r\n	<p>RokNewsPager is an article previewer and rotator. It displays content articles, in a summarised form and rotates through a series of pages displaying articles in a contracted list format. Included are a multitude of parameters to customize how your news is displayed.</p>\r\n	<p><a href="index.php?option=com_content&amp;view=article&amp;id=3&amp;Itemid=112" class="readon"><span>More Information</span></a></p>\r\n</div>\r\n<div class="clear"></div>', '', 1, 0, 0, 13, '2012-01-30 22:01:15', 42, '', '2012-01-31 16:52:18', 42, 42, '2012-10-05 18:47:44', '2012-01-30 22:01:15', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":null,"urlatext":"","targeta":"","urlb":null,"urlbtext":"","targetb":"","urlc":null,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 2, 0, 3, '', '', 1, 337, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(24, 66, 'RokTwittie', 'roktwittie', '', '<div class="rt-demo-grid-3">\r\n	<div class="rt-center rt-upper">\r\n		<img class="rt-image medmarginbottom medmargintop" src="images/stories/demo/frontpage/fp-roktabs-4.jpg" alt="RocketTheme" width="100" height="85" />\r\n		<strong>Tweet</strong>\r\n	</div>\r\n</div>\r\n<div class="rt-demo-grid-5 nomarginright">\r\n	<h3 class="medmarginbottom medmargintop">Twitter Display Module</h3>\r\n	<p>RokTwittie is a module that integrates Twitter into your Joomla site. Display tweets of any username, or even by search terms, as well as your profile information and various other elements from Twitter itself. RokTwittie is the perfect way to integrate Twitter.</p>\r\n	<p><a href="index.php?option=com_content&amp;view=article&amp;id=3&amp;Itemid=112" class="readon"><span>More Information</span></a></p>\r\n</div>\r\n<div class="clear"></div>', '', 1, 0, 0, 13, '2012-01-30 22:01:24', 42, '', '2012-01-31 16:52:23', 42, 42, '2013-09-17 23:15:50', '2012-01-30 22:01:24', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":null,"urlatext":"","targeta":"","urlb":null,"urlbtext":"","targetb":"","urlc":null,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 2, 0, 5, '', '', 1, 358, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(25, 67, 'Template Features', 'template-features', '', '<div class="module-title">\r\n	<h1 class="title"><span>Clarion</span> Template Features</h1>\r\n</div>	\r\n<h4>A Professional Business Template</h4>\r\n<p>Clarion, the February 2012 template release, is a subtle theme, primed for business use or as a platform for extensive individual customization. Clarion continues the chain of impressive, revolutionary, yet functional RocketTheme templates. It combines incredible styling with refined and powerful code to help your website achieve its maximum potential.</p>\r\n\r\n<div class="rt-center largemarginbottom largepaddingtop">\r\n	<img src="images/stories/demo/general/template-features/template-features-big.png" alt="Clarion" width="909" height="370" />\r\n</div><br />\r\n\r\n<div class="rt-demo-grid-12">\r\n\r\n\r\n	<div class="rt-demo-grid-3 nomarginleft">\r\n		<ul class="checkmark blue nomarginbottom">\r\n			<li><strong>12 Preset Styles</strong><br />Choose one of the included preset styles by specifying it in the template manager</li>\r\n		</ul>\r\n	</div>\r\n\r\n	<div class="rt-demo-grid-3">\r\n		<ul class="checkmark blue nomarginbottom">\r\n			<li class="nomarginbottom"><strong>78 Module Positions</strong><br />To get you started right, Clarion is utilized with plenty of available modules</li>\r\n		</ul>	\r\n	</div>\r\n\r\n	<div class="rt-demo-grid-3">\r\n		<ul class="checkmark blue nomarginbottom">\r\n			<li class="nomarginbottom"><strong>K2 Compatibility Styling</strong><br />Clarion provides styled support for K2 to visually integrate the component</li>\r\n		</ul>\r\n	</div>\r\n\r\n	<div class="rt-demo-grid-3 nomarginright">\r\n		<ul class="checkmark blue nomarginbottom">\r\n			<li class="nomarginbottom"><strong>RokExtensions Styling</strong><br />There is compatibility styling for some major RocketTheme extensions in this template</li>\r\n		</ul>	\r\n	</div>	\r\n\r\n</div>\r\n\r\n<div class="clear"></div>\r\n\r\n<div class="module-title rt-center largemargintop largepaddingtop nomarginbottom">\r\n	<h3 class="title"><span>Interested?</span> Want to Use Clarion for Your Website?</h3>\r\n	<a target="_blank" href="http://www.rockettheme.com/joomla-templates/clarion" class="readon largemargintop"><span>Download Clarion Now</span></a>\r\n</div>\r\n\r\n<div class="clear"></div>\r\n\r\n<div class="title5 largepaddingbottom"><div class="module-title"><div class="title">&nbsp;</div></div></div>\r\n\r\n\r\n<div class="rt-demo-grid-4 rt-center nomarginright">\r\n	<div class="module-title  nomarginbottom">\r\n		<h3 class="title"><span>Styles</span> Variation</h3>\r\n	</div>\r\n	<em>Multiple Preset Styles</em>\r\n	<a href="index.php?option=com_content&amp;view=article&amp;id=9&amp;Itemid=127"><img width="280" height="100" class="rt-image largemargintop" src="images/stories/demo/general/template-features/feature-1.png" alt="Clarion" /></a>\r\n</div>\r\n\r\n<div class="rt-demo-grid-4 rt-center nomarginright">\r\n	<div class="module-title  nomarginbottom">\r\n		<h3 class="title"><span>Modules</span> Layout</h3>\r\n	</div>\r\n	<em>Versatile &amp; Flexible Layout</em>\r\n	<a href="index.php?option=com_content&amp;view=article&amp;id=1&amp;Itemid=108"><img width="280" height="100" class="rt-image largemargintop" src="images/stories/demo/general/template-features/feature-2.png" alt="Clarion" /></a>\r\n</div>\r\n\r\n<div class="rt-demo-grid-4 rt-center nomarginright">\r\n	<div class="module-title  nomarginbottom">\r\n		<h3 class="title"><span>Module</span> Variations</h3>\r\n	</div>\r\n	<em>Fashion &amp; Style the Module</em>\r\n	<a href="index.php?option=com_content&amp;view=article&amp;id=2&amp;Itemid=109"><img width="280" height="100" class="rt-image largemargintop" src="images/stories/demo/general/template-features/feature-3.png" alt="Clarion" /></a>\r\n</div>\r\n\r\n<div class="clear"></div><br />\r\n\r\n<div class="rt-demo-grid-4 rt-center nomarginright">\r\n	<div class="module-title  nomarginbottom">\r\n		<h3 class="title"><span>Menu</span> Options</h3>\r\n	</div>\r\n	<em>Integrated Powerful Menu System</em>\r\n	<a href="index.php?option=com_content&amp;view=article&amp;id=5&amp;Itemid=111"><img width="280" height="100" class="rt-image largemargintop" src="images/stories/demo/general/template-features/feature-4.png" alt="Clarion" /></a>\r\n</div>\r\n\r\n<div class="rt-demo-grid-4 rt-center nomarginright">\r\n	<div class="module-title  nomarginbottom">\r\n		<h3 class="title"><span>Typography</span></h3>\r\n	</div>\r\n	<em>Make the Content Sexier</em>\r\n	<a href="index.php?option=com_content&amp;view=article&amp;id=4&amp;Itemid=110"><img width="280" height="100" class="rt-image largemargintop" src="images/stories/demo/general/template-features/feature-5.png" alt="Clarion" /></a>\r\n</div>\r\n\r\n<div class="rt-demo-grid-4 rt-center nomarginright">\r\n	<div class="module-title  nomarginbottom">\r\n		<h3 class="title"><span>Styled</span> Extensions</h3>\r\n	</div>\r\n	<em>RocketTheme Extensions Styled</em>\r\n	<a href="index.php?option=com_content&amp;view=article&amp;id=3&amp;Itemid=112"><img width="280" height="100" class="rt-image largemargintop" src="images/stories/demo/general/template-features/feature-6.png" alt="Clarion" /></a>\r\n</div>\r\n\r\n<div class="clear"></div><br />\r\n\r\n<div class="rt-demo-grid-4 rt-center nomarginright">\r\n	<div class="module-title  nomarginbottom">\r\n		<h3 class="title"><span>K2</span> Styled</h3>\r\n	</div>\r\n	<em>Visually K2 Integration</em>\r\n	<a href="index.php?option=com_content&amp;view=article&amp;id=3&amp;Itemid=112"><img width="280" height="100" class="rt-image largemargintop" src="images/stories/demo/general/template-features/feature-7.png" alt="Clarion" /></a>\r\n</div>\r\n\r\n<div class="rt-demo-grid-4 rt-center nomarginright">\r\n	<div class="module-title  nomarginbottom">\r\n		<h3 class="title"><span>Tutorials</span> &amp; Guides</h3>\r\n	</div>\r\n	<em>Learn the Template Configuration</em>\r\n	<a href="index.php?option=com_content&amp;view=article&amp;id=6&amp;Itemid=122"><img width="280" height="100" class="rt-image largemargintop" src="images/stories/demo/general/template-features/feature-8.png" alt="Clarion" /></a>\r\n</div>\r\n\r\n<div class="rt-demo-grid-4 rt-center nomarginright">\r\n	<div class="module-title  nomarginbottom">\r\n		<h3 class="title"><span>Joomla!</span> Stuff</h3>\r\n	</div>\r\n	<em>Styled for Regular Joomla! Stuffs</em>\r\n	<a href="index.php?option=com_content&amp;view=article&amp;id=10&amp;Itemid=148"><img width="280" height="100" class="rt-image largemargintop" src="images/stories/demo/general/template-features/feature-9.png" alt="Clarion" /></a>\r\n</div>\r\n\r\n<div class="clear"></div>\r\n\r\n<div class="title5 largepaddingbottom"><div class="module-title"><div class="title">&nbsp;</div></div></div>\r\n\r\n<div class="rt-demo-grid-8 nomarginright">\r\n	<div class="module-title">\r\n		<h1 class="title"><span>Gantry Framework</span> Features</h1>\r\n	</div>\r\n	<div class="rt-demo-grid-4 nomarginright nomarginleft">\r\n		<ul class="checkmark blue nomarginbottom">\r\n			<li><strong>960 Grid System</strong><br />CSS grid framework for constructing web content based on a width of 960 pixels</li>\r\n			<li class="nomarginbottom"><strong>Per-menu-item Configuration</strong><br />Powerful feature in Gantry to control configuration on a per-menu-item basis</li>\r\n		</ul>\r\n	</div>\r\n\r\n	<div class="rt-demo-grid-4 nomarginright">\r\n		<ul class="checkmark blue nomarginbottom">\r\n			<li><strong>iPhone / Android Compatible</strong><br />iPhone, iPod Touch, iPad, and Android custom theme support</li>	\r\n			<li class="nomarginbottom"><strong>Grid RTL Support</strong><br />Built in RTL support which will automatically order the layout to support RTL.</li>\r\n		</ul>	\r\n	</div>	\r\n\r\n	<a href="images/stories/demo/general/template-features/rtl-layout.jpg" rel="rokbox[371 700]" title="RTL Layout">\r\n	<img width="300" height="240" class="floatleft nomarginright largemargintop" src="images/stories/demo/general/template-features/feature-11.png" alt="RTL Layout" /></a>\r\n\r\n	<img style="margin-right: -3px;" width="263" height="200" class="floatright largemargintop" src="images/stories/demo/general/template-features/feature-12.png" alt="iPhone/Android Compatible" />\r\n</div>\r\n\r\n<div class="rt-demo-grid-4 title5 nomarginleft nomarginright largemargintop largepaddingtop">\r\n	<img width="300" height="392" src="images/stories/demo/general/template-features/feature-13.png" alt="Clarion" />\r\n</div>\r\n\r\n<div class="clear"></div>', '', 1, 0, 0, 11, '2012-01-30 22:01:35', 42, '', '2012-01-31 16:57:55', 42, 42, '2013-09-17 23:05:56', '2012-01-30 22:01:35', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":null,"urlatext":"","targeta":"","urlb":null,"urlbtext":"","targetb":"","urlc":null,"urlctext":"","targetc":""}', '{"show_title":"0","link_titles":"0","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 4, 0, 0, '', '', 1, 612, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', '');
