(26, 69, 'Home', 'home', '', '<table border="0" cellspacing="0" cellpadding="0">\r\n<tbody>\r\n<tr>\r\n<td>\r\n<h4 class="style2">Welcome to All Credit Lenders! <br />Serving Customers Since 1999<br />in the State of Illinois </h4>\r\n<p><span style="color: #51c11d;"><strong>Short on Cash? Need Emergency Funds? Bad Credit? We can help!</strong></span></p>\r\n<p class="style3">Call us at 1-847-836-8593</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table border="0" cellspacing="0" cellpadding="5">\r\n<tbody>\r\n<tr>\r\n<td valign="top">\r\n<p>At All Credit Lenders, we are committed to you as our customer, and are here to make your loan process as fast and easy as we can. All Credit Lenders ensures the safety of all your personal information on our site. All sensitive data transmitted between your browser and our website uses 128 bit Secure Socket Layer (SSL) encryption technology.</p>\r\n<br />\r\n<p><strong>What kind of Loans can I expect to find</strong>?</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table border="0" cellspacing="0" cellpadding="5">\r\n<tbody>\r\n<tr>\r\n<td valign="top"><img src="images/home-merch.jpg" border="0" width="150" height="134" /></td>\r\n<td valign="top">\r\n<h3 style="margin: 0px 0px 5px !important;">Line Of Credit</h3>\r\n<p>A Line of Credit is a quick, easy, and confidential way to get a loan. Terms and Fees vary by state, and are only available in certain states. The application process only takes a few minutes and less then perfect credit will qualify. Apply once online and the application will be approved for a credit limit. You can request advances up to your credit limit at any time. While your loan is active you may request additional funds when needed, up to your available credit limit. Generally, after on time payments are made, additional credit limits can be applied for.</p>\r\n<p><!--[if gte mso 9]><xml>\r\n <w:WordDocument>\r\n  <w:View>Normal</w:View>\r\n  <w:Zoom>0</w:Zoom>\r\n  <w:TrackMoves/>\r\n  <w:TrackForma