sumer reports or credit information and inform you as to matters affecting your credit based on the available information.</p>\r\n<p><strong>Paper Billing Statement Fee:</strong> We encourage the use of paperless electronic statement as a measure to help protect the environment. If you sign up to receive electronic statements with us, we will not charge the Paper Billing Statement Fee.</p>\r\n<p><strong><a href="index.php?option=com_content&amp;view=article&amp;id=27&amp;Itemid=201">Click Here For Details </a> </strong></p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p> </p>', '', 1, 0, 0, 2, '2012-07-13 09:33:01', 42, '', '2015-08-26 01:22:01', 42, 0, '0000-00-00 00:00:00', '2012-07-13 09:33:01', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":null,"urlatext":"","targeta":"","urlb":null,"urlbtext":"","targetb":"","urlc":null,"urlctext":"","targetc":""}', '{"show_title":"0","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 31, 0, 20, 'payday loans, payday loans Illinois, installment loans Illinois, installment & payday loans Texas, Wisconsin, cash advance Illinois, bad credit loan, Missouri, payday loan company Illinois, south Carolina payday & installment loans, Missouri payday loans, Missouri installment loan, online payday loan, installment loan online, payday installment loan Illinois, south Carolina, Texas, Wisconsin, Missouri', 'Allcreditlenders Designed to Meet Your Financial Needs with Fast and Easy for Online Solution for a Loan up to $5000. Provides Online Payday Loans, Installment Loan, Cash Advances, Automobile Title Loan, Bad Credit Loans, Retail Installment Loans serving in five states includes Illinois, Texas, Missouri, South Carolina, Wisconsin.', 1, 344680, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(27, 70, 'Loans', 'loans', '', '<table class="child" width="100%" cellspacing="0" cellpadding="5">\r\n<tbody>\r\n<tr>\r\n<td valign="top"><span style="font-family: Arial;">All Credit Lenders has been serving customer''s needs since 1999. All Credit Lenders has convenient store locations throughout Illinois. All Credit Lenders was formed to fill your emergency loan needs with combined expediency and convenience. Here at All Credit Lenders, we treat you with courtesy and respect during your occasional cash needs. <br /> <br /> <strong><span style="font-family: Arial; font-size: large;">Cash Advance</span></strong></span> <span style="font-family: Arial;"><br />A cash advance is a short term personal loan given to a customer that is not typically secured by the customer’s residence or other real estate. Cash Advance is a general term than can refer to an installment loan, line of credit or revolving credit agreement. Short terms loans are not designed to meet your long term financial needs. <br /> <br /> <strong><span style="font-family: Arial; font-size: large;">Line Of Credit</span></strong></span> <span style="font-family: Arial;"><br /> Unlike the installment loan, a Line of Credit or Revolving Credit Plan does not have a set maturity date and is an opened credit product. You pay interest on a per diem basis based on the amount of time from when you receive a cash advance until you repay the principal. There may be additional fees associated with a Line of Credit involving cash advance fees, billing cycle fees or late fees. You will receive regular billing statements typically every month or every other week reflecting the amounts you owe. If you have a Line of Credit with a Credit Limit, you can take cash advances up to your credit limit, but not exceeding your credit limit.<br /> <br /></span><span style="font-family: Arial;"><br /> <strong><span style="font-family: Arial; font-size: large;">Installment Loans</span></strong></span> <span style="font-family: Arial;"><br />Installment loans are loans where you receive the loan amount and the repayment of your loan is made over a period of installment payment. The terms or length of the repayments if an installment loan can vary by state or by lender. The typically term for an installment loan can vary from 120 days to 2 years. The installment payments are typically due bi-weekly or monthly. The payments may be interest only or may include both principal and interest. If the loan payments are interest only than you will have to make a large balloon payment at the end of the loan as the final installment of the loan. If the payments included both principal and interest and is fully amortized, then if you make your payment timely, you will not have a balance at the end of your loan. It is important to know which type of loan you receive. One benefit to any installment loans is that it gives the borrower addition time to repay the loan and has a long term. <br /><br /> <strong><span style="font-family: Arial; font-size: large;">Typical Payment Methods</span></strong></span> <span style="font-family: Arial;"><br /> <strong>Auto ACH Loan:</strong> This payment method takes your payment out of your checking account every payment due date. You must have direct deposit to qualify. <br /><strong>Debit Card Loan:</strong>This payment method takes your payment right off your debit card every payment due date. You must have direct deposit to your debit card to qualify.<br /><strong>Walk in Loan:</strong> This payment method is offered at store locations only. Payments are made in person at the store. See store for details Locations. </span></td>\r\n</tr>\r\n</tbody>\r\n</table>', '', 1, 0, 0, 2, '2012-07-13 10:21:34', 42, '', '2014-05-01 17:07:48', 42, 0, '0000-00-00 00:00:00', '2012-07-13 10:21:34', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":null,"urlatext":"","targeta":"","urlb":null,"urlbtext":"","targetb":"","urlc":null,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 31, 0, 19, 'payday loan, installment loan, retail installment loan, payday installment loan, line of credit, payday & installment loan illinois, cash advance texas, missouri, wisconsin, south carolina, get payday loan illinois, automobile title loan.', 'Allcreditlenders : Loan information and Payment Method for Payday Loan, Installment Loan, Cash Advance, Bad Credit, Retail Installment Loans, Automobile Title Loan Serving in Illinois, Missouri, Texas, South Carolina, Wisconsin.', 1, 48214, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
