(31, 75, 'Faq', 'faq', '', '<table class="child" cellspacing="0" cellpadding="2">\r\n<tbody>\r\n<tr>\r\n<td>\r\n<table width="100%" border="0" cellspacing="0" cellpadding="0">\r\n<tbody>\r\n<tr>\r\n<td><br /> <a name="21"></a><br /> <strong>Q: What if I bank with Direct Express?</strong><br /> A: <span style="font-size: 10.0pt; font-family: Arial;"> All Credit Lenders does provide loans to individuals that bank with Direct Express at this time.<span lang="en-us">.</span></span><br /> <a name="22"></a><br /> <strong>Q: What are the hours of operation?</strong><br /> A: <span style="font-size: 10.0pt; font-family: Arial;"> All Credit Lenders will accept applications 24 hours a day, 7 days a week, every day of the year, including holidays. <br /> <br /> <strong>Internet Department Processing Hours:</strong> All Credit Lenders will process internet applications during regular business hours, Monday thru Friday 10am to 6pm CST. <br /> Store Location Hours:<br /> Monday thru Thursday: 10am to 6pm CST<br /> Friday: 10am to 7pm CST<br /> Saturday: 9am to 1pm CST<br /> <br /> If All Credit Lenders is unable to assist you with a loan, your application will be sent to one of our nationwide trusted lenders. Sometimes the lender will need additional information that can only be done during regular business hours. Hours of operation do vary depending on the lender and the time zone you are applying in. Most lenders are closed on weekends and holidays. Once your application is submitted, All Credit Lenders will try to match you with a lender that is open at the time of the application. As a reminder, all lenders can only deposit money into your bank account when your bank is open. </span><br /> <a name="23"></a><br /> <strong>Q: How do bank holidays affect my loan?</strong><br /> A: <span style="font-size: 10.0pt; font-family: Arial;"> For holidays that fall on Saturday, Federal Reserve Banks and branches are open the preceding Friday. For holidays that fall on Sunday, Federal Reserve Banks and branches are closed the following Monday. If your loan is approved on a weekend or bank holiday, typically your funds will be sent the next business day. You should contact the lender directly to confirm when the money will be deposited to your account. Also, contact your bank to verify when funds should be available. <br /> <br /> <strong>Federal Banks, Local banks, and most Cash Advance Lenders observe the following holidays:</strong> <br /> New Years Day<br /> Martin Luther King, Jr. Day <br /> Presidents Day<br /> Memorial Day<br /> Independence Day<br /> Labor Day<br /> Columbus Day<br /> Veterans Day<br /> Thanksgiving Day<br /> Christmas Day<br /> <br /> <strong>All Credit Lenders observes the following holidays:</strong><br /> New Years Day<br /> Memorial Day<br /> Independence Day<br /> Labor Day <br /> Thanksgiving Day<br /> Christmas Day<br /> <span lang="en-us">.</span></span><br /> <a name="24"></a><br /> <strong>Q: Do you provide loans Nationwide?</strong><br /> A: <span style="font-size: 10.0pt; font-family: Arial;">All Credit lenders is licensed to do loans in the state of IL. If you are a Wisconsin applicant, you can apply at https://www.allcreditlenderswi.com. Nationwide cash advance services are available in states that allow cash advance loans. All Credit Lenders has a large nationwide network of trusted lenders who can lend in most states. Apply once, and we will attempt to match you with a lender that can provide you with an advance. If that lender or the terms of the loan are not suitable to you, you can apply as many times as it takes and we will attempt to find the lender that meets your needs. </span><br /> <a name="25"></a><br /> <strong>Q: How can I tell when my loan is approved?</strong><br /> A: <span style="font-size: 10.0pt; font-family: Arial;">All Credit Lenders, or the lender that has accepted your application, will contact you through email and/or by phone. Once you are approved, you will be contacted immediately. If you were approved by All Credit Lenders, you can view your account status in the Members area on the home page. </span><br /> <a name="26"></a><br /> <strong>Q: How long does it take to get the cash after I apply?</strong><br /> A: <span style="font-size: 10.0pt; font-family: Arial;">After you hit submit on your application, All Credit Lenders or the lender you have been matched with, will receive your information immediately. Your application will then begin processing during regular business hours. You will be contacted almost immediately after submission of your application. The process usually takes 30 minutes, in some cases it may take longer. Once you have signed and accepted the terms of the loan, the money will be deposited and available the next banking day. </span><br /> <a name="27"></a><br /> <strong>Q: How do you determine the fees I pay?</strong><br /> A: <span style="font-size: 10.0pt; font-family: Arial;">The interest and fees charged vary based on both Federal and state laws. Fees and interest generally fluctuate between $16 and $30 per hundred borrowed, depending on the type of loan you get, state regulations and your personal criteria. The amount of your fees and interest will depend on the lender you are matched with and the state laws in your area. These fees and interest will be stated in the contract that you will be able to review before you sign. If the fees are not acceptable to you, then do not sign, and apply again though the members page of All Credit Lenders. </span><br /> <a name="28"></a><br /> <strong>Q: Does my loan performance get reported to the credit reporting agencies?</strong><br /> A: <span style="font-size: 10.0pt; font-family: Arial;">Typically, Cash Advance loans are not reported to the credit reporting agencies. However, in the event of non-payment, the lender may report such non payment to credit reporting agencies or agencies which collect consumer reports. </span><br /> <a name="29"></a><br /> <strong>Q: When will I need to make my first payment?</strong><br /> A: <span style="font-size: 10.0pt; font-family: Arial;">Typically, your loan or payment will be due on your next pay date. This could be anywhere between 3 and 30 days after you take out the initial loan, depending on your pay dates and source of income. Because every state varies, this does depend on your location. </span><br /> <a name="30"></a><br /> <strong>Q: Does your company do credit checks?</strong><br /> A: <span style="font-size: 10.0pt; font-family: Arial;">All Credit Lenders provides loans to applicants with Checking, Savings, and Pre-Paid Debit Cards. All Credit Lenders also work with a nationwide network of trusted lenders that will also provide loans to these individuals. Please note that in order to electronically transfer funds to your account, All Credit Lenders will need you to provide us with your routing and account number. </span><br /> <a name="31"></a><br /> <strong>Q: Is my personal and financial information secure?</strong><br /> A: <span style="font-size: 10.0pt; font-family: Arial;">All Credit Lenders understands the importance of security for your private information. Our sites use a variety of security measures to maintain the safety of your private and personal information. All sensitive data transmitted between your browser and our website uses 128 bit Secure Socket Layer (SSL) encryption technology. You can view this by looking at the URL at the top of the page. All secure sites will have an "s" after the http in the browser. So to ensure your page is secure look at the URL, if it has https in the URL, it is a secure page. EXAMPLE- https://www.allcreditlenders.net </span><br /><a name="32"></a><br /><strong>Q: What should I do if I missed my payment?</strong><br /> <span style="font-family: Arial; font-size: small;"> If you missed your payment date you should contact our representative immediately, within 1 day of the missed payment. The contact phone number is located on your Contract or you can log into our website and locate a number to reach us. </span><br /> <a name="33"></a><br /><strong>Q: What happens if my account is forwarded to the Legal Department?</strong><br /><span style="font-family: Arial; font-size: small;"> If your account is past due or in default, you should take immediate action to contact us. You may receive a correspondence and phone calls from our Company regarding this issue. You should contact our Corporate Office at 888-853-8172 immediately. Any delay can have severe consequences and may result in Legal Action against you. </span><br /> <a name="34"></a><br /><strong>Q: What happens if I fail to respond to the Legal Department correspondence or phone calls?</strong><br /> <span style="font-family: Arial; font-size: small;">If you fail to make the scheduled payment, or don’t make arrangements with the company regarding your payment, then you are not fulfilling your financial obligations as agreed upon in the contract, this is breach of contract. The Company may proceed with any necessary legal steps to recover potential loss. </span> <br /><br /></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>', '', 1, 0, 0, 2, '2012-07-13 10:25:24', 42, '', '2014-03-20 15:15:34', 42, 42, '2015-08-26 01:28:26', '2012-07-13 10:25:24', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":null,"urlatext":"","targeta":"","urlb":null,"urlbtext":"","targetb":"","urlc":null,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 18, 0, 17, 'allcreditlenders faq, payday loans, bad credit, installment loan, cash advance, retail installment loan', 'Allcreditlenders will give you answere to question for payday loans, installment loan, cash advance, retail installment loan at illinois, missouri, wisconsin, texas, south carolina.', 1, 26911, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
