(34, 78, 'About Us', 'about-us', '', '<table class="child" cellspacing="0" cellpadding="5">\r\n<tbody>\r\n<tr>\r\n<td valign="top">\r\n<p>All Credit Lenders has been serving customer''s needs since 1999. All Credit Lenders has convenient store loacations<a href="index.php?option=com_content&amp;view=article&amp;id=81&amp;Itemid=203"> </a>throughout Illinois. All Credit Lenders was formed to fill your emergency loan needs with combined expediency and convenience. Here at All Credit Lenders, we treat you with courtesy and respect during your occasional cash needs.</p>\r\n<p> </p>\r\n<p>Now you can get your cash fast and easy with our new technology in e-signatures. You can apply at the convenience of your home, sign the contract from any computer, and receive funds the same day or the next business day.</p>\r\n<p> </p>\r\n<p>Our Customer service center is open Monday - Friday 10am - 6pm CST to assist with your needs via email and phone. You can email the Customer service center directly at internet@cp.allcreditlenders.net or you can call us directly at 866-414-4702. Our customer support staff is ready to take your calls</p>\r\n<p> </p>\r\n<p>All Credit Lenders is licensed with the <a href="http://www.idfpr.com/DFIdefault.asp">Illinois Department of Financial Professional Regulations</a>,<strong>Consumer Installment Loan License Number 3323</strong>. You can be assured that All Credit Lenders will provide you with honest answers and prompt service, receiving the best customer service in the industry.</p>\r\n<p> </p>\r\n<p>All Credit Lenders is your online solution. If you are in need of cash for an unexpected expense, vacation or any reason, we are here to help.</p>\r\n<p> </p>\r\n<p>If you have any additional questions or comments, please <a href="index.php?option=com_content&amp;view=article&amp;id=35&amp;Itemid=212">contact us</a>.</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>', '', 1, 0, 0, 2, '2012-07-13 10:29:44', 42, '', '2014-04-07 18:11:38', 42, 0, '0000-00-00 00:00:00', '2012-07-13 10:29:44', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":null,"urlatext":"","targeta":"","urlb":null,"urlbtext":"","targetb":"","urlc":null,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 11, 0, 14, 'about allcreditlenders, payday loans, installment loan, retail installment loan, bad credit, cash advance', 'About Allcreditlenders for  Payday Installment Loans. AllCreditLenders was formed to fill your emergency loan needs with combined expediency and convenience', 1, 10350, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(35, 79, 'Contacts', 'contacts', '', '<table class="child" cellspacing="0" cellpadding="0">\r\n<tbody>\r\n<tr>\r\n<td>\r\n<table class="child" cellspacing="0" cellpadding="5">\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p>Thanks for visiting AllCreditLenders.net!<br /><br /> We are dedicated to making sure your All Credit Lenders experience is enjoyable.<br /> If there are any questions, comments or concerns, please contact us.</p>\r\n<br /><br />\r\n<p style="font-size: 14px;"><strong>Address :-</strong></p>\r\n<p><strong>All Credit lenders</strong><br /> <strong>PO Box 5598<br /></strong><strong>Elgin, IL 60121-5598</strong><br /> <br /> <strong>Phone Number: 1-847-836-8593</strong><br /><br /> Customer Service Hours are: <br /><br /> Monday - Friday<br /> 10am - 6pm CST<br /><br /><br /> For questions or concerns, please email <a href="mailto:%20internet@cp.allcreditlenders.net">internet@cp.allcreditlenders.net</a><br /><br /></p>\r\n<p>We pride ourselves on our excellent customer service. If you have any unresolved concerns, please email: <a href="mailto:internet@cp.allcreditlenders.net">internet@cp.allcreditlenders.net</a><br /><br /> For Link Exchange, please email: <a href="mailto:internet@cp.allcreditlenders.net"><span style="line-height: 1.3em;">internet@cp.allcreditlenders.net</span></a></p>\r\n<br /><br /></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>', '', 1, 0, 0, 2, '2012-07-13 10:30:39', 42, '', '2015-08-26 01:23:50', 42, 42, '2015-08-26 01:28:53', '2012-07-13 10:30:39', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":null,"urlatext":"","targeta":"","urlb":null,"urlbtext":"","targetb":"","urlc":null,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show