(39, 84, 'How it works', 'how-it-works', '', '<p>How it works</p>\r\n<p> </p>', '', 1, 0, 0, 2, '2012-07-13 10:46:39', 42, '', '2014-08-30 06:58:47', 42, 0, '0000-00-00 00:00:00', '2012-07-13 10:46:39', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":null,"urlatext":"","targeta":"","urlb":null,"urlbtext":"","targetb":"","urlc":null,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 4, 0, 11, 'payday loan, installment loan works, how payday loan work, how installment loan work, how cash advance work, how it works, Illinois, Texas, Missouri, South Carolina, Wisconsin', 'Payday Loans, Installment Loan, Bad Credit Loan How it works at Allcreditlenders in Illinois, Texas, Missouri, South Carolina, Wisconsin', 1, 18916, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(40, 85, 'Illinois', 'illinois', '', '<p><strong>State Regulations regarding your Loan</strong></p>\r\n<p>In addition to local and federal rules and regulations regarding your loan, your state has laws that govern the types of loans that are available. Certain state laws regulate the fees, charges and interest rates for some types of loans. You should consult your state laws before you agree to accept a loan.</p>\r\n<p>PLEASE NOTE THAT THE INFORMATION CONTAINED ON THIS SITE AND THIS SECTION IS FOR INFORMATION PURPOSES. ALSO, LAWS, RULES OR REGULATIONS ARE SUBJECT TO CHANGE AND MAY NOT BE REFLECTING ON THIS INFORMATIONAL PAGE.</p>\r\n<p>There are several types of consumer loans that are available in the State of Illinois. The Department of Financial and Professional Regulation (IDFPR) is the agency that is assigned to license and oversee many types of consumer lending including: retail loans, Consumer Installment Loans or (CILA) Loans.<br /><a href="https://www.idfpr.com/" target="_blank">Click here</a> to access the IDFPR website.<a href="http://www.ilga.gov/legislation/ilcs/ilcs.asp" target="_blank"> Click here</a> to access State of Illinois Law</p>\r\n<p>Please note that these are examples of the types of Loans within the following states. Please check with your Lender to determine the types of loans that are available to you.</p>\r\n<p><span style="line-height: 1.3em;"> </span></p>\r\n<p><a href="http://www.ilga.gov/legislation/ilcs/ilcs3.asp?ActID=1205&amp;ChapterID=20" target="_blank">Lines of Credit or Revolving Credit Plans: </a></p>\r\n<ul>\r\n<li>This is an opened ended credit product and does not have a set maturity date.</li>\r\n<li>You will pay interests and fees until you repay the cash advance.</li>\r\n<li>You will receive regular billing statements typically every monthly or every other week reflecting the amounts you owe.</li>\r\n<li>If you have a Line of Credit with a Credit Limit, you can take cash advances up to the credit limit and re-draw additional cash up to your credit limit.</li>\r\n</ul>\r\n<p> </p>\r\n<p><a href="http://www.ilga.gov/legislation/ilcs/ilcs3.asp?ActID=1204&amp;ChapterID=20" target="_blank">CILA Installment Loan: </a></p>\r\n<ul>\r\n<li>This loans are typically range from $100 - $1500.</li>\r\n<li>The terms of these loans can vary but the terms can be up to 1 year or more.</li>\r\n<li>The Max. rate of interested is 99% ARP.</li>\r\n<li>Certain fees are permitted.</li>\r\n<li>You are required to provide proof of income and paystub showing your most recent paycheck.</li>\r\n</ul>\r\n<p> </p>\r\n<p><a href="http://www.ilga.gov/legislation/ilcs/ilcs3.asp?ActID=1204&amp;ChapterID=20" target="_blank">Automobile Title Loan: </a></p>\r\n<ul>\r\n<li>This is typically an installment loan where you pledge the title of your vehicle as security for your loan. If you do not repay the loan, the lender can seek possession of your vehicle.</li>\r\n</ul>\r\n<p> </p>\r\n<p><a href="http://www.ilga.gov/legislation/ilcs/ilcs3.asp?ActID=2347&amp;ChapterID=67" target="_blank">Retail Installment Loans: </a></p>\r\n<ul>\r\n<li>This Loan is used to finance the purchase of a retail good or retail service. These loans may also be offered by the retail seller directly or by a third party sale finance company.</li>\r\n</ul>\r\n<p>For additional information about consumer loans and licensing in the State of Illinois, you can contact the Illinois Department of Financial and Professional Regulation (IDFPR)- Consumer Credit at their website: <a href="http://www.idfpr.com/" target="_blank">http://www.idfpr.com/</a> :</p>\r\n<p><strong>Springfield Office,</strong><br />320 West Washington Street, Springfield, Illinois 62786<br /> Phone: 217 785 – 0820, Toll Free: 1-888-4REGUL8 (1-888-473-4858)</p>\r\n<p><strong>Chicago Office</strong>:<br />100 West Randolph, 9th Floor<br />Chicago, Illinois 60601<br />Phone: 312-814-4500<br /> Toll Free:1-888-4REGUL8 (1-888-473-4858)</p>', '', 1, 0, 0, 20, '2012-07-13 11:02:55', 42, '', 