(46, 91, 'Missouri', 'missouri', '', '<p><a href="http://finance.mo.gov/Contribute Documents/500_quick_reference_guide_002.pdf">Payday Loans: </a></p>\r\n<ul>\r\n<li>Also referred to Small, small Loans which are loans of $500 or less.</li>\r\n<li>Such lenders must be licensed by the Division of Finance.</li>\r\n<li>State regulations place a 75% cap on interest and fees on the initial loan and renewals, limits renewals to no more than six.</li>\r\n<li>Loan terms are 14-31 days.</li>\r\n<li>This Loan may not be offered by all lenders – check with your lender.</li>\r\n</ul>\r\n<p> </p>\r\n<p><a href="http://finance.mo.gov/Contribute%20Documents/510_quick_reference_guide_002.pdf">Consumer Installment Loans: </a></p>\r\n<ul>\r\n<li>Lenders have a license under Section 408.510 - Consumer Installment Lender.</li>\r\n<li>The term must be repayable in at least four (4) equal installments over a period of 120 days or longer.</li>\r\n<li>Payments are substantially equal so the loan is generally repaid at the end of the term and there is no larger balloon payment.</li>\r\n<li>Can be computed on simple interest or pre-computed interest, secured or unsecured, subject to some limitations.</li>\r\n<li>Interests Rates are not limited by the same statutes as the small small loans (payday loans) These loans can be prepaid in full at any time without penalty.</li>\r\n<li>These loans can be prepaid in full at any time without penalty.</li>\r\n</ul>\r\n<p> </p>\r\n<p>For additional information about consumer loans and licensing in the State of Missouri, you can contact the Missouri Division of Finance at their website: <a href="http://finance.mo.gov/consumercredit/laws.php" target="_blank">http://finance.mo.gov/consumercredit/laws.php</a> <br /><strong>or Contact them at:</strong><br />Harry S Truman State Office Building, Room 630<br /> P.O. Box 716<br /> 301 W. High St.<br /> Jefferson City, MO 65102<br /> Phone: 573-751-3242<br /> Fax: 573-751-9192</p>', '', 0, 0, 0, 20, '2012-07-13 11:04:21', 42, '', '2012-09-17 06:01:14', 42, 0, '0000-00-00 00:00:00', '2012-07-13 11:04:21', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":null,"urlatext":"","targeta":"","urlb":null,"urlbtext":"","targetb":"","urlc":null,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 6, 0, 3, '', '', 1, 257, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
