(51, 96, 'Payday loan', 'payday-loan', '', '<div>\r\n<table width="100%" align="center">\r\n<tbody>\r\n<tr>\r\n<td colspan="4">\r\n<p>This is a short term loan typically due in less than 30 days. The borrower receives money and agrees to repay the amount borrowed plus interest and/or fees on the due date which may be your next payday. If the borrower does not repay the loan on the due date, then the lender may offer refinancing extending the term of the loan for another 14 or 30 days depending on the lender and the state. The borrower may incur additional finance charges. Some Lenders may request that the borrower provide a personal check as security for the repayment of the loan and in the event that the borrower does not repay the loan on the due date, the Lender will cash the check to repay the loan.</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style="text-align: center;"><img src="images/howitworks/apply.png" border="0" alt="" style="padding: 28px;" /></td>\r\n<td><img src="images/howitworks/approved.png" border="0" alt="" style="padding: 28px;" /></td>\r\n<td><img src="images/howitworks/funded.png" border="0" alt="" style="padding: 28px;" /></td>\r\n<td><img src="images/howitworks/repay.png" border="0" alt="" style="padding: 28px;" /></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<p><span style="padding-left: 60px;"><img src="images/howitworks/page_divider.png" border="0" alt="" /></span></p>\r\n<div>\r\n<p style="width: 51%; float: left; border-right: 1px solid #FFFFFF;"><span style="font-weight: bold; font-size: 1.2em; color: #ffffff;"> Loan Application Requirements<br /></span>You must meet the following requirements to become eligible<br /> to receive loan funding or Credit Services from All credit Lenders,<br />although additional requirements may be needed.<br /><br /><img src="images/howitworks/li_arrow.png" border="0" alt="" /> Have an active checking account<br /><img src="images/howitworks/li_arrow.png" border="0" alt="" /> Have been employed for at least one month<br /><img src="images/howitworks/li_arrow.png" border="0" alt="" /> Must be a US citizen or permanent resident<br /><img src="images/howitworks/li_arrow.png" border="0" alt="" /> Must be at least 18 years of age <strong>to apply at our <a href="index.php?option=com_content&amp;view=article&amp;id=81&amp;Itemid=203" target="_blank">locations</a></strong><br /><img src="images/howitworks/li_arrow.png" border="0" alt="" /> Must be 26 years of age for a loan online</p>\r\n<p style="width: 46%; float: right; margin-top: -180px; =margin-top: 0px; line-height: 1em;"><span style="font-weight: bold; font-size: 1.2em; color: #ffffff;"> Loan Funding Schedule<br /></span> <br />Today is:<span style="color: #ffffff; font-weight: bold;"> &lt;?php echo date(''l, F d'', strtotime(date(''Y-m-d''))); ?&gt;</span><br /><br />Generally, loan approved before <span style="color: #ffffff; font-weight: bold;">9;00</span> PM<br /> <span style="color: #ffffff; font-weight: bold;">CT</span> will be funded on : &lt;?php $todayDate = date("Y-m-d"); $date = strtotime(date("Y-m-d", strtotime($todayDate)) . " +1 day");echo date(''l, F d'', $date); ?&gt;<br /><br /></p>\r\n</div>\r\n<div><span style="float: right; padding: 10px;"><a class="readon" href="index.php?option=com_users&amp;view=login&amp;layout=applyloan&amp;Itemid=230"><span>Apply Now</span></a></span></div>', '', 0, 0, 0, 16, '2012-07-13 11:14:13', 42, '', '2013-04-30 06:20:21', 42, 0, '0000-00-00 00:00:00', '2012-07-13 11:14:13', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":null,"urlatext":"","targeta":"","urlb":null,"urlbtext":"","targetb":"","urlc":null,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show