(54, 99, 'CSO Loan', 'cso-loan', '', '<div>\r\n<table width="100%" align="center">\r\n<tbody>\r\n<tr>\r\n<td colspan="4">\r\n<p>A cash advance is a short term personal loan given to a customer that is not typically secured by the customer’s residence or other real estate. Cash Advance is a general term than can refer to a payday loan, an installment loan, line of credit or revolving credit agreement. Short terms loans are not designed to meet your long term financial needs.</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style="text-align: center;"><img src="images/howitworks/apply.png" border="0" alt="" style="padding: 28px;" /></td>\r\n<td><img src="images/howitworks/approved.png" border="0" alt="" style="padding: 28px;" /></td>\r\n<td><img src="images/howitworks/funded.png" border="0" alt="" style="padding: 28px;" /></td>\r\n<td><img src="images/howitworks/repay.png" border="0" alt="" style="padding: 28px;" /></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<p><span style="padding-left: 60px;"><img src="images/howitworks/page_divider.png" border="0" alt="" /></span></p>\r\n<div>\r\n<p style="width: 51%; float: left; border-right: 1px solid #FFFFFF;"><span style="font-weight: bold; font-size: 1.2em; color: #ffffff;"> Loan Application Requirements<br /></span>You must meet the following requirements to become eligible<br /> to receive loan funding or Credit Services from All credit Lenders,<br />although additional requirements may be needed.<br /><br /><img src="images/howitworks/li_arrow.png" border="0" alt="" /> Have an active checking account<br /><img src="images/howitworks/li_arrow.png" border="0" alt="" /> Have been employed for at least one month<br /><img src="images/howitworks/li_arrow.png" border="0" alt="" /> Must be a US citizen or permanent resident<br /><img src="images/howitworks/li_arrow.png" border="0" alt="" /> Must be at least 18 years of age</p>\r\n<p style="width: 46%; float: right; margin-top: -180px; =margin-top: 0px; line-height: 1em;"><span style="font-weight: bold; font-size: 1.2em; color: #ffffff;"> Loan Funding Schedule<br /></span> <br />Today is:<span style="color: #ffffff; font-weight: bold;"> &lt;?php echo date(''l, F d'', strtotime(date(''Y-m-d''))); ?&gt; </span><br /><br />Generally, loan approved before <span style="color: #ffffff; font-weight: bold;">9;00</span> PM<br /> <span style="color: #ffffff; font-weight: bold;">CT</span> will be funded on : &lt;?php $todayDate = date("Y-m-d"); $date = strtotime(date("Y-m-d", strtotime($todayDate)) . " +1 day");echo date(''l, F d'', $date); ?&gt;<br /><br /></p>\r\n</div>\r\n<div><span style="float: right; padding: 10px;"><a class="readon" href="index.php?option=com_application&amp;view=loan&amp;Itemid=230"><span>Apply Now</span></a></span></div>', '', 0, 0, 0, 16, '2012-07-13 11:17:43', 42, '', '2014-08-30 07:03:21', 42, 42, '2015-08-26 01:28:47', '2012-07-13 11:17:43', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":null,"urlatext":"","targeta":"","urlb":null,"urlbtext":"","targetb":"","urlc":null,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 22, 0, 3, '', '', 1, 0, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(55, 100, 'Line of credit', 'line-of-credit', '', '<div>\r\n<table width="100%" align="center">\r\n<tbody>\r\n<tr>\r\n<td colspan="5">\r\n<p>Unlike the installment loans, a Line of Credit or Revolving Credit Plan does not have a set maturity date and is an open ended credit product. You pay interest on a per diem basis based on the amount of time from when you receive a cash advance until you repay the principal. There may be additional fees associated with a Line of Credit involving cash advance fees, billing cycle fees or late fees. You will receive regular billing statements typically every month or every other week reflecting the amounts you owe. If you have a Line of Credit with a Credit Limit, you can take cash advances up to the credit limit, but not exceeding your credit limit.</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style="text-align: center;"><img src="images/howitworks/apply.png" border="0" alt="" width="160" height="220" style="padding: 8px;" /></td>\r\n<td><img src="images/howitworks/approved.png" border="0" alt="" width="160" height="220" style="padding: 8px;" /></td>\r\n<td><img src="images/howitworks/advances.png" border="0" alt="" width="160" height="220" style="padding: 8px;" /></td>\r\n<td><img src="images/howitworks/funded.png" border="0" alt="" width="160" height="220" style="padding: 8px;" /></td>\r\n<td><img src="images/howitworks/repay.png" border="0" alt="" width="160" height="220" style="padding: 8px;" /></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<p><span style="padding-left: 60px;"><img src="images/howitworks/page_divider.png" border="0" alt="" /></span></p>\r\n<div>\r\n<p style="width: 51%; float: left; border-right: 1px solid #FFFFFF;"><span style="font-weight: bold; font-size: 1.2em; color: #ffffff;"> Loan Application Requirements<br /></span>You must meet the following requirements to become eligible<br /> to receive loan funding or Credit Services from All credit Lenders,<br />although additional requirements may be needed. <br 