(72, 120, 'Disclaimer', 'disclaimer', '', '<div><span style="font-family: Arial;"> Please note that nothing contained on the website shall constitute an offer or solicitation to lend unless specifically notify that <a href="http://www.allcreditlenders.net">www.allcreditlenders.net</a> and All Credit Lenders and will provide you a loan directly. The website: <a href="http://www.allcreditlenders.net">www.allcreditlenders.net</a> and All Credit Lenders may or may not be the lender for your loan. If the loan is submitted to the network of lenders, All Credit Lenders does not make that loan or credit decisions regarding that loan and your information will be provided to a network of lenders. </span></div>\r\n<div><span style="font-family: Arial;"><br /></span></div>\r\n<div><span style="font-family: Arial;">In that case, <a href="http://www.allcreditlenders.net">www.allcreditlenders.net</a> and All Credit Lenders is not and does not act as a representative, agent, or correspondent for any service provider or lender.Unless notified that <a href="http://www.allcreditlenders.net">www.allcreditlenders.net</a> and All Credit Lenders will be providing you a loan directly, <a href="http://www.allcreditlenders.net">www.allcreditlenders.net</a> and All Credit Lenders will try to determine the most suitable lenders who will be able to satisfy the needs of a particular consumer. </span></div>\r\n<div><span style="font-family: Arial;"><br /></span></div>\r\n<div><span style="font-family: Arial;"><a href="http://www.allcreditlenders.net">www.allcreditlenders.net</a> and All Credit Lenders do not endorse any particular service provider, lender, nor loan product. You are under no obligation to use <a href="http://www.allcreditlenders.net">www.allcreditlenders.net</a> and All Credit Lenders ''s service to apply for credit or any loan product with any service provider or lender.</span></div>\r\n<div><span style="font-family: Arial;"><br /></span></div>\r\n<div><span style="font-family: Arial;"><a href="http://www.allcreditlenders.net">www.allcreditlenders.net</a> and All Credit Lenders does not guarantee that completing an application form will result in you obtaining a loan or the rates or terms for a loan. Service providers or lenders will typically not perform credit checks with the three major credit reporting bureaus: Experian, Equifax, or Trans Union. However, credit checks or consumer reports through alternative providers such as Teletrack, which typically will not affect your credit score, may be obtained by some service providers or lenders, in certain circumstances. </span></div>\r\n<div><span style="font-family: Arial;"><br /></span></div>\r\n<div><span style="font-family: Arial;">You will not be charged any fees to use <a href="http://www.allcreditlenders.net">www.allcreditlenders.net</a> and All Credit Lenders and the fees are charges will be explained if you receive a loan from a Lender.</span></div>', '', 1, 0, 0, 2, '2012-07-18 13:13:08', 42, '', '2012-09-26 11:47:42', 42, 42, '2015-08-26 01:28:39', '2012-07-18 13:13:08', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":null,"urlatext":"","targeta":"","urlb":null,"urlbtext":"","targetb":"","urlc":null,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 3, 0, 10, '', '', 1, 5790, '{"robots":"","author"