(79, 128, 'Application Terms and Conditions', 'application-terms-and-conditions', '', '<p style="color: #101010;">I understand and agree that if driving is a requirement of the job for which I am applying, my employment is contingent on possessing a valid driver’s license for the state in which I reside and automobile liability insurance in an amount equal to the minimum required by the state where I reside.</p>\r\n<p style="color: #101010;">I understand that the Company may now have or may establish a drug free workplace and drug and/or alcohol testing program consistent with applicable federal, state and local laws.</p>\r\n<p style="color: #101010;">If the Company has such a program and I am offer a conditional offer of employment, I understand that if a pre-employment(post offer) drug and/or alcohol test is positive, the employment offer may be withdrawn. I agree to work under the conditions requiring a drug-free workplace consistent with applicable federal, state and local laws.</p>\r\n<p style="color: #101010;">I also understand that all employees of the location, pursuant to Company’s policy and federal. State and local law, may be subject to urine or blood screening or other medical tests designed to detect the presence of alcohol or illegal or controlled substances or drugs. If employed, I understand that the taking of alcohol and/or drug tests is may be a condition of continual employment and I agree to undergo alcohol and drug testing consistent with the Company’s policies and applicable federal, state and local laws.</p>\r\n<p style="color: #101010;">If employed by the Company, I understand and agree that the Company ,to the extent permitted by federal, state and local law, may exercise its right, without prior warning or notice, to conduct investigation of property (including but not limited to files, desks, vehicles, computers, etc) and in certain circumstance my personal property.</p>\r\n<p style="color: #101010;">I understand and agree that the Company and to the extent permitted by federal, state and local law, I may be required to sign a confidentiality agreement, restrictive covenant and/or conflict of interest statement.</p>\r\n<p style="color: #101010;">I certify that all the information on this application, my resume, or any supporting documents I may present during any interview is and will be complete and accurate to the best of my knowledge. I understand that any falsification, misrepresentation or omission of any information may result in disqualification from consideration for employment or, if employed, disciplinary action, up to and including immediate dismissal.</p>\r\n<p><strong style="color: #75af28;">THIS COMPANY IS AN AT-WILL EMPLOYER AS ALLOWED BY APPLICABLE STATE LAW. THIS MEANS THAT REGARDLESS OF ANY PROVISION IN THIS APPLICATION, IF HIRED, THE COMPANY MAY TERMINATE THE EMPLOYMENT RELATIONSHIP AT ANY TIME, FOR ANY REASON, WITH OR WITHOUT CAUSE OR NOTICE. NOTHING IN THIS APPLICATION OR IN ANY DOCUMENT OR STATEMENT, WRITTEN OR ORAL, SHALL LIMIT THE RIGHT TO TERMINATE EMPLOYMENT AT-WILL. NO OFFICER, EMPLOYEE OR REPRESENTATIVE OF THE COMPANY IS AUTHORIZED TO ENTERE INTO AN AGREEMENT-EXPRESSED OR IMPLIED-WITH ME OR ANY APPLICANT FOR EMPLOYMENT UNLESS SUCH AGREEMENT IS IN WRITING AND SIGNED BY THE PRESIDENT OF THE COMPANY.</strong></p>\r\n<p><strong style="color: #75af28;">IF HIRED, I AGREE TO COMFORM TO THE RULES, REGULATIONS, GUIDELINES AND PROCEDURES (“COLLECTIVELY RULES”) OF THE COMPANY. I UNDERSTAND THAT THE COMPANY HAS COMPLETE DISCRETION TO MODIFY SUCH RULES AT ANY TIME EXCEPT THAT IT WILL NOT MODIFY ITS POLICY OF EMPLOYMENT AT-WILL. </strong></p>\r\n<p style="color: #101010;">I authorize the Company or its agents to confirm all statements contained in this application and/or resume as it related to the position I am seeking and to the extent permitted by federal, state and local law. I agree to complete any authorization forms for background investigation.</p>\r\n<p style="color: #101010;">I authorize and consent to, without reservations, any party or agency contacted by this employer to furnish the above-mentioned information. I hereby release, discharge, and hold harmless to the extended permitted by federal, state and local law, any party delivering information to the Company or its authorized representative pursuant to this authorization form from any liability, claims, charges, or causes of action which I may have as a result of the delivery of disclosure of above requested information.</p>\r\n<p style="color: #101010;">I hereby release from liability the Company and its representatives for seeking such information and all other persons, corporations or organizations furnishing such information.</p>\r\n<p style="color: #101010;">If hired by this company, I understand that I will be required to provide genuine documentation establishing my identity and eligibility to be legally employed in the United States by this Company.<br />I also understand this Company employs only individuals who are legally eligible to work in the United States.</p>', '', 1, 0, 0, 2, '2012-09-15 09:00:21', 42, '', '2012-09-15 09:04:24', 42, 42, '2015-08-26 01:22:57', '2012-09-15 09:00:21', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":null,"urlatext":"","targeta":"","urlb":null,"urlbtext":"","targetb":"","urlc":null,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 2, 0, 8, '', '', 1, 1970, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
