(73, 121, 'Types of Loans & State Laws', 'types-of-loans-state-laws', '', '<p>In addition to local and federal rules and regulations regarding your loan, your state has laws that govern the types of loans that are available. Certain state laws regulate the fees, charges and interest rates for some types of loans. You should consult your state laws before you agree to accept a loan.</p>\r\n<p>PLEASE NOTE THAT THE INFORMATION CONTAINED ON THIS SITE AND THIS SECTION IS FOR INFORMATION PURPOSES. ALSO, LAWS, RULES OR REGULATIONS ARE SUBJECT TO CHANGE AND MAY NOT BE REFLECTING ON THIS INFORMATIONAL PAGE.</p>', '', 1, 0, 0, 2, '2012-08-29 11:26:46', 42, '', '2012-12-06 09:25:05', 42, 42, '2015-08-26 01:25:55', '2012-08-29 11:26:46', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":null,"urlatext":"","targeta":"","urlb":null,"urlbtext":"","targetb":"","urlc":null,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 4, 0, 9, 'payday loan law IL, payday loan, installment loan law, cash advance, law in illinois, missouri, south carolina, texas, wisconsin', 'Find out the Types of Loan and State Laws like Payday Loans, Installment Loan, Retail Automobile Loan, Cash Advance, Bad Credit and Its Law in Illinois, Texas, Missouri, South Carolina, Wisconsin at Allcreditlenders', 1, 29365, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(74, 123, 'South Carolina', 'south-carlinia', '', '<p>There are different types of consumer loans that are available in the State of South Carolina. Consumer Financial Division of the State Board of Financial Institutions is assigned to license and oversee many types of consumer lending including: deferred deposit lending and consumer installment loans.</p>\r\n<p><strong>Deferred Deposit Loans. (similar to traditional payday loans)</strong></p>\r\n<ul>\r\n<li>Under South Carolina regulations, a deferred deposit loan is a loan until your next payday typically with the maximum length term not to exceed 31 days.</li>\r\n<li>Borrower will give the Lender a personal check as security for the loan which be held by the lender and not cashed until the due date.</li>\r\n<li>There are maximum rates/charges allowed and repayment plans</li>\r\n</ul>\r\n<p> </p>\r\n<p><strong>Supervised Loans. (Installment Loans)</strong></p>\r\n<ul>\r\n<li>These are installment loans repaid in payments of both principal and interest over a period of time.</li>\r\n<li>No prepayment penalties are typically associated with these loans</li>\r\n<li>South Carolina regulations limited the amount of money that can be borrowed for this type of loan.</li>\r\n</ul>\r\n<p> </p>\r\n<p>To Contact the State Board of Financial Institutions:<br /> Click Here - <a href="https://www.scbos.sc.gov/SCBOS_Community/SCBOS_Partners/SC_Department_of_Consumer_Affairs_on_SCBOS.aspx" target="_blank"> https://www.scbos.sc.gov/SCBOS_Community/SCBOS_Partners/SC_Department_of_Consumer_Affairs_on_SCBOS.aspx</a> <br />Address: <br /> 1205 S. Pendleton Street Suite 306<br /> P.O. Box 716<br /> Columbia SC 29211<br /> 803-734-4200</p>', '', 0, 0, 0, 20, '2012-07-13 11:04:47', 42, '', '2012-09-20 06:14:36', 42, 0, '0000-00-00 00:00:00', '2012-07-13 11:04:47', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":null,"urlatext":"","targeta":"","urlb":null,"urlbtext":"","targetb":"","urlc":null,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 7, 0, 4, '', '', 1, 255, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
