(75, 124, 'Wisconsin', 'wisconsin', '', '<p>Generally, a consumer credit transaction is any loan under $25,000 primarily made for a personal, family or household purpose on which a finance charge is or may be assessed, or is payable in more than four installments. For a complete definition and exclusions from the definition, Refer to Wisconsin <a href="http://docs.legis.wisconsin.gov/statutes/statutes/421" target="_blank">Law Chapter 421, Wis. Stats.</a></p>\r\n<p><a href="http://docs.legis.wisconsin.gov/statutes/statutes/138/14" target="_blank">Payday Loans:</a></p>\r\n<ul>\r\n<li>These are short term loans typically under 90 days or less and can not exceed $1500 Verification of income is required</li>\r\n<li>A customer may provide a check as security for the repayment of the loan.</li>\r\n<li>There are limits on the default rates that can be charged</li>\r\n<li>These loans can be prepaid in full at any time without penalty.</li>\r\n</ul>\r\n<p><a href="http://docs.legis.wisconsin.gov/statutes/statutes/138/09" target="_blank">Installment Loans :</a></p>\r\n<ul>\r\n<li>Generally, a Lender is licensed under 138.09 of the Wis. Stats that permits a lender to charge interest in excess of 18% APR per year.</li>\r\n<li>Payments are substantially equal so the loan is generally repaid at the end of the term and there is no larger balloon payment.</li>\r\n<li>The terms(length) of these loans can vary but the terms are more than 6 months and can be more than 1 year.</li>\r\n<li>These loans can be prepaid in full at any time without penalty.</li>\r\n</ul>\r\n<p>For additional information about consumer loans and licensing in the State of Wisconsin, contact the Wisconsin Department of Financial Institutions: DFI at their website: <a href="http://www.wdfi.org/fi/lfs/" target="_blank">http://www.wdfi.org/fi/lfs/</a><br /> <strong>or Contact them at:</strong><br />Department of Financial Institutions<br /> 345 W Washington Avenue<br /> Madison, WI 53703<br /> Office Hours: 7:45 am - 4:30 pm<br /> Telephone: (608) 261-9555<br /> TTY: (608) 266-8818 For hearing-impaired callers.<br /> Fax: (608) 261-7200</p>', '', 0, 0, 0, 20, '2012-07-13 11:04:56', 42, '', '2012-09-17 06:00:16', 42, 0, '0000-00-00 00:00:00', '2012-07-13 11:04:56', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":null,"urlatext":"","targeta":"","urlb":null,"urlbtext":"","targetb":"","urlc":null,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 3, 0, 2, '', '', 1, 309, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
