(86, 137, 'Cash Advance', 'cash-advance', '', '<table border="0" cellspacing="0" cellpadding="5">\r\n<tbody>\r\n<tr>\r\n<td valign="top"><img src="images/home-money.jpg" border="0" width="150" height="109" /></td>\r\n<td valign="top">\r\n<h3 style="margin: 0px 0px 5px !important;">Cash Advance</h3>\r\nA Cash Advance is also known as Payday Advance, Payday Loans, Cash Loans, Installment Loans, Fast Cash, Fast Loans, Bad Credit Loans, CILA loans, Short Term Consumer Loans, Line of Credit Loans, Retail Loans, or a Deferred Deposit Loan. The names are different but the purpose is the same, to help you meet short-term, unexpected needs. <br /><strong><a href="index.php?option=com_content&amp;view=article&amp;id=27&amp;Itemid=201">Click Here For Details</a></strong></td>\r\n</tr>\r\n</tbody>\r\n</table>', '', 0, 0, 0, 2, '2013-08-07 19:49:03', 42, '', '2013-08-07 20:05:44', 42, 42, '2015-08-26 01:23:15', '2013-08-07 19:49:03', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":null,"urlatext":"","targeta":"","urlb":null,"urlbtext":"","targetb":"","urlc":null,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 2, 0, 3, '', '', 1, 67, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(83, 134, 'CONSENT TO ELECTRONIC AND TELEPHONE COMMUNICATIONS', 'consent-to-electronic-and-telephone-communications', '', '<p style="color: #101010;">You hereby consent and agree (the "Consent") that any notices we are required to make to you may be delivered to you electronically. You agree that any notices we are required to make to you may be delivered to you electronically. You expressly consent to the Company contacting you at any phone number listed on your application or contract, via consumer service representative, auto dialed, computer generated contact systems or dialing assistant program including home address or email address provided on this document, updated by you or provided by your references in the future, or ascertained by Company through its resources. You acknowledge and agree to the following terms and conditions of this Consent and that you may request a copy of this Consent for your records by contacting the Company as the address or email provided. You agree that:</p>\r\n<ul>\r\n<li style="color: #101010;">Any disclosure, notice, record or other type of information that is provided to you in connection with your application or transaction with us, including but not limited to, the Application, or any written or electronic agreement, this Consent, the Application, change−in−term notices, fee and transaction information, statements, delayed disbursement notices, notices of adverse action, state mandated brochures and disclosures, and transaction information ("Communications"), may be sent to you electronically by posting the information at our web site, provided at the top of this agreement, or by sending it to you by email.</li>\r\n</ul>\r\n<ul>\r\n<li style="color: #101010;">You may obtain a copy of any Communication by contacting us at Lender’s email provided at the top of this agreement or by calling us at Lender’s phone number provided at the top of this agreement. You also can withdraw your consent to ongoing electronic communications in the same manner, and ask that they be sent to you in paper or non-electronic form.</li>\r\n</ul>\r\n<ul>\r\n<li style="color: #101010;">You agree to provide us with your current email address for notices at the email address or phone number indicated at the top of this agreement. If your email address, telephone number(s), or residences address changes, you must send us a notice of the new address/telephone number(s) by writing to us or sending us an email, at least five (5) days before the change.</li>\r\n</ul>\r\n<ul>\r\n<li style="color: #101010;">In order to receive electronic communications, you will need a working connection to the Internet and an email account. . Your browser must support the Secure Sockets Layer (SSL) protocol. You must have a printer or sufficient hard drive space available to save the information. If you have a question about your browser and the SSL protocol, please contact your Internet Service Provider or a qualified information technology service provider.</li>\r\n</ul>\r\n<ul>\r\n<li style="color: #101010;">We may amend (add to, delete or change) the term of this Consent by providing you with advance notice.</li>\r\n</ul>', '', 1, 0, 0, 2, '2012-12-04 09:35:06', 42, '', '2013-09-17 23:19:44', 42, 42, '2015-08-26 01:29:04', '2012-12-04 09:35:06', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":null,"urlatext":"","targeta":"","urlb":null,"urlbtext":"","targetb":"","urlc":null,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 2, 0, 6, '', '', 1, 1332, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', '');
