(78, 127, 'Texas', 'texas', '', '<p style="font-weight: bold;">What is a CSO or Credit Service Organization ("CSO")?</p>\r\n<p>Under the Texas Code of Finance, a Credit Service Organization provides one of the following services:</p>\r\n<ul>\r\n<li>Improving a consumer''s credit history or rating,</li>\r\n<li>Obtaining an extension of consumer credit for the consumer or</li>\r\n<li>Providing advice or assistance to a consumer regarding the previous two services.</li>\r\n</ul>\r\n<p style="font-weight: bold;">What services does the CSO provide to you:</p>\r\n<ul>\r\n<li>arrange for a loan for you at a rate of interest not to exceed 10% per annum,</li>\r\n<li>issue a letter of credit to secure the repayment of such loan; and</li>\r\n<li>assist you in preparing related information and documents (e.g., loan applications, credit reports, and loan documents).</li>\r\n</ul>\r\n<p><span style="font-weight: bold;">CSO is not your lender.</span> The CSO arranges for you to obtain a loan with a third party Lender. The CSO is not your lender and does not act as a fiduciary of the Lender. You will entered into a loan with a Third party Lender, not the CSO. The CSO will provide a Letter of Credit to the third party lender on your behalf.</p>\r\n<p><span style="font-weight: bold;">CSO Fees.</span> The CSO will charge a fee for their services calculated daily based on the amount of your loan. You will not owe any fee unless you obtain a Loan. The CSO fee may continue to accrue until the Loan is repaid in full.</p>\r\n<p style="font-weight: bold;">Disclosure for Credit Access Business (CAB):</p>\r\n<p>The CSO is a Credit Access Business under the Texas Code of Finance. Please note as follows:</p>\r\n<ul>\r\n<li>If you payoff your Loan off early, there will be no prepayment penalty;</li>\r\n<li>The CSO is also a Credit Access Business, that complies with Chapter 392 of the Tex. Fin. Code (“TFC”) and the federal Fair Debt Collection Practices Act (15 U.S.C. Section 1692 et seq.) with respect to an extension of consumer credit described by Section 393.602(a) of TFC;</li>\r\n<li>The CSO will not threaten or pursue criminal charges against a consumer related to a check or other debit authorization provided by the consumer as security for a transaction in the absence of forgery, fraud, theft, or other criminal conduct;</li>\r\n<li>The CSO complies, to the extent applicable, with 10 U.S.C. Section 987 and any regulations adopted under that law with respect to an extension of consumer credit described by Section 393.602(a);</li>\r\n</ul>\r\n<p>If you would like more information, please contact <br />The Office of Consumer Credit Commissioner of Texas<br />2601 N Lamar Blvd, Austin TX<br /> 78705(800) 538-1579, <br /> <a href="mailto:consumercomplaints@occc.state.tx.us.">consumercomplaints@occc.state.tx.us.</a> <a href="http://www.occc.state.tx.us./" target="_balank">www.occc.state.tx.us</a></p>\r\n<p><span style="font-weight: bold;">Notice:</span> This cash advance is not intended to meet long-term financial needs. This loan should only be used to meet immediate short term cash needs. Renewing the loan rather than paying the debt in full when due will require the payment of additional charges.</p>\r\n<p><span style="font-weight: bold;">Letter of credit:</span> To obtain a Loan at a rate of interest not to exceed 10%, you will need to request that the CSO issue an irrevocable letter of credit in favor of the third-party lender in accordance with Chapter 5 of the Texas Uniform Commercial Code - Letters of Credit, in an amount not to exceed principal, interest, late charges and returned check fees on the loan that is arranged. The third party lender is able to demand payment on the Letter of Credit from us and you will be authorizing the CSO to pay on the Letter of Credit upon presentation to us of documentation complying with the conditions set forth in your Loan Agreement and you understand that the CSO is not responsible for determining the accuracy of any statement made by the third-party lender and that the CSO’s duty is strictly to pay upon proper presentation of documents.</p>\r\n<p><span style="font-weight: bold;">Please note:</span> The information contained on this website is for general informational purpose only and you should not rely upon any such information. The terms of your loan and Agreement with the CSO may vary. You must review the terms of your Loan Agreement and Disclosure for the specific terms of your Loan and CSO Agreement. Before agreeing to accept any Loan or signing any Agreement, please feel free to consult with a customer service representative if you have any questions or would like to discuss any terms contained therein.</p>', '', 0, 0, 0, 20, '2012-09-04 06:30:19', 42, '', '2012-09-18 14:06:34', 42, 0, '0000-00-00 00:00:00', '2012-09-04 06:30:19', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":null,"urlatext":"","targeta":"","urlb":null,"urlbtext":"","targetb":"","urlc":null,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 30, 0, 5, '', '', 1, 363, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
