(84, 135, 'Privacy policy', 'privacy-policy', '', '<p><strong>This policy replaces and supersedes any previous privacy policy that you may have seen, received or reviewed on our website, any document, loan agreement, application, or any other document previously delivered to you. If there are conflicts between this Policy and any other policy, the terms of this Policy shall control until revised.</strong></p>\r\n<p>“You” or “Your” means you as a participant in or as a user of the products and/or services offered by CMK Investments Inc. d/b/a All Credit Lenders, its affiliates, agents or assignees. CMK Investments Inc. d/b/a All Credit Lenders (“ACL”) is serious about protecting your privacy. This notice is provided to you on behalf of CMK Investments Inc. d/b/a All Credit Lenders and their affiliated companies (hereafter collectively referred to as the “CMK Investments Inc. d/b/a All Credit Lenders Companies,” “we,” “our,” or “us”). All information transmitted, printed or otherwise submitted to us shall be deemed to be our property and we shall be free to use such information for any lawful purpose described herein, and for other purposes as required or permitted by law.</p>\r\n<p>1. <strong>Please read this notice carefully.</strong> This notice provides important information about the way we collect, share, and protect your information. This privacy policy applies to anyone who applies for or uses our products or services, or visits our websites, including, but not limited to, current and former customers. This statement shall describe our sharing practices when you establish a customer relationship while you are a customer. A customer relationship begins when you obtain a financial product or service from us. A customer relationship terminates when you pay off a transaction in full</p>\r\n<p>2.<strong> What we will not do:</strong> ACL send SMS (Short Message Services) or TEXT messages unless you have provided consent or OPTed IN.</p>\r\n<p>3. <strong>Collecting Information.</strong> We collect personal identifiable information, including, but not limited to, non-public personal information, as well as other types of personally identifiable information from you and from other sources as described herein (collectively, “Your Information”). Our primary goal in collecting your Information also helps us personalize and improve your customer experience with us. We collect and/or track the following types of information: (i) Information we receive from you on applications or other forms, such as transaction documents, sales documents, online forms, e-mails, registration forms, surveys, or other documents or submissions related to the products and services we provide, including your name, address, telephone number, social security number, driver’s license number, email address, employment information, demographic information, bank account information, and information about your assets, debts and income, (ii) information about your transactions with us, our affiliates such as your account history, transaction balances, payment history, overdraft history, parties to transactions, and your reasons for doing business with us; (iii) information we receive from third parties, such as consumer reporting agencies and other lenders, regarding your credit worthiness and credit history, and to verify your identity; (iv) information we obtain to verify representations made by you, such as your employment history or income; (v) Information obtained from home server domain names, IP address, type of client computer, and type of Web browser; vi) Information you provides via email, online application or to any representatives.</p>\r\n<p>4.<strong> We use Your Information:</strong> to provide you with products and services you request; Offer you additional products, promotions or services, from us or from others, that may be of interest to you; Comply with all reporting and other legal requirements; enhance your experience at our websites; Process payments and update account records; Analyze customer demographics, payment histories, and preferences; conduct statistical analyses; and provide our advertisers with editorial or feedback information.</p>\r\n<p>5. <strong>Sharing Your Information.</strong> ACL may share or sell Your Information with any other of its afiliated Companies and with other companies with whom any ACL does business (“Non-Affiliated Third Parties”) as permitted by law and described in this Privacy Policy. These Affiliated Companies and Non-Affiliated Third Parties may be (1) financial service providers, such as consumer lenders, small loan lenders, tax refund anticipation loan lenders, loan brokers, deferred deposit providers, check cashers, supervised lenders, delayed deposit providers, deferred presentment providers, collection agencies, consumer reporting agencies, banks, credit card providers, debit card providers, or agents, contractors, or representatives of any of the foregoing; (2) non-financial companies, such as retailers, tax preparers, payroll service providers, advertisers, marketing companies, lead generators, advertisers on our websites, companies or individuals that do industry-related research, surveys or polls, automobile dealers, and any person who offers a non-financial product or service, and holding companies, or agents, contractors, or representatives of any of the foregoing; and (3) other businesses, such as lead generators, non-profit organizations, trade associations, and industry analysts or agents, contractors, or representatives of any of the foregoing. Affiliated Companies and Non-Affiliated Third Parties may use your Information for any legal purpose, including, but not limited to, developing and promoting new or joint products, improving existing products and services, and contacting you to offer products and services that may be of interest to you. We may also disclose Your Information, as described above, to companies who perform services on our behalf or to other financial institutions with which we have joint marketing agreements. ACL may also disclose Your Information to Affiliated Companies and Non-Affiliated Third Parties that provide services to us (“Service Providers”). We contract with service providers to perform certain functions on our behalf. Examples include database providers who assist in identity verification, credit scoring companies, magazine publishers, retailers, and direct marketers. Their access is limited only to the personal data needed to perform their functions, and only for the purpose of performing those functions, and they are prohibited from using or disclosing Your Information for other purposes. We also may release your Information if it becomes necessary for compliance with the law or to protect the rights, property, or safety of our websites, our users, or third parties. We reserve the right to release such personal data to law enforcement or other governmental officials as we, in our sole and absolute discretion, deem necessary to comply with the law. In addition, we reserve the right to use and disclose Your Information that is not in individually identifiable form as we deem appropriate in our sole discretion.</p>\r\n<p>6. <strong>Notice of Furnishing Negative Information. <span style="text-decoration: underline;">WE MAY REPORT INFORMATION ABOUT YOUR ACCOUNT TO CREDIT BUREAUS. LATE PAYMENTS, MISSED PAYMENTS, OR OTHER DEFAULTS ON YOUR ACCOUNT MAY BE REFLECTED IN YOUR CREDIT REPORT OR OTHER REPORTS THAT CONTAIN INFORMATION ABOUT YOUR CREDIT, CREDIT HISTORY OR PAYMENT HISTORY.</span></strong></p>\r\n<p>7.<strong> Our Right to Contact You.</strong> We reserve the right to contact you regarding your account status, the collection of payments if due or pending and changes to subscriber agreements, our privacy policy, or any other policies or agreements relevant to you. By visiting our websites, you understand and agree that we may contact you at the phone number(s) or email address(es) you provide to us through our websites or on your transaction agreements, applications, loan documents or any other document to assist you with your product or to discuss other products and services that a CMK Investments Inc. d/b/a All Credit Lenders Company may provide for you.</p>\r\n<p>8.<strong> Cookies and Automatic Data Collected.</strong> We may receive and store certain types of information whenever you interact with our websites. For example, like many websites, we use “cookies” to obtain certain types of information when your web browser accesses our websites and when you login, such as: your name and your email address. Cookies are pieces of information that are transferred to your computer’s hard drive via your web browser. They allow us to provide you with a more convenient and personalized shopping experience by recording information about your preferences. A web browser is usually set to accept cookies automatically but can be changed to decline them. The Help section of the toolbar on most web browsers will tell you how to prevent your browser from accepting new cookies, how to have the web browser notify you when you receive a new cookie or how to disable cookies altogether. In most cases, a visitor may refuse a cookie and still fully navigate our websites.</p>\r\n<p>9. <strong>Your Right to Limit the Sharing of Your Information.</strong> In some circumstances, you have the right to direct ACL to not share Your Information with its Affiliated Companies and/or Non-Affiliated Third Parties (i.e. “Opt-Out”). Please note that even if you Opt-Out, ACL may still share your Information with its Affiliated Companies and Non-Affiliated Third Parties as permitted or required by law. Also, ACL may share information it collects regarding its transactions and experiences with you with its Affiliated Companies. ACL may also share all information it collects about you with Affiliated Companies and Non-Affiliated Third Parties: to facilitate providing our services to you, to administer our business, in order to receive services from those companies, as permitted under joint marketing agreements, and as otherwise permitted or required by law. ACL is delivering this notice to you on behalf of itself and all other CMK Investments Inc. d/b/a All Credit Lenders affiliated Companies. You may limit how the CMK Investments Inc. d/b/a All Credit Lenders ’s Affiliated Companies use Your Information shares with them. Federal law gives you the right to limit some but not all marketing from ACL. You may limit a ACL from marketing their products or services to you based on your Information that they receive from ACL. This information may include your income, your account and payment history, and your credit history, report or score.</p>\r\n<p>10. <strong>Opt-Out Information and Notice.</strong> To limit ACL’s sharing of Your Information with Affiliated Companies and Non- Affiliated Third Parties, as described above, contact us: On the web: <a href="https://www.allcreditlenders.net/" target="_blank">www.allcreditlenders.net</a>, or By email: <a href="mailto:internet@cp.allcreditlenders.net">internet@cp.allcreditlenders.net</a>. Unless we hear from you, we can begin sharing Your Information thirty (30) days from the date we first deliver this Notice to you. However, you may Opt-Out at any time by contacting us. Once we receive your Opt-Out request, we will stop sharing this information as soon as reasonably practicable. Your Opt- Out request will remain in effect until you notify us otherwise in writing.</p>\r\n<p>11. <strong>How We Protect Your Information.</strong> We restrict access to Your Information to those employees that are necessary who need to know that information to provide products or services to you. We maintain physical, electronic, and procedural safeguards that comply with federal regulations to guard Your Information.</p>\r\n<p>12. O<strong>ur Right to Change This Policy.</strong> We reserve the right to change this policy at any time by either providing you a revised copy of the policy, or notifying you of the existence and location of the new or revised privacy policy.</p>', '', 1, 0, 0, 2, '2013-03-05 05:33:47', 42, '', '2013-09-23 20:32:31', 42, 42, '2015-08-26 01:26:24', '2013-03-05 05:33:47', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":null,"urlatext":"","targeta":"","urlb":null,"urlbtext":"","targetb":"","urlc":null,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 9, 0, 5, '', '', 1, 10073, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', '');
