(85, 136, 'Terms & Conditions', 'terms-conditions', '', '<p>Notice: A short term loan provides the cash needed to meet an immediate short-term cash flow problem. It is not a solution for longer term financial problems for which longer term financing may be more appropriate. You may want to discuss your financial situation with a nonprofit financial counseling service in your community. You may be charged additional fees if you renew the loan.</p>\r\n<p><strong>Terms and Conditions of Use</strong></p>\r\n<p>1. <strong>Age Restriction and Acknowledgement BY USING, ACCESSING THE WEBSITE OR ANY MATERIALS OR CONTENT ON WEBSITE, YOU, THE USER ARE REPRESENTING THAT YOU ARE EIGHTEEN YEARS OLD OR OLDER ALL USERS MUST BE AT LEAST 18 YEARS OF AGE OR OLDER THERE ARE NO EXCEPTIONS</strong></p>\r\n<p>2. <strong>Your Acceptance.</strong> By using, and by accessing the materials at Websites or interfacing in any matter with the Website and/or visiting this website (collectively, including all content and functionality available through the Allcreditlenders.net domain name, the "allcreditlenders.net”,“allcreditlenders.com”,“allcreditlenders.biz", or “Site”, "Website" or “Company”) , you confirm and acknowledge your agreement to (1) these Terms and Conditions Agreement and (2) allcreditlenders.net’s privacy notice, and incorporated here by reference and also incorporated here by reference. If you do not agree to any of these terms, the Company privacy notice, or the Community Guidelines, please do not use, connect, access, or download any content to the allcreditlenders.net Website. This Terms and Conditions Agreement is an electronic agreement that sets out the Terms and Conditions of the Website and User’s use and access of the Website. CMK Investments d/b/a All Credit Lenders reserves the right at its sole discretion, to change, modify, add or remove portions of these Terms and Conditions, at any time. It is your responsibility to check these Terms and Conditions periodically for changes. Your continued use of the Site following the posting of changes will mean that you accept and agree to the changes. As long as you comply with these Terms and Conditions. CMK Investments d/b/a All Credit Lenders grants you a personal, non-exclusive, non-transferable, limited privilege to enter and use the Site</p>\r\n<p>3.<strong> Electronic Agreement.</strong> This Agreement is an electronic contract that sets out the legally binding terms of your use of the Website. This Agreement may be modified by allcreditlenders.net by posting on its website from time to time and such modifications to be effective upon posting. This Agreement includes the Privacy Policy and any specific policies regarding Advertisers or Venders and any notices regarding the Website. By accessing the Website, you accept this Agreement and agree to the terms, conditions, and notices contained or referenced herein. Further you consent to the use of electronic signatures under the Esignature Act and any similar state Act.</p>\r\n<p>4<strong>. CONSENT TO ELECTRONIC AND TELEPHONE COMMUNICATIONS:</strong> The following terms and conditions govern electronic communications in connection with this Agreement and the transaction evidenced hereby (the "Consent"). By this Agreement, you agree that any notices we are required to make to you may be delivered to you electronically. You agree that any notices we are required to make to you may be delivered to you electronically. You expressly consent to the Company contacting you at any phone number listed on your application or contract, including home address or email address provided on this document, updated by you or provided by your references in the future, or ascertained by Company through its resources. You acknowledge and agree to the following terms and conditions of this Consent and that you have received a copy of this Consent for your records. You agree that:</p>\r\n<ul>\r\n<li>Any disclosure, notice, record or other type of information that is provided to you in connection with your transaction with us, including but not limited to, this Agreement, this Consent, the Application, change−in−terms notice, fee and transaction information, statements, delayed disbursement notices, notices of adverse action, state mandated brochures and disclosures, and transaction information ("Communications"), may be sent to you electronically by posting the information at our web site, provided at the top of this agreement, or by sending it to you by email.</li>\r\n<li>You may obtain a copy of any Communication by contacting us at Lender’s email provided at the top of this agreement or by calling us at Lender’s phone number provided at the top of this agreement. You also can withdraw your consent to ongoing electronic communications in the same manner, and ask that they be sent to you in paper or non-electronic form.</li>\r\n<li>You agree to provide us with your current email address for notices at the email address or phone number indicated at the top of this agreement. If your email address, telephone number(s), or residence address changes, you must send us a notice of the new address/telephone number(s) by writing to us or sending us an email, at least five (5) days before the change.</li>\r\n<li>In order to receive electronic communications, you will need a working connection to the Internet and an email account. . Your browser must support the Secure Sockets Layer (SSL) protocol. You must have a printer or sufficient hard drive space available to save the information. If you have a question about your browser and the SSL protocol, please contact your Internet Service Provider or a qualified information technology service provider.</li>\r\n<li>We may amend (add to, delete or change) the term of this Consent by providing you with advance notice</li>\r\n</ul>\r\n<p>4.<strong>SMS (TEXT MESSAGING) STATEMENT NOTIFICATIONS DISCLOSURE:</strong> This SMS Statement Notifications Disclosure ("Disclosure") applies to your account with the Lender if you have elected to receive Short Message Service (SMS) messages.</p>\r\n<p>As used in this Disclosure, "SMS Statement Notifications" means any SMS (text message) communications from us to you pertaining to your Agreement, including but not limited to payment information, account information, due dates, delinquent accounts, program updates, promotions, coupons and other marketing messages</p>\r\n<ul>\r\n<li>How To Unsubscribe: You may withdraw your consent to receive SMS Statement Notifications by calling us at Lender’s phone number provided at the top of this agreement. We will not impose any fee to process the withdrawal of your consent to receive SMS Statement Notifications. Any withdrawal of your consent to use SMS Statement Notifications will be effective only after we have a reasonable period of time to process your withdrawal.</li>\r\n<li>To request additional information regarding text messaging call us at the Lender’s phone number provided at the top of this agreement.</li>\r\n<li>The services are available on all major carriers. Additional carriers are added as they become available.</li>\r\n<li>In order to access, view, and retain SMS Statement Notifications that we make available to you, you must have: (1) a SMS−capable mobile phone, (2) an active mobile phone account with a communication service provider; and (3) sufficient storage capacity on your mobile phone.</li>\r\n<li>All SMS Statement Notifications in electronic format from us to you will be considered "in writing".</li>\r\n<li>There is no service fee for SMS Statement Notifications but you are responsible for any and all charges, including but not limited to fees associated with text messaging, imposed by your communications service provider. Other charges may apply, such charges may include those from your communications service provider. Please consult your mobile service carrier''s pricing plan to determine the charges for sending and receiving text messages. These charges will appear on your phone bill. Message frequency depends on account settings.</li>\r\n<li>Additionally, you agree that we may send any SMS Statement Notifications through your communication service provider in order to deliver them to you and that your communication service provider is acting as your agent in this capacity You agree to provide a valid mobile phone number for these services so that we may send you certain information about your account. Additionally, you agree to indemnify, defend and hold us harmless from and against any and all claims, losses, liability, cost and expenses (including reasonable attorneys'' fees) arising from your provision of a mobile phone number that is not your own or your violation of applicable federal, state, or local law, regulation or ordinance. Your obligation under this paragraph shall survive termination of this Agreement. SMS Statement Notifications are provided for your convenience only. Receipt of each SMS Statement may be delayed or impacted by factor(s) pertaining to your communications service provider(s). We will not be liable for losses or damages arising from any disclosure of account information to third parties, non−delivery, delayed delivery, misdirected delivery or mishandling of, or inaccurate content in, the SMS Statement Notifications sent by us.</li>\r\n<li>We may modify or terminate our text messaging services from time to time, for any reason, and without notice, including the right to terminate text messaging with or without notice. Please review these Terms of Use from time to time so that you are timely notified of any changes.</li>\r\n<li>You agree and consent to be contained by the Company, its agents, employees, attorneys, affiliates, assignees, subsequent creditors, loan servicing companies and third party collectors through the use of email, telephone and/or text or SMS messages to your cellular, home or work phone numbers as well as any other phone numbers you have provided in conjunction with this loan, including the use of automatic dialing systems, autodialers or artificial or pre-recordings.</li>\r\n</ul>\r\n<p>5. <strong>Privacy Notice.</strong> CMK Investments d/b/a All Credit Lenders ''s Privacy Notice and Privacy Policy (see link) applies to use of this Site, and its terms are made a part of these Terms and Conditions by this reference. Additionally, by using the Site, you acknowledge and agree that Internet transmissions are never completely private or secure. You understand that any message or information you send to the Site may be read or intercepted by others, notwithstanding CMK Investments d/b/a All Credit Lenders ''s efforts to protect such transmissions.</p>\r\n<p>6. <strong>Security for the Site.</strong> As a condition of your use of this Site, you agree that you will not, and you will not take any action intended to: (a) view, download or access data that is not intended for any party other than you; (b) invade the privacy of, obtain the identity of, or obtain any personal information about any CMK Investments d/b/a All Credit Lenders customer or user of this Site; (c) probe or test the vulnerability of this Site or the CMK Investments d/b/a All Credit Lenders network or breach security or authentication measures without proper authorization; (d) attempt to interfere with service to any user, host or network or otherwise attempt to disrupt our business, including, without limitation, via means of uploading a virus, worm or Trojan horse to this Site, overloading, "spamming," or "crashing;" or (e) send unsolicited mail, including promotions and/or advertising of products and services or execution files. Violations of system or network security may result in civil or criminal liability.</p>\r\n<p>7. <strong>Disclaimers of Warranty and General Disclaimers.</strong> YOU AGREE THAT YOUR USE OF THE COMPANIES’ WEBSITE(S) SHALL BE AT YOUR OWN SOLE RISK. TO THE FULLEST EXTENT PERMITTED BY LAW. THE COMPANY, ITS OFFICERS, DIRECTORS, EMPL