you comply with these Terms and Conditions grants you a personal, non-exclusive, non-transferable, limited privilege to enter and use the Site.</p>\r\n<p>15.<strong> Additional Items and Miscellaneous</strong>. These Terms and Conditions constitute the entire agreement between you and CMK Investments d/b/a All Credit Lenders with regard to your use of the Site. Any and all other written or oral agreements or understandings previously existing between you and CMK Investments d/b/a All Credit Lenders with respect to such use are hereby superseded and terminated. Any failure by CMK Investments d/b/a All Credit Lenders to exercise any rights or enforce any of these Terms and Conditions shall not constitute a waiver of such rights or terms. If any provision of these Terms and Conditions is held to be invalid or unenforceable to any extent, the remainder of these Terms and Conditions shall not be affected thereby and each provision hereof shall be valid and enforced to the fullest extent permitted by law.</p>\r\n<p>This Site and its Content are directed to persons residing in the United States. You may not use or export or re-export any portion of this Site or its Content in violation of any applicable laws or regulations, including without limitation United States export laws and regulations. Copyright © 2012 CMK Investments, Inc. All rights reserved.</p>', '', 1, 0, 0, 2, '2013-03-07 14:23:39', 42, '', '2013-08-13 19:35:37', 42, 42, '2014-05-01 17:14:02', '2013-03-07 14:23:39', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":null,"urlatext":"","targeta":"","urlb":null,"urlbtext":"","targetb":"","urlc":null,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 2, 0, 4, '', '', 1, 13463, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(87, 138, 'Line of Credit 2', 'credit-line', '', '<table border="0" cellspacing="0" cellpadding="5">\r\n<tbody>\r\n<tr>\r\n<td valign="top"><img src="images/home-merch.jpg" border="0" width="150" height="134" /></td>\r\n<td valign="top">\r\n<h3 style="margin: 0px 0px 5px !important;">Line Of Credit</h3>\r\n<p>A Line of Credit is a quick, easy, and confidential way to get a loan. Terms and Fees vary by state, and are only available in certain states. The application process only takes a few minutes and less then perfect credit will qualify. Apply once online and the application will be approved for a credit limit. You can request advances up to your credit limit at any time. While your loan is active you may request additional funds when needed, up to your available credit limit. Generally, after on time payments are made, additional credit limits can be applied for.</p>\r\n<p> </p>\r\n<p class="MsoNormal">A Line of Credit works similar to a credit card. You will be approved for a credit limit, and you can get a cash advance for as much money as you need, up to your credit limit. This can be paid back, and you can get another cash advance at any time. Similar to  a credit card, you can use as much as you need at any time, after you pay it down to a zero balance, you may get another cash advance whenever you need it. The typical interest is charged at 24% APR. In addition, there is an account protection fee that is billed on your billing cycle dates. However, if you pay off your balance before your billing cycle date, you will avoid being charged this fee. In addition, if you become unemployed due to a lay-off or reduction in force (‘lay-off’) by your employer, for the period of time you are unemployed, you will not be charged the Account Protection Fee or interest from the date that you provide written confirmation of your lay-off from the employer or governmental unemployment office.</p>\r\n<p><strong>Annual Credit Review:</strong> As an additional benefit for the payment of the Account Protection Fee, at Customer’s request, Lender will review available consumer reports or credit information and inform you as to matters affecting your credit based on the available information.</p>\r\n<p><strong>Paper Billing Statement Fee:</strong> We encourage the use of paperless electronic statement as a measure to help protect the environment. If you sign up to receive electronic statements with us, we will not charge the Paper Billing Statement Fee.</p>\r\n<p><strong><a href="index.php?option=com_content&amp;view=article&amp;id=27&amp;Itemid=201">Click Here For Details</a></strong></p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>', '', 1, 0, 0, 2, '2013-08-07 21:41:21', 42, '', '2013-08-07 21:42:24', 42, 42, '2015-08-26 01:31:19', '2013-08-07 21:41:21', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":null,"urlatext":"","targeta":"","urlb":null,"urlbtext":"","targetb":"","urlc":null,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 2, 0, 2, '', '', 1, 163, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
