(10060, 'System - osolCaptcha', 'plugin', 'osolcaptcha', 'system', 0, 1, 1, 0, '{"legacy":true,"name":"System - osolCaptcha","type":"plugin","creationDate":"May 2010","author":"Sreekanth Dayanand","copyright":"(C) 2010 - Outsource Online.","authorEmail":"joomla@outsource-online.net","authorUrl":"http:\\/\\/www.outsource-online.net\\/","version":"1.0.6","description":"\\n\\t\\n\\tEasily add captcha to joomla forms for login,registration and contact us.\\n\\t<span style=\\"color:#900; font-weight:bold; font-size:larger\\">Make sure that you publish this component,from <a href=\\"index.php?option=com_plugins&filter_type=system\\">here<\\/a><\\/span>\\n\\t<h2>For adding captcha in other forms<\\/h2>\\nJust put <div>\\n\\t\\t\\t&lt?php \\n\\t\\t\\t <p>\\n\\t\\t\\t\\t\\n\\t\\t\\t\\t<br \\/>\\n\\t\\t\\t\\tglobal $mainframe;\\n\\t\\t\\t\\t<br \\/>\\n\\t\\t\\t\\t\\/\\/set the argument below to true if you need to show vertically( 3 cells one below the other)\\n\\t\\t\\t\\t<br \\/>\\n\\t\\t\\t\\t$mainframe->triggerEvent(''onShowOSOLCaptcha'', array(false)); \\n\\t\\t\\t\\t<\\/p>\\n\\t\\t\\t?&gt;\\n\\t\\t\\t<\\/div>\\nin the HTML of the form where you want the captcha to show\\t\\t\\t\\n\\n\\t\\n\\t","group":""}', '{"bgColor":"#FFFFFF","textColor":"#FF0000","imageFunction":"Adv","enableForContactUs":"Yes","enableForRegistration":"Yes","enableForReset":"Yes","enableForRemind":"Yes","botScoutProtection":"Disable","botscoutAPIKey":"","reportBotscoutNegativeMail":"","redirectURLforSuspectedIPs":"http:\\/\\/www.google.com\\/","adminPassPhrase":""}', '', '', 42, '2013-04-22 06:56:54', 0, 0),
(10061, 'xcloner-backupandrestore', 'component', 'com_xcloner-backupandrestore', '', 1, 1, 0, 0, '{"legacy":true,"name":"XCloner-BackupandRestore","type":"component","creationDate":"May 2013","author":"XCloner.com","copyright":"XCloner.com","authorEmail":"","authorUrl":"","version":"3.4","description":"\\n      <h2>XCloner Backup&Restore Utility<\\/h2>\\n      <pre>XCloner is a tool that will help you manage your website backups, generate\\/restore\\/move so your website will be always secured!\\n\\t   <a href=\\"http:\\/\\/www.xcloner.com\\"><img src=\\"http:\\/\\/www.xcloner.com\\/xcloner_p.jpg\\" border=0 style=\\"float:left; padding-right:10px;padding-bottom: 100px;padding-top:20px;\\"><\\/a>\\n      Features:\\n       -cron script to generate backup\\n       -multiple backup options\\n       -restore tool to move the website rapidly to other locations\\n       -multiple locations of where you could store the backup safelly\\n       -comnpatible with all versions of Joomla\\n\\n       For reports and suggestions please contact us at info@xcloner.com or visit us on <a href=''http:\\/\\/www.xcloner.com''>http:\\/\\/www.xcloner.com<\\/a>\\n        <\\/pre>\\n      <br\\/>\\n\\n      XCloner.com &copy; 2006-2013 | <a href=\\"http:\\/\\/www.xcloner.com\\">www.xcloner.com<\\/a>\\n      <br\\/><p\\/><br\\/>\\n\\t\\n    ","group":""}', '{}', '', '', 0, '0000-00-00 00:00:00', 0, 0),
