(10064, 'Akeeba Backup Notification Module', 'module', 'mod_akadmin', '', 1, 1, 2, 0, '{"legacy":true,"name":"Akeeba Backup Notification Module","type":"module","creationDate":"2012-03-21","author":"Nicholas K. Dionysopoulos","copyright":"Copyright (c)2009-2010 Nicholas K. Dionysopoulos","authorEmail":"nicholas@dionysopoulos.me","authorUrl":"http:\\/\\/www.akeebabackup.com","version":"3.4.3","description":"\\n\\t<h1>Akeeba Backup Notification Module<\\/h1>\\n\\t<p>This is a handy  module to display a Akeeba icon on your administrator\\n\\tback-end''s Control Panel page. The icon displays a warning site if the last\\n\\tbackup is failed, or if you haven''t backed up your site for a period of time\\n\\t(user-defined). Clicking it brings you to the Akeeba Backup &quot;Backup Now&quot;\\n\\tpage.<\\/p>\\n\\t","group":""}', '[]', '', '', 0, '0000-00-00 00:00:00', 0, 0),
(10065, 'Akeeba Backup Lazy Scheduling', 'plugin', 'aklazy', 'system', 0, 0, 1, 0, '{"legacy":true,"name":"Akeeba Backup Lazy Scheduling","type":"plugin","creationDate":"2011-04-17","author":"Nicholas K. Dionysopoulos","copyright":"Copyright (c)2010-2012 Nicholas K. Dionysopoulos","authorEmail":"nicholas@dionysopoulos.me","authorUrl":"http:\\/\\/www.akeebabackup.com","version":"3.3","description":"\\n\\t\\tAutomate your Akeeba Backup installation without using CRON, taking\\n\\t\\tadvantage of your site''s visitor activity. Important: Read the\\n\\t\\tdocumentation before proceeding. THIS PLUGIN IS NO LONGER SUPPORTED.\\n\\t\\tDO NOT REQUEST SUPPORT IF IT DOESN''T WORK. READ THE DOCUMENTATION FOR\\n\\t\\tA LIST OF KNOWN ISSUES.\\n\\t","group":""}', '{"daysfreq":"1","backuptime":"00:00","profile":"1","@spacer":"","test":"0","resetpw":""}', '', '', 0, '0000-00-00 00:00:00', 0, 0);
