(10066, 'akeeba', 'component', 'com_akeeba', '', 1, 1, 0, 0, '{"legacy":true,"name":"Akeeba","type":"component","creationDate":"2014-09-30","author":"Nicholas K. Dionysopoulos","copyright":"Copyright (c)2006-2014 Nicholas K. Dionysopoulos","authorEmail":"nicholas@dionysopoulos.me","authorUrl":"http:\\/\\/www.akeebabackup.com","version":"3.4.6","description":"Akeeba Backup Core - This old version of Akeeba Backup is no longer maintained or supported. Please upgrade to the latest Joomla!, PHP and Akeeba Backup versions.","group":""}', '{"siteurl":"https:\\/\\/www.allcreditlenders.net\\/","jlibrariesdir":"\\/home2\\/cashngo\\/public_html\\/libraries","jversion":"1.6","lastversion":"3.4.6","liveupdate":"lastcheck=1443107776\\nupdatedata=\\"\\"{\\\\\\"supported\\\\\\":true,\\\\\\"stuck\\\\\\":false,\\\\\\"version\\\\\\":\\\\\\"4.3.1\\\\\\",\\\\\\"date\\\\\\":\\\\\\"2015-08-06\\\\\\",\\\\\\"stability\\\\\\":\\\\\\"stable\\\\\\",\\\\\\"downloadURL\\\\\\":\\\\\\"http:\\\\\\\\\\\\\\/\\\\\\\\\\\\\\/cdn.akeebabackup.com\\\\\\\\\\\\\\/downloads\\\\\\\\\\\\\\/akeebabackup\\\\\\\\\\\\\\/4.3.1\\\\\\\\\\\\\\/com_akeeba-4.3.1-core.zip\\\\\\",\\\\\\"infoURL\\\\\\":\\\\\\"https:\\\\\\\\\\\\\\/\\\\\\\\\\\\\\/www.akeebabackup.com\\\\\\\\\\\\\\/download\\\\\\\\\\\\\\/akeeba-backup\\\\\\\\\\\\\\/4-3-1.html\\\\\\",\\\\\\"releasenotes\\\\\\":\\\\\\"<h3>Release highlights<\\\\\\\\\\\\\\/h3><p>    This release of Akeeba Backup fixes a low priority, minor, cosmetic issue. Never before have we released a new    version within a day just to address such a low priority, minor, cosmetic issue. We have not even done this with    medium priority issues which could have some operational impact to the software. But given the amount of    communication we received over the <em>least important cosmetic bug in the 9 years of this project''s history<\\\\\\\\\\\\\\/em>    we made a new release and have to ask you to <strong>please stop contacting us about the wrong dispkay of the total    backup size<\\\\\\\\\\\\\\/strong>. Thank you.<\\\\\\\\\\\\\\/p><h3>Joomla! 3.3\\\\\\\\\\\\\\/3.4 only<\\\\\\\\\\\\\\/h3><p>    Only Joomla! 3.3 and 3.4 (and 3.5 which is planned for release in a couple of months) is supported by this version.    We strongly recommend using the latest Joomla! At the time of this writing it is    3.4.3. Using older versions is NOT recommended <em>for security reasons<\\\\\\\\\\\\\\/em>.<\\\\\\\\\\\\\\/p><h3>PHP 5.4 or later 5.x version is required<\\\\\\\\\\\\\\/h3><p>    We have raised the minimum PHP version requirement to 5.4.0 in this version. Even though the component <em>might<\\\\\\\\\\\\\\/em>    work on PHP 5.3 we have no tested it with it and we will not support it. We''d like to remind you that Joomla! 3.x    does not currently support PHP 7. Since our software runs inside Joomla! by definition our software doesn''t    currently run on PHP 7 either.<\\\\\\\\\\\\\\/p><p>    <small>Note: there is no such thing as PHP 6. PHP versions jumped from 5.6 to 7.0. Why? Well,        <a href=\\\\\\\\\\\\\\"https:\\\\\\\\\\\\\\/\\\\\\\\\\\\\\/philsturgeon.uk\\\\\\\\\\\\\\/php\\\\\\\\\\\\\\/2014\\\\\\\\\\\\\\/07\\\\\\\\\\\\\\/23\\\\\\\\\\\\\\/neverending-muppet-debate-of-php-6-v-php-7\\\\\\\\\\\\\\/\\\\\\\\\\\\\\" rel=\\\\\\\\\\\\\\"nofollow\\\\\\\\\\\\\\">it''s a long story<\\\\\\\\\\\\\\/a>. TL;DR: It doesn''t have to make sense, just accept it.    <\\\\\\\\\\\\\\/small><\\\\\\\\\\\\\\/p><h3>Changelog<\\\\\\\\\\\\\\/h3><h4>Bug fixes<\\\\\\\\\\\\\\/h4><ul> <li>[LOW] Core: Archive integrity test would not run due to a file not being installed<\\\\\\\\\\\\\\/li> <li>[LOW] The Size in Manage Backups would be wrong as the last part''s size was counted twice<\\\\\\\\\\\\\\/li><\\\\\\\\\\\\\\/ul>\\\\\\"}\\"\\"\\nstuck=0\\n\\n[update]\\nlastcheck=\\nupdatedata="}', '', '', 0, '0000-00-00 00:00:00', 0, 0),
