(407, 0, 0, '0', 0, 66, 'com_content', '', 'en-GB', 0, 'Brandon W', 'Brandon W', 'bboyde86@aol.com', '', '', 'Very disappointed in the fact that they don''t automatically enroll you in the "new" agreement once you''ve made 10 straight payments. If you''re all about "helping your customers" this seems like an obvious must to me. Also not very pleased at the fact I wasn''t I wasn''t eligible for the pause in payments even though I was wrongfully fired and have proof to show I am currently receiving unemployment. If you''re paying for protection it shouldn''t matter what the circumstances are. However, Rob was able to give me a reduction on my interest rate from 24% to 18%. So I give them a B- for at least doing that much. Unless you need a KIDNEY or it''s life or death, don''t use these type of services. They are not your friends...<br /><br />Brandon, You and I spoke about your issue. We not only reduced your APR, but we reduced your Account protection fee. There is also no way to automatically enroll you into a new contract after you have made your 10th payment. We tell everyone to call in after that payment was made, as well as we send out letters to your home to notify you that you are qualified for a cheaper rate. The account protection fee covers reduction in work force and/or lay off. This is stated in the contract. If terminated, the account protection does not cover this. Sorry for any inconvenience and you can always ask to speak to a manager, as you did, if you feel the service was not up to our standards. Thanks for your comment. <br />~Management', '172.0.138.245', '2013-04-16 17:01:26', 0, 0, 1, 0, 0, '', 0, 0, '0000-00-00 00:00:00', ''),
(408, 0, 0, '0', 0, 66, 'com_content', '', 'en-GB', 0, 'Brandon W', 'Brandon W', 'bboyde86@aol.com', '', '', 'Also the comments are viewed before they are posted which is why you don''t see any REAL reviews...<br /><br />Brandon, All reviews, positive or negative are all posted here! All Comments go to a manger first so we can handle all reviews in a timely manor.', '172.0.138.245', '2013-04-16 17:10:08', 0, 0, 1, 0, 0, '', 0, 0, '0000-00-00 00:00:00', ''),
