(508, 0, 0, '0', 0, 66, 'com_content', '', 'en-GB', 0, 'Tyler', 'Tyler', 'Hale.tyler1@gmail.com', '', '', 'So I came to this page to put a quick note about how easy the process was and how awesome the rep that helped me was and to no surprise, there are multiple notes about how great Mark Green is!! Mark was very helpful and thorough in making sure I understood what my options were and detailing what was needed from me. He went above and beyond the standard procedure for completing my loan process as well as making sure that I had his contact information in the event that I had any further questions and if I wanted to get any further loans as I didn''t accep the full amount that I was approved for. I would (and probably will) use ACL again when if I''m ever in this situation ever again solely because of Marks excellent customer service. Once my application was completed I felt the need to call Mark back and let him know how satisfied I was which I haven''t done that with many companies representatives in any aspect of life. Mark is truly a great asset to the ACL team.', '69.245.240.115', '2013-07-26 23:58:00', 0, 0, 1, 0, 0, '', 0, 0, '0000-00-00 00:00:00', ''),
