(2367, 0, 0, '0', 0, 66, 'com_content', '', 'en-GB', 0, 'Patricia', 'Patricia', 'patriciastovall42@yahoo.com', '', '', 'Melody showed outstanding Customer Service with her knowledge, expertise and ability to communicate clearly and efficiently. I appreciated working with her in through my entire loan process. All Credit Lenders should be proud to have such a great team member! Thanks for everything, Melody', '165.20.108.40', '2015-09-24 15:50:38', 0, 0, 1, 0, 0, '', 0, 0, '0000-00-00 00:00:00', ''),
