(84, 'FP Top B', '', '<p><a href="#"><img class="floatright" src="images/stories/demo/frontpage/fp-icons.png" border="0" alt="image" width="59" height="15" /></a> <span class="floatright">Follow Us:</span></p>', 1, 'top-b', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 'mod_custom', 1, 0, '{"prepare_content":"1","backgroundimage":"","layout":"_:default","moduleclass_sfx":"","cache":"1","cache_time":"900","cachemode":"static"}', 0, '*'),
