(86, 'Template Info - Footer', '', '<div class="rt-demo-grid-8 nomarginright">\r\n	<ul class="list-icon write">\r\n    	<li><h3 class="nobold smallpaddingbottom">All the Features - in One Complete List</h3></li>\r\n 	</ul>\r\n\r\n	<div class="module-title">\r\n		<h3 class="title"><span>Clarion</span> Template</h3>\r\n	</div>\r\n\r\n	<div class="rt-demo-grid-4 nomarginright nomarginleft">\r\n		<ul class="circle green">\r\n			<li>10 Preset Styles</li>\r\n			<li>78 Module Positions</li>\r\n			<li>Powered by Gantry</li>\r\n			<li>Fusion with MegaMenu</li>\r\n			<li>SplitMenu</li>\r\n			<li>Custom Typography</li>\r\n		</ul>\r\n	</div>\r\n\r\n	<div class="rt-demo-grid-4 nomarginright">\r\n		<ul class="circle green">\r\n			<li>RokExtensions Styling</li>\r\n			<li>K2 Compatibility Styling</li>\r\n			<li>JavaScript Input Styling</li>\r\n			<li>RTL Layout Support</li>\r\n			<li>Major Browsers Support</li>\r\n			<li>W3C XHTML1.0 / CSS3 Valid</li>\r\n		</ul>	\r\n	</div>\r\n\r\n	<div class="clear"></div>\r\n\r\n	<div class="module-title">\r\n		<h3 class="title"><span>Gantry</span> Framework</h3>\r\n	</div>\r\n	<div class="rt-demo-grid-4 nomarginright nomarginleft">\r\n		<ul class="circle green nomarginbottom">\r\n			<li>960 Grid System - 6 Grids per Row</li>\r\n			<li>Per-menu-item Configuration</li>\r\n			<li>Source Ordered Mainbody</li>\r\n			<li>Extensive Administrator Interface</li>\r\n			<li>Image Smart Loading</li>\r\n		</ul>\r\n	</div>\r\n\r\n	<div class="rt-demo-grid-4 nomarginright">\r\n		<ul class="circle green nomarginbottom">\r\n			<li>iPhone / Android Compatible</li>\r\n			<li>Grid RTL Support</li>\r\n			<li>Built-in GZip and General Caching</li>\r\n			<li>Google Web Fonts Support</li>		\r\n			<li>Per Browser based CSS / JS control</li>\r\n		</ul>	\r\n	</div>\r\n\r\n	<div class="clear"></div>\r\n\r\n	<a class="readon smallmargintop" href="http://www.rockettheme.com/joomla-templates/clarion" target="_blank"><span>Download : Clarion Template</span></a>\r\n\r\n</div>\r\n\r\n<div class="rt-demo-grid-4 floatright nomarginleft nomarginright">\r\n	<ul class="list-icon info">\r\n    	<li><h3 class="nobold smallpaddingbottom">System Requirements</h3></li>\r\n 	</ul>\r\n\r\n 	<div class="title5 largepaddingbottom"><div class="module-title"><div class="title"></div></div></div>\r\n\r\n	<ul class="checkmark green">\r\n		<li><strong>Apache 2.x or Microsoft IIS 7</strong><br />\r\n			<em>Most widely deployed web server software which is required to run Joomla!</em></li>\r\n		<li><strong>PHP 5.3.x</strong><br />\r\n			<em>General-purpose server-side scripting language designed for web development.</em></li>\r\n		<li><strong>MySQL 5.0.4 or higher</strong><br />\r\n			<em>The most popular open-source database system that providing databases.</em></li>\r\n		<li><strong>Joomla! 1.5.x or Joomla! 2.5.x</strong><br />\r\n			<em>Please download the latest version of Joomla! at <a class="normalfont nobold" href="http://www.joomla.org" target="_blank">Joomla! Official Site</a>.</em></li>	\r\n		<li><strong>Gantry Framework</strong><br />\r\n			<em>Please ensure you are using the latest version of <a class="normalfont nobold" href="http://www.gantry-framework.org" target="_blank">Gantry Framework</a>.</em></li>\r\n		<li><strong>RokNavMenu Module</strong><br />\r\n			<em>Essential ingredient of <a class="normalfont nobold" href="index.php?option=com_content&amp;view=article&amp;id=5&amp;Itemid=111">powerful menu</a> system of RocketTheme templates.</em></li>\r\n	</ul>\r\n\r\n</div>', 1, 'footer-a', 42, '2014-08-30 07:39:36', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 0, '{"prepare_content":"1","backgroundimage":"","layout":"_:default","moduleclass_sfx":"","cache":"1","cache_time":"900","cachemode":"static"}', 0, '*'),
(87, 'Mobile (iPhone/Android) Positions', '', '<p>Configure at <strong>Admin &rarr; Extensions &rarr; Template Manager &rarr; rt_clarion<em>(_j15)</em> &rarr; Mobile</strong>.</p>\r\n<p class="attention">You can load either dedicated mobile positions or standard module positions in Mobile view.</p>\r\n<img src="images/stories/demo/general/positions/position-mobile-1.jpg" width="424" height="322" class="rt-image nomarginbottom" alt="image"/>', 1, 'sidebar-a', 42, '2014-08-30 07:40:34', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 1, '{"prepare_content":"1","backgroundimage":"","layout":"_:default","moduleclass_sfx":"nomarginbottom nopaddingbottom","cache":"1","cache_time":"900","cachemode":"static"}', 0, '*'),
(88, 'Gantry Grid Distribution', '', '<p>Configure at <strong>Admin → Extensions → Template Manager → rt_clarion<em>(_j15)</em> → Layouts</strong> the grid widths and allocated positions.</p>\r\n\r\n<img src="images/stories/demo/general/position-1.jpg" alt="image" width="412" height="68" class="rt-image" />\r\n<img src="images/stories/demo/general/position-2.jpg" alt="image" width="412" height="68" class="rt-image nomarginbottom" />', 13, 'sidebar-a', 42, '2014-08-30 07:40:56', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 1, '{"prepare_content":"1","backgroundimage":"","layout":"_:default","moduleclass_sfx":"nomarginbottom nopaddingbottom","cache":"1","cache_time":"900","cachemode":"static"}', 0, '*'),
(89, 'Injected Gantry Features', '', '<img width="412" height="52" alt="Non-Standard Elements" src="images/stories/demo/general/thumb-non-standard-elements.jpg" class="rt-image" />\r\n\r\n<p>There are <strong>Features</strong> that are injected into a position when enabled in the <strong>Administrator</strong>, and are stacked vertically.</p> \r\n\r\n<p>These are the Logo, Date, Font Sizer, Login Panel, Popup Model, RocketTheme Branding, Copyright, Top Top Scroller, System Messages and Reset Settings.</p>', 14, 'sidebar-a', 42, '2014-08-30 07:40:57', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 1, '{"prepare_content":"1","backgroundimage":"","layout":"_:default","moduleclass_sfx":"","cache":"1","cache_time":"900","cachemode":"static"}', 0, '*'),
(90, 'Mainbody/Sidebar Layouts', '', '<p>Configure at <strong>Admin &rarr; Extensions &rarr; Template Manager &rarr; rt_clarion<em>(_j15)</em> &rarr; Layouts</strong> the varying Mainbody/Sidebar layout possibilities.</p>\r\n\r\n<div class="rt-demo-grid-4 nomarginleft">\r\n<img src="images/stories/demo/general/positions/position-config-mb2.jpg" width="290" height="70" class="rt-image" alt="image"/>\r\n</div>\r\n\r\n<div class="rt-demo-grid-4">\r\n<img src="images/stories/demo/general/positions/position-config-mb3.jpg" width="290" height="70" class="rt-image" alt="image"/>\r\n</div>\r\n\r\n<div class="rt-demo-grid-4 nomarginright">\r\n<img src="images/stories/demo/general/positions/position-config-mb4.jpg" width="290" height="70" class="rt-image" alt="image"/>\r\n</div>\r\n\r\n<div class="clear"></div>\r\n\r\n<p class="attention">Note: If no modules are assigned to the Sidebar positions, the Mainbody will become full width.</p>\r\n\r\n<div class="rt-demo-grid-4 nomarginleft">\r\n<img src="images/stories/demo/general/positions/position-sa-mb-sbc-1.jpg" width="290" height="148" class="rt-image" alt="image"/>\r\n<br />\r\n<img src="images/stories/demo/general/positions/position-mb-sa-1.jpg" width="290" height="148" class="rt-image" alt="image"/>\r\n<br />\r\n<img src="images/stories/demo/general/positions/position-sa-mb-1.jpg" width="290" height="148" class="rt-image nomarginbottom" alt="image"/>\r\n</div>\r\n\r\n<div class="rt-demo-grid-4">\r\n<img src="images/stories/demo/general/positions/position-sab-mb-sc-1.jpg" width="290" height="148" class="rt-image" alt="image"/>\r\n<br />\r\n<img src="images/stories/demo/general/positions/position-mb-sab-1.jpg" width="290" height="148" class="rt-image" alt="image"/>\r\n<br />\r\n<img src="images/stories/demo/general/positions/position-sab-mb-1.jpg" width="290" height="148" class="rt-image nomarginbottom" alt="image"/>\r\n</div>\r\n\r\n<div class="rt-demo-grid-4 nomarginright">\r\n<img src="images/stories/demo/general/positions/position-sabc-mb-1.jpg" width="290" height="148" class="rt-image" alt="image"/>\r\n<br />\r\n<img src="images/stories/demo/general/positions/position-mb-sabc-1.jpg" width="290" height="148" class="rt-image" alt="image"/>\r\n<br />\r\n<img src="images/stories/demo/general/positions/position-mb-1.jpg" width="290" height="148" class="rt-image nomarginbottom" alt="image"/>\r\n</div>', 0, 'mainbottom-a', 42, '2014-08-30 07:40:05', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 1, '{"prepare_content":"1","backgroundimage":"","layout":"_:default","moduleclass_sfx":"","cache":"1","cache_time":"900","cachemode":"static"}', 0, '*'),
(91, 'Basic: Using Layouts in Clarion', '', '<a rel="rokbox[745 505]" title="Video Tutorial :: Using Gantry Layouts" href="http://www.gantry-framework.org/media/videos/module_widths.mov">\r\n<img class="rt-image floatleft" src="images/stories/demo/general/using-layouts.jpg" alt="Using Layouts" width="150" height="150" /></a>\r\n\r\n<p>To find out about <strong>Gantry Layouts</strong> and <strong>Module Widths</strong>, check out this screencast which covers basic concepts of configuring layout with a combination of module setting and the Gantry layout control.</p>\r\n\r\n<a class="readon smallmargintop" href="http://gantry-framework.org/documentation/joomla/configure/layouts" target="_blank"><span>View : Using Gantry Layouts</span></a>', 1, 'footer-a', 42, '2014-08-30 07:39:37', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 1, '{"prepare_content":"1","backgroundimage":"","layout":"_:default","moduleclass_sfx":"","cache":"1","cache_time":"900","cachemode":"static"}', 0, '*'),
(92, 'Advanced: Adding Module Positions', '', '<a rel="rokbox[745 505]" title="Video Tutorial :: Module Positions" href="http://www.gantry-framework.org/media/videos/module_positions.mov">\r\n<img class="rt-image floatleft" src="images/stories/demo/general/module-positions.jpg" alt="Using Layouts" width="150" height="150" /></a>\r\n\r\n<p>Check out this quick screencast on <strong>Module Positions</strong> to get an overview of how module positions work within Gantry Framework. Click below button to learn how to <strong>add a new row of module positions</strong>.</p>\r\n\r\n<a class="readon smallmargintop" href="http://gantry-framework.org/documentation/joomla/customize/adding-module-positions" target="_blank"><span>Learn : Adding Module Positions</span></a>', 1, 'footer-b', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 'mod_custom', 1, 1, '{"prepare_content":"1","backgroundimage":"","layout":"_:default","moduleclass_sfx":"","cache":"1","cache_time":"900","cachemode":"static"}', 0, '*'),
(93, 'Using a Suffix', '', '<p>Enter any available suffixes at <strong>Extensions &rarr; Module Manager &rarr; <em>Module</em> &rarr; Module Class Suffix</strong>.</p>\r\n<p class="notice nomarginbottom">You can compound multiple suffixes together such as: <strong><em>box1 title3</em></strong>.</p>', 12, 'sidebar-a', 42, '2014-08-30 07:40:54', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 1, '{"prepare_content":"1","backgroundimage":"","layout":"_:default","moduleclass_sfx":"nomarginbottom","cache":"1","cache_time":"900","cachemode":"static"}', 0, '*'),
(94, 'Standard Variations: 26 Additional Module Class Suffixes', '', '<ul class="nomarginbottom rt-demo-grid-4 nomarginleft">\r\n	<li><strong>rt-center:</strong> centres the content of the module.</li>\r\n	<li><strong>shadow2-10</strong> adds varying shadows around the module.</li>\r\n	<li><strong>rounded, square, basic:</strong> changes the border style of the module.</li>\r\n</ul>\r\n<ul class="nomarginbottom rt-demo-grid-4 nomarginright nomarginleft">\r\n	<li><strong>standardcase, uppercase, lowercase:</strong> change the case of the module title.</li>	\r\n	<li><strong>nomargintop, nomarginright, nomarginbottom, nomarginleft, nomarginall:</strong> removes the various margins around the module.</li>\r\n</ul>\r\n<ul class="nomarginbottom rt-demo-grid-4 nomarginright">\r\n	<li><strong>nopaddingtop, nopaddingright, nopaddingbottom, nopaddingleft, nopaddingall:</strong> removes the various paddings around the module</li>\r\n</ul>', 1, 'bottom-a', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 'mod_custom', 1, 1, '{"prepare_content":"1","backgroundimage":"","layout":"_:default","moduleclass_sfx":"nopaddingleft nopaddingright","cache":"1","cache_time":"900","cachemode":"static"}', 0, '*'),
(95, 'Box5 Title4', '', '<p>An example module using the <strong>box1 title1</strong> module class suffix.</p>\r\n<p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Donec sit amet nibh.</p>\r\n<a href="#" class="readon"><span>More</span></a>', 11, 'sidebar-a', 42, '2014-08-30 07:40:53', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 1, '{"prepare_content":"1","backgroundimage":"","layout":"_:default","moduleclass_sfx":"box5 title4 shadow2","cache":"1","cache_time":"900","cachemode":"static"}', 0, '*'),
(96, 'Box2 Title3', '', '<p>An example module using the <strong>box2 title3</strong> module class suffix.</p>\r\n<p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Donec sit amet nibh.</p>\r\n<a href="#" class="readon"><span>More</span></a>', 10, 'sidebar-a', 42, '2014-08-30 07:40:51', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 1, '{"prepare_content":"1","backgroundimage":"","layout":"_:default","moduleclass_sfx":"box2 title3","cache":"1","cache_time":"900","cachemode":"static"}', 0, '*'),
(97, 'Box1 Title1', '', '<p>An example module using the <strong>box1 title1</strong> module class suffix.</p>\r\n<p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Donec sit amet nibh.</p>\r\n<a href="#" class="readon"><span>More</span></a>', 9, 'sidebar-a', 42, '2014-08-30 07:40:51', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 1, '{"prepare_content":"1","backgroundimage":"","layout":"_:default","moduleclass_sfx":"box1 title1","cache":"1","cache_time":"900","cachemode":"static"}', 0, '*'),
(98, 'Why Use RokCandy?', '', '<p><strong>RokCandy</strong> is the ideal solution for those with <strong>limited coding skills</strong> or those who implement our templates for their clients. It is <strong>free</strong> from the WYSIWYG editors horrific filtering habits and can be easily pre-configured for your <strong>personal needs</strong> or the needs of your client.</p>\r\n<a href="http://www.rockettheme.com/extensions-joomla/rokcandy" class="readon" target="_blank"><span>Download : RokCandy</span></a>', 1, 'footer-a', 42, '2014-08-30 07:39:38', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 1, '{"prepare_content":"1","backgroundimage":"","layout":"_:default","moduleclass_sfx":"","cache":"1","cache_time":"900","cachemode":"static"}', 0, '*'),
(99, 'Video : Using Typography', '', '<a href="http://www.rockettheme.com/video/joomla15/using-typography-joomla15.mov" title="Video Tutorial :: Joomla Using Typography Video Tutorial" rel="rokbox[540 380]"><img class="rt-image floatleft" src="images/stories/demo/general/using-typography.jpg" alt="Using Typography" width="130" height="130" /></a>\r\n<p>Check out this quick screencast to learn how to use RokCandy to enhance your Joomla! content. The tags are very easy to learn and this guide shows you how to use all the styles.</p>\r\n<a href="http://www.rockettheme.com/video/joomla15/using-typography-joomla15.mov" title="Video Tutorial :: Joomla Using Typography Video Tutorial" rel="rokbox[540 380]" class="readon"><span>Watch : Using Typography</span></a>', 1, 'footer-b', 42, '2014-08-30 07:39:43', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 1, '{"prepare_content":"1","backgroundimage":"","layout":"_:default","moduleclass_sfx":"","cache":"1","cache_time":"900","cachemode":"static"}', 0, '*'),
(100, 'Powered by RokNavMenu', '', '<img class="floatleft" src="images/stories/demo/menu-options/roknavmenu.png" width="80" height="80" />\r\n<p>RokNavMenu is an essential ingredient of the RocketTheme templates. It provides various functions which are above and beyond the default Joomla! menu system.</p>', 1, 'utility-a', 42, '2014-08-30 07:41:01', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 1, '{"prepare_content":"1","backgroundimage":"","layout":"_:default","moduleclass_sfx":"","cache":"1","cache_time":"900","cachemode":"static"}', 0, '*'),
(101, 'Menu Options - RokNavMenu is Required', '', '<br /><p class="alert largemargintop">RokNavMenu is the core of all the powerful Clarion menu system. Please ensure you are using the latest version of RokNavMenu, available <a href="http://www.rockettheme.com/extensions-joomla/roknavmenu" target="_blank">here</a>.</p>', 1, 'utility-b', 42, '2014-08-30 07:41:02', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 0, '{"prepare_content":"1","backgroundimage":"","layout":"_:default","moduleclass_sfx":"","cache":"1","cache_time":"900","cachemode":"static"}', 0, '*'),
(102, 'Set Menu Type', '', '<p>To find all the parameters for Fusion Menu and Splitmenu, such as transitions, duration and sublevel position, go to:</p>\r\n\r\n<ul class="checkmark green">\r\n	<li><strong>(J! 1.5) Extensions &rarr; Template Manager &rarr; rt_clarion_j15 &rarr; <br />Menu &rarr; Menu Control &rarr; <em>Set Menu Type</em></strong></li>\r\n	<li><strong>(J! 2.5) Extensions &rarr; Template Manager &rarr; rt_clarion &rarr; <br />Menu &rarr; Menu Control &rarr; <em>Set Menu Type</em></strong></li>\r\n</ul>\r\n\r\n<p class="attention">Descriptions of each template parameter can be seen when you mouseover the label of each option.</p>', 1, 'maintop-b', 42, '2014-08-30 07:40:09', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 1, '{"prepare_content":"1","backgroundimage":"","layout":"_:default","moduleclass_sfx":"","cache":"1","cache_time":"900","cachemode":"static"}', 0, '*'),
(103, 'Menu Options - Set Menu Type Screenshots', '', '<img class="rt-image" src="images/stories/demo/menu-options/set-menu-1.jpg" alt="Set Menu" width="400" height="120" /><br /><br />\r\n<img class="rt-image" src="images/stories/demo/menu-options/set-menu-2.jpg" alt="Set Menu" width="400" height="120" />', 1, 'maintop-a', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 'mod_custom', 1, 0, '{"prepare_content":"1","backgroundimage":"","layout":"_:default","moduleclass_sfx":"","cache":"1","cache_time":"900","cachemode":"static"}', 0, '*'),
(104, 'Fusion Menu', '', '<p>A Mootools enhanced CSS dropdown menu, with multi-columns, icons and more.</p>\r\n<a href="index.php?option=com_content&amp;view=article&amp;id=5&amp;Itemid=111&amp;menu-type=fusionmenu" class="readon"><span>FusionMenu</span></a>', 6, 'sidebar-a', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 'mod_custom', 1, 1, '{"prepare_content":"1","backgroundimage":"","layout":"_:default","moduleclass_sfx":"","cache":"1","cache_time":"900","cachemode":"static"}', 0, '*'),
(105, 'Split Menu', '', '<p>A static two level menu with 1st level items in the header area, and all others in the sidebar.</p>\r\n<a href="index.php?option=com_content&amp;view=article&amp;id=5&amp;Itemid=111&amp;menu-type=splitmenu" class="readon"><span>SplitMenu</span></a>', 7, 'sidebar-a', 42, '2014-08-30 07:40:49', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 1, '{"prepare_content":"1","backgroundimage":"","layout":"_:default","moduleclass_sfx":"","cache":"1","cache_time":"900","cachemode":"static"}', 0, '*'),
(106, 'No Menu', '', '<p>An option to disable the menu, allowing for normal module use of the navigation position.</p>', 8, 'sidebar-a', 42, '2014-08-30 07:40:50', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 1, '{"prepare_content":"1","backgroundimage":"","layout":"_:default","moduleclass_sfx":"","cache":"1","cache_time":"900","cachemode":"static"}', 0, '*'),
(107, 'Video Tutorials', '', '<ul class="circle blue largemarginbottom">\r\n	<li><a href="http://www.rockettheme.com/video/joomla15/installing-rocketlauncher-joomla15.mov" title="Video Tutorial :: Joomla RocketLauncher Installation Video Tutorial" rel="rokbox[503 356]">RocketLauncher</a></li>\r\n	<li><a href="http://www.rockettheme.com/video/joomla15/template-installation-joomla15.mov" title="Video Tutorial :: Joomla Template Installation Video Tutorial" rel="rokbox[800 620]">Template Installation</a></li>\r\n	<li><a href="http://www.rockettheme.com/video/joomla15/menu-configuration-joomla15.mov" title="Video Tutorial :: Joomla Menu Setup Video Tutorial" rel="rokbox[504 336]">Menu Setup</a></li>\r\n	<li><a href="http://www.rockettheme.com/video/joomla15/using-typography-joomla15.mov" title="Video Tutorial :: Joomla Using Typography Video Tutorial" rel="rokbox[540 380]">Using Typography</a></li>	\r\n	<li><a rel="rokbox[504 360]" title="Video Tutorial :: Joomla 1.5 Template Management" href="http://www.rockettheme.com/video/joomla15/template-manager-joomla15.mov">Template Management</a></li>\r\n	<li><a rel="rokbox[504 336]" title="Video Tutorial :: Joomla 1.5 Using Custom Modules" href="http://www.rockettheme.com/video/joomla15/custom-modules-joomla15.mov">Custom Modules</a></li>\r\n	<li><a rel="rokbox[504 336]" title="Video Tutorial :: Joomla 1.5 Using the Extensions Manager" href="http://www.rockettheme.com/video/joomla15/extensions-manager-joomla15.mov">Extensions Manager</a></li>\r\n	<li><a rel="rokbox[504 336](joomla15basic)" title="Video Tutorial :: Joomla 1.5 Menu Access Levels" href="http://www.rockettheme.com/video/joomla15/menu-access-levels-joomla15.mov">Menu Access</a></li>\r\n</ul>\r\n<a href="http://www.rockettheme.com/joomla-tutorials/video-tutorials" target="_blank" class="readon"><span>View All</span></a>', 4, 'sidebar-a', 42, '2014-08-30 07:40:45', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 1, '{"prepare_content":"1","backgroundimage":"","layout":"_:default","moduleclass_sfx":"nomarginbottom","cache":"1","cache_time":"900","cachemode":"static"}', 0, '*'),
(108, 'Forum Guides', '', '<ul class="circle blue">\r\n	<li><a href="http://www.rockettheme.com/forum/index.php?f=586&amp;t=155603&amp;rb_v=viewtopic" target="_blank">Template FAQs</a></li>\r\n	<li><a href="http://www.rockettheme.com/forum/index.php?f=586&amp;t=155602&amp;rb_v=viewtopic" target="_blank">User Guide &amp; Support</a></li>\r\n	<li><a href="http://www.rockettheme.com/forum/index.php?f=586&amp;t=155601&amp;rb_v=viewtopic" target="_blank">Configuring K2</a></li>\r\n	<li><a href="http://www.rockettheme.com/forum/index.php?f=586&amp;t=155598&amp;rb_v=viewtopic" target="_blank">Mobile Theme Settings</a></li>\r\n	<li><a href="http://www.rockettheme.com/forum/index.php?f=586&amp;t=155600&amp;rb_v=viewtopic" target="_blank">Demo Content Info</a></li>\r\n	<li><a href="http://www.rockettheme.com/forum/index.php?f=586&amp;t=155589&amp;rb_v=viewtopic" target="_blank">Editing the Logo</a></li>\r\n	<li><a href="http://www.rockettheme.com/forum/index.php?f=586&amp;t=155592&amp;rb_v=viewtopic" target="_blank">Editing Template Text</a></li>\r\n	<li><a href="http://www.rockettheme.com/forum/index.php?f=586&amp;t=155596&amp;rb_v=viewtopic" target="_blank">Popup Module</a></li>\r\n	<li><a href="http://www.rockettheme.com/forum/index.php?f=586&amp;t=155594&amp;rb_v=viewtopic" target="_blank">RokBox Member Login</a></li>\r\n</ul>\r\n<a class="readon" target="_blank" href="http://www.rockettheme.com/forum/index.php?f=586&amp;amp;rb_v=viewforum"><span>View All</span></a>', 5, 'sidebar-a', 42, '2014-08-30 07:40:48', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 1, '{"prepare_content":"1","backgroundimage":"","layout":"_:default","moduleclass_sfx":"nomarginbottom","cache":"1","cache_time":"900","cachemode":"static"}', 0, '*'),
(109, 'Subtext Line', '', '<img width="260" height="100" alt="Clarion" src="images/stories/demo/menu-options/subtext.jpg" class="rt-image">\r\n<p>The option that allows you to insert additional text to the Menu Item Title. There is separate styling for this, making it useful for adding brief descriptions to menu items.</p>', 1, 'footer-a', 42, '2014-08-30 07:39:39', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 1, '{"prepare_content":"1","backgroundimage":"","layout":"_:default","moduleclass_sfx":"","cache":"1","cache_time":"900","cachemode":"static"}', 0, '*'),
(110, 'Menu Item Image', '', '<img width="260" height="100" alt="Clarion" src="images/stories/demo/menu-options/menuimage.jpg" class="rt-image">\r\n<p>RokNavMenu provides the option to display a small icon image for the menu item. The menu icon can be displayed both for the parent items and the child items.</p>', 1, 'footer-b', 42, '2014-08-30 07:39:45', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 1, '{"prepare_content":"1","backgroundimage":"","layout":"_:default","moduleclass_sfx":"","cache":"1","cache_time":"900","cachemode":"static"}', 0, '*'),
(111, 'Multiple Columns', '', '<img width="260" height="100" alt="Clarion" src="images/stories/demo/menu-options/multiplecols.jpg" class="rt-image">\r\n<p>Who needs a single dropdown column when you can have as many as you want? Using the built-in configurable parameters, you can make incredible multi column dropdowns.</p>', 1, 'footer-c', 42, '2014-08-30 07:39:47', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 1, '{"prepare_content":"1","backgroundimage":"","layout":"_:default","moduleclass_sfx":"","cache":"1","cache_time":"900","cachemode":"static"}', 0, '*'),
(112, 'Extensions - Footer', '', '<div class="rt-demo-grid-8 nomarginright">\r\n	<ul class="list-icon write">\r\n    	<li><h3 class="nobold smallpaddingbottom">All RocketTheme Extensions - in Extensions Club</h3></li>\r\n 	</ul>\r\n\r\n 	<p>Many of our extensions were developed to accompany RocketTheme templates but we have now created versions that are intended to work independently of our templates if you wish.</p>\r\n\r\n	<div class="module-title">\r\n		<h3 class="title"><span>Club</span> Extensions</h3>\r\n	</div>\r\n\r\n	<div class="rt-grid-2 largemarginright largepaddingright">\r\n		<ul class="circle green">\r\n			<li><a href="http://www.rockettheme.com/extensions-joomla/rokgallery" target="_blank">RokGallery</a></li>\r\n			<li><a href="http://www.rockettheme.com/extensions-joomla/rokstories" target="_blank">RokStories</a></li>\r\n			<li><a href="http://www.rockettheme.com/extensions-joomla/rokstock" target="_blank">RokStock</a></li>\r\n		</ul>\r\n	</div>\r\n\r\n	<div class="rt-grid-2 largemarginright largepaddingright">\r\n		<ul class="circle green">\r\n			<li><a href="http://www.rockettheme.com/extensions-joomla/roknewspager" target="_blank">RokNewsPager</a></li>\r\n			<li><a href="http://www.rockettheme.com/extensions-joomla/rokminievents" target="_blank">RokMiniEvents</a></li>\r\n			<li><a href="http://www.rockettheme.com/extensions-joomla/rokpad" target="_blank">RokPad</a></li>\r\n		</ul>\r\n	</div>\r\n\r\n	<div class="rt-grid-2">\r\n		<ul class="circle green">\r\n			<li><a href="http://www.rockettheme.com/extensions-joomla/rokweather" target="_blank">RokWeather</a></li>\r\n			<li><a href="http://www.rockettheme.com/extensions-joomla/roktwittie" target="_blank">RokTwittie</a></li>\r\n			<li><a href="http://www.rockettheme.com/extensions-joomla/rokfeaturetable" target="_blank">RokFeatureTable</a></li>\r\n		</ul>	\r\n	</div>\r\n\r\n	<div class="clear"></div>\r\n\r\n	<div class="module-title">\r\n		<h3 class="title"><span>Free</span> Extensions</h3>\r\n	</div>\r\n	<div class="rt-grid-2 largemarginright largepaddingright">\r\n		<ul class="circle green nomarginbottom">\r\n			<li><a href="http://www.rockettheme.com/extensions-joomla/roknavmenu" target="_blank">RokNavMenu</a></li>\r\n			<li><a href="http://www.rockettheme.com/extensions-joomla/rokbox" target="_blank">RokBox</a></li>\r\n			<li><a href="http://www.rockettheme.com/extensions-joomla/rokgzipper" target="_blank">RokGZipper</a></li>\r\n			<li><a href="http://www.rockettheme.com/extensions-joomla/rokajaxsearch" target="_blank">RokAjaxSearch</a></li>\r\n		</ul>\r\n	</div>\r\n\r\n	<div class="rt-grid-2 largemarginright largepaddingright">\r\n		<ul class="circle green nomarginbottom">\r\n			<li><a href="http://www.rockettheme.com/extensions-joomla/rokdownloads" target="_blank">RokDownloads</a></li>\r\n			<li><a href="http://www.rockettheme.com/extensions-joomla/roknewsflash" target="_blank">RokNewsFlash</a></li>\r\n			<li><a href="http://www.rockettheme.com/extensions-joomla/rokquickcart" target="_blank">RokQuickCart</a></li>\r\n			<li><a href="http://www.rockettheme.com/extensions-joomla/rokcandy" target="_blank">RokCandy</a></li>\r\n		</ul>\r\n	</div>\r\n\r\n	<div class="rt-grid-2">\r\n		<ul class="circle green nomarginbottom">\r\n			<li><a href="http://www.rockettheme.com/extensions-joomla/roktabs" target="_blank">RokTabs</a></li>\r\n			<li><a href="http://www.rockettheme.com/extensions-joomla/rokslideshow" target="_blank">RokSlideShow</a></li>		\r\n			<li><a href="http://www.rockettheme.com/extensions-joomla/rokbridge" target="_blank">RokBridge</a></li>\r\n			<li><a href="http://www.rockettheme.com/extensions-joomla/rokcomments" target="_blank">RokComments</a></li>\r\n		</ul>	\r\n	</div>\r\n</div>\r\n\r\n<div class="rt-demo-grid-4 floatright nomarginleft nomarginright">\r\n\r\n	<p class="alert">The 3rd party component K2 is NOT included in RocketLauncher. You will need to download them from <a href="http://getk2.org/" target="_blank">Get K2</a> and configure them on your site.</p>\r\n\r\n	<p>You can download the Clarion Extensions from:</p>\r\n\r\n	<ul class="normalfont nomarginbottom checkmark green">\r\n		<li><strong>Clarion Download Page:</strong> <strong><br />rt_clarion_j15-extensions.zip</strong> for J! 1.5 or <strong>rt_clarion-extensions.zip</strong> for J! 2.5. Unzip the file, it contains all the extensions used for Clarion.</li>\r\n		<li class="nomarginbottom"><strong>RocketTheme Extensions Page:</strong><br />Contains all individual extensions are available from the Extensions section of RokDownloads.</li>\r\n	</ul>\r\n\r\n	<a href="http://www.rockettheme.com/extensions-downloads/" target="_blank" class="readon largemargintop floatright"><span>Download : Clarion Extensions</span></a>\r\n\r\n</div>', 1, 'footer-a', 42, '2014-08-30 07:39:40', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 0, '{"prepare_content":"1","backgroundimage":"","layout":"_:default","moduleclass_sfx":"","cache":"1","cache_time":"900","cachemode":"static"}', 0, '*'),
(113, 'Installation Process', '', '<p>Download and install the <strong>Bundle</strong> file if Gantry is not installed, use the Standard Template file if <a href="index.php?option=com_content&amp;view=article&amp;id=7&amp;Itemid=123">Gantry</a> is already present.</p>\r\n<a href="index.php?option=com_content&amp;view=article&amp;id=7&amp;Itemid=123" class="readon"><span>More Information</span></a>', 1, 'maintop-a', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 'mod_custom', 1, 1, '{"prepare_content":"1","backgroundimage":"","layout":"_:default","moduleclass_sfx":"","cache":"1","cache_time":"900","cachemode":"static"}', 0, '*'),
(114, 'RocketLauncher - Demo Replica', '', '<p>Deploy a <a href="index.php?option=com_content&amp;view=article&amp;id=7&amp;Itemid=123">replica</a> of the this month''s demo with ease, using the readily available <strong>RocketLauncher</strong> package.</p><a href="index.php?option=com_content&amp;view=article&amp;id=7&amp;Itemid=123" class="readon"><span>More Information</span></a>', 1, 'maintop-b', 42, '2014-08-30 07:40:11', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 1, '{"prepare_content":"1","backgroundimage":"","layout":"_:default","moduleclass_sfx":"","cache":"1","cache_time":"900","cachemode":"static"}', 0, '*'),
(115, 'Joomla! Documentation', '', '<p>Joomla.org is an invaluable resource for general instructions and information on how to use, configure and modify Joomla.</p>\r\n<a href="http://docs.joomla.org" class="readon" target="_blank"><span>Read More</span></a>', 1, 'footer-b', 42, '2014-08-30 07:39:47', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 1, '{"prepare_content":"1","backgroundimage":"","layout":"_:default","moduleclass_sfx":"","cache":"1","cache_time":"900","cachemode":"static"}', 0, '*'),
(116, 'Gantry Support', '', '<p>More extensive details of the Gantry Framework, inclusive of both written and video tutorials, please visit the dedicated Gantry Site.</p>\r\n<a href="http://gantry-framework.org/" target="_blank" class="readon"><span>Read More</span></a>', 1, 'footer-c', 42, '2014-08-30 07:39:49', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 1, '{"prepare_content":"1","backgroundimage":"","layout":"_:default","moduleclass_sfx":"","cache":"1","cache_time":"900","cachemode":"static"}', 0, '*'),
(117, 'Forum Guides', '', '<ul class="circle blue">\r\n	<li><a href="http://www.rockettheme.com/forum/index.php?f=586&amp;t=155603&amp;rb_v=viewtopic" target="_blank">Template FAQs</a></li>\r\n	<li><a href="http://www.rockettheme.com/forum/index.php?f=586&amp;t=155602&amp;rb_v=viewtopic" target="_blank">User Guide &amp; Support</a></li>\r\n	<li><a href="http://www.rockettheme.com/forum/index.php?f=586&amp;t=155601&amp;rb_v=viewtopic" target="_blank">Configuring K2</a></li>\r\n	<li><a href="http://www.rockettheme.com/forum/index.php?f=586&amp;t=155598&amp;rb_v=viewtopic" target="_blank">Mobile Theme Settings</a></li>\r\n	<li><a href="http://www.rockettheme.com/forum/index.php?f=586&amp;t=155600&amp;rb_v=viewtopic" target="_blank">Demo Content Info</a></li>\r\n	<li><a href="http://www.rockettheme.com/forum/index.php?f=586&amp;t=155589&amp;rb_v=viewtopic" target="_blank">Editing the Logo</a></li>\r\n	<li><a href="http://www.rockettheme.com/forum/index.php?f=586&amp;t=155592&amp;rb_v=viewtopic" target="_blank">Editing Template Text</a></li>\r\n	<li><a href="http://www.rockettheme.com/forum/index.php?f=586&amp;t=155596&amp;rb_v=viewtopic" target="_blank">Popup Module</a></li>\r\n	<li><a href="http://www.rockettheme.com/forum/index.php?f=586&amp;t=155594&amp;rb_v=viewtopic" target="_blank">RokBox Member Login</a></li>\r\n</ul>\r\n<a class="readon" target="_blank" href="http://www.rockettheme.com/forum/index.php?f=586&amp;amp;rb_v=viewforum"><span>View All</span></a>', 1, 'sidebar-b', 42, '2014-08-30 07:40:59', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 1, '{"prepare_content":"1","backgroundimage":"","layout":"_:default","moduleclass_sfx":"nomarginbottom","cache":"1","cache_time":"900","cachemode":"static"}', 0, '*'),
(118, 'System Requirements', '', '<ul class="checkmark green nomarginbottom">\r\n	<li><strong>Apache 2.x or Microsoft IIS 7</strong></li>\r\n	<li><strong>PHP 5.3.x</strong></li>\r\n	<li><strong>MySQL 5.0.4 or higher</strong></li>\r\n	<li><strong>Joomla! 1.5.x or Joomla! 2.5.x</strong></li>	\r\n	<li><strong>Gantry Framework</strong></li>\r\n	<li class="nomarginbottom"><strong>RokNavMenu Module</strong></li>\r\n</ul>', 2, 'sidebar-a', 42, '2014-08-30 07:40:35', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 1, '{"prepare_content":"1","backgroundimage":"","layout":"_:default","moduleclass_sfx":"box1","cache":"1","cache_time":"900","cachemode":"static"}', 0, '*'),
(119, 'RocketLauncher Version', '', '<p class="medmarginbottom"><strong>RocketLauncher</strong> is a customized <strong>Joomla</strong> install, that installs a <strong>replica</strong> of the <strong>demo</strong> onto your Joomla! site.</p>\r\n<p class="alert nomarginbottom"><strong>Note</strong>: All sample content images will be replaced with blank versions in the RocketLauncher.</p>', 3, 'sidebar-a', 42, '2014-08-30 07:40:43', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 1, '{"prepare_content":"1","backgroundimage":"","layout":"_:default","moduleclass_sfx":"","cache":"1","cache_time":"900","cachemode":"static"}', 0, '*'),
(120, 'Essential Files', '', '<ul class="list-icon checkmark green normalfont nomarginbottom">\r\n	<li><strong>Gantry Framework</strong> <em><strong>(J! 1.5)</strong> rt_clarion_j15.tgz</em> or <em><strong>(J! 2.5)</strong> rt_clarion.zip</em> - Core framework for Clarion template.</li>\r\n	<li><strong>Template (Standalone)</strong> <em><strong>(J! 1.5)</strong> rt_clarion_j15.tgz</em> or <em><strong>(J! 2.5)</strong> rt_clarion.zip</em> - Standalone template file without the Gantry Framework.</li>\r\n	<li><strong>Template (Bundle)</strong> <em><strong>(J! 1.5)</strong> rt_clarion_j15-bundle.zip</em> or <em><strong>(J! 2.5)</strong> rt_clarion-bundle.zip</em> - Template plus the Gantry Framework.</li>\r\n	<li><strong>RokNavMenu</strong> <em><strong>(J! 1.5)</strong> rt_clarion_j15-extensions.zip(<strong>unzip first</strong>) or mod_roknavmenu.zip</em>; or <em><strong>(J! 2.5)</strong> rt_clarion-extensions.zip(<strong>unzip first</strong>) or mod_roknavmenu_j16.zip</em> - Required for the menu to work.</li>\r\n</ul>', 2, 'footer-a', 42, '2014-08-30 07:39:41', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 1, '{"prepare_content":"1","backgroundimage":"","layout":"_:default","moduleclass_sfx":"","cache":"1","cache_time":"900","cachemode":"static"}', 0, '*'),
(121, 'Additional Files', '', '<ul class="list-icon checkmark green normalfont nomarginbottom">\r\n	<li><strong>Source PNG(s)</strong> <em>rt_clarion_j15-sources.zip</em> - Adobe® Fireworks PNG source file(s) and any applicable fonts.</li>\r\n	<li><strong>Source BG PNG(s)</strong> <em>rt_clarion_j15-sources-bg.zip</em> - Adobe® Fireworks PNG BG source file(s) — <em>Only distributed if the template has complex BGs.</em></li>\r\n	<li><strong>Extensions</strong> <em><strong>(J! 1.5)</strong> rt_clarion_j15-extensions.zip</em> or <em><strong>(J! 2.5)</strong> rt_clarion-extensions.zip</em> - All extensions for the template.</li>\r\n	<li><strong>RocketLauncher</strong> <em><strong>(J! 1.5)</strong> rt_clarion_j15-rocketlauncher.zip</em> or <em><strong>(J! 2.5)</strong> rt_clarion-rocketlauncher.zip</em> - Demo replica installer. RocketLauncher needs a fresh Joomla! installation.</li>\r\n</ul>', 2, 'footer-b', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 'mod_custom', 1, 1, '{"prepare_content":"1","backgroundimage":"","layout":"_:default","moduleclass_sfx":"","cache":"1","cache_time":"900","cachemode":"static"}', 0, '*'),
(122, 'Adobe Fireworks', '', '<p>The most effective way to customize the logo is to use the included Source PNG file. When opened in Adobe Fireworks, this file contains all of the Layers in the design allowing you to tweak and change any of the image elements of the template design.</p>\r\n<p class="alert nomarginbottom">In order to utilize the Fireworks Source PNG included with the Clarion template release, you will need Adobe Fireworks. The 30-day free trial of this software as well as more information is available <a href="http://www.adobe.com/products/fireworks/" target="_blank"><strong>here at the Adobe website</strong></a>.</p>', 2, 'sidebar-a', 42, '2014-08-30 07:40:37', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 1, '{"prepare_content":"1","backgroundimage":"","layout":"_:default","moduleclass_sfx":"","cache":"1","cache_time":"900","cachemode":"static"}', 0, '*'),
(123, 'Editing Requirements', '', '<ul>\r\n	<li><strong>Adobe® Fireworks:</strong> CS5 is preferred, but CS3/4 will be sufficient.</li>\r\n	<li><strong>Logo Font:</strong> Download and install before proceeding to edit in Fireworks.</li>\r\n	<li><strong>Source File:</strong> Download the <strong>logo-source.png</strong> file from the rt_clarion_j15-sources.zip package.</li>\r\n</ul>', 2, 'sidebar-a', 42, '2014-08-30 07:40:42', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 1, '{"prepare_content":"1","backgroundimage":"","layout":"_:default","moduleclass_sfx":"box1","cache":"1","cache_time":"900","cachemode":"static"}', 0, '*'),
(124, 'Uploading the Logo', '', '<div class="rt-demo-grid-2 floatleft largemarginright largepaddingright">\r\n	<img width="150" height="150" src="images/stories/demo/logo/logo-location.jpg" alt="Logo Location" class="rt-image" />\r\n</div>\r\n\r\n<div class="rt-grid-7 nomarginleft nomarginright">\r\n<ul class="medmarginbottom">\r\n	<li>Upload <strong>logo.png</strong> to the <strong style="word-break: break-all">(J! 1.5) /templates/rt_clarion_15/images/logo/*style*/</strong> or <br><strong style="word-break: break-all">(J! 2.5) /templates/rt_clarion/images/logo/*style*/</strong> directory</li>\r\n	<li>Clear your browser cache and refresh your site.</li>\r\n</ul>\r\n\r\n<p class="medmarginbottom">If you cannot see your new logo, ensure you have uploaded it to the right directory and the directory permissions are writeable. Enquire with your hosting provider.</p>\r\n\r\n<a target="_blank" href="http://www.rockettheme.com/joomla-templates/clarion" class="readon"><span>Download Sources Here</span></a>\r\n\r\n</div>\r\n\r\n<div class="rt-demo-grid-2 floatright">\r\n	<a href="http://demo.rockettheme.com/sep10/video/logo.mov" title="Video Tutorial :: Clarion Logo Editing Video Tutorial" rel="rokbox[504 306]"><img width="150" height="150" src="images/stories/demo/logo/logo-video.jpg" alt="Logo Location" class="rt-image" /></a>\r\n</div>', 2, 'footer-a', 42, '2014-08-30 07:39:42', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 1, '{"prepare_content":"1","backgroundimage":"","layout":"_:default","moduleclass_sfx":"","cache":"1","cache_time":"900","cachemode":"static"}', 0, '*'),
(125, '12 Preset Styles - Preview Live', '', '<p class="notice">View all styles live by appending <strong>?presets=preset#</strong> or <strong>&amp;presets=preset#</strong> to the end of your URL such as <strong><a href="#">http://yoursite.com/index.php?presets=preset4</a></strong>.</p>\r\n\r\n<p>In sequential order, <strong>Preset 1 - Preset 12</strong>. Please click on the image to load a live example of each style variation.</p>\r\n\r\n<a href="index.php?option=com_content&amp;view=article&amp;id=9&amp;Itemid=127&amp;presets=preset1">\r\n	<img alt="Preset 1" src="images/stories/demo/styles/ss1.jpg" class="rt-image floatleft medmarginright" width="135" height="250" />\r\n</a>\r\n<a href="index.php?option=com_content&amp;view=article&amp;id=9&amp;Itemid=127&amp;presets=preset2">\r\n	<img alt="Preset 2" src="images/stories/demo/styles/ss2.jpg" class="rt-image floatleft medmarginright" width="135" height="250" />\r\n</a>\r\n<a href="index.php?option=com_content&amp;view=article&amp;id=9&amp;Itemid=127&amp;presets=preset3">\r\n	<img alt="Preset 3" src="images/stories/demo/styles/ss3.jpg" class="rt-image floatleft medmarginright" width="135" height="250" />\r\n</a>\r\n<a href="index.php?option=com_content&amp;view=article&amp;id=9&amp;Itemid=127&amp;presets=preset4">\r\n	<img alt="Preset 4" src="images/stories/demo/styles/ss4.jpg" class="rt-image floatleft medmarginright" width="135" height="250" />\r\n</a>\r\n<a href="index.php?option=com_content&amp;view=article&amp;id=9&amp;Itemid=127&amp;presets=preset5">\r\n	<img alt="Preset 5" src="images/stories/demo/styles/ss5.jpg" class="rt-image floatleft medmarginright" width="135" height="250" />\r\n</a>\r\n<a href="index.php?option=com_content&amp;view=article&amp;id=9&amp;Itemid=127&amp;presets=preset6">\r\n	<img alt="Preset 6" src="images/stories/demo/styles/ss6.jpg" class="rt-image floatleft nomarginright" width="135" height="250" />\r\n</a>\r\n<div class="clear"></div>\r\n<a href="index.php?option=com_content&amp;view=article&amp;id=9&amp;Itemid=127&amp;presets=preset7">\r\n	<img alt="Preset 7" src="images/stories/demo/styles/ss7.jpg" class="rt-image floatleft medmarginright" width="135" height="250" />\r\n</a>\r\n<a href="index.php?option=com_content&amp;view=article&amp;id=9&amp;Itemid=127&amp;presets=preset8">\r\n	<img alt="Preset 8" src="images/stories/demo/styles/ss8.jpg" class="rt-image floatleft medmarginright" width="135" height="250" />\r\n</a>\r\n<a href="index.php?option=com_content&amp;view=article&amp;id=9&amp;Itemid=127&amp;presets=preset9">\r\n	<img alt="Preset 9" src="images/stories/demo/styles/ss9.jpg" class="rt-image floatleft medmarginright" width="135" height="250" />\r\n</a>\r\n<a href="index.php?option=com_content&amp;view=article&amp;id=9&amp;Itemid=127&amp;presets=preset10">\r\n	<img alt="Preset 10" src="images/stories/demo/styles/ss10.jpg" class="rt-image floatleft medmarginright" width="135" height="250" />\r\n</a>\r\n<a href="index.php?option=com_content&amp;view=article&amp;id=9&amp;Itemid=127&amp;presets=preset11">\r\n	<img alt="Preset 11" src="images/stories/demo/styles/ss11.jpg" class="rt-image floatleft medmarginright" width="135" height="250" />\r\n</a>\r\n<a href="index.php?option=com_content&amp;view=article&amp;id=9&amp;Itemid=127&amp;presets=preset12">\r\n	<img alt="Preset 12" src="images/stories/demo/styles/ss12.jpg" class="rt-image floatleft nomarginright" width="135" height="250" />\r\n</a>\r\n<div class="clear"></div>', 1, 'feature-a', 42, '2014-08-30 07:39:35', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 1, '{"prepare_content":"1","backgroundimage":"","layout":"_:default","moduleclass_sfx":"","cache":"1","cache_time":"900","cachemode":"static"}', 0, '*');
