(126, 'Creating your own Preset Style(s)', '', '<ul class="list-icon rightarrow">\r\n	<li>Go to <strong>Extensions → Template Manager → (J15) rt_clarion_j15 → Settings; or (J17) rt_clarion &rarr; Show Presets</strong></li>\r\n	<li>Configure the Settings</li>\r\n	<li>Click <strong>(J15) Save Custom Presets as New</strong>; <strong>(J17) Save Preset</strong></li>\r\n	<li>Follow the <strong>Preset Saver procedure</strong></li>\r\n</ul>\r\n\r\n<p class="notice">You can edit the prebuilt presets in the <strong>gantry.config.php</strong> file, or use the User Interface method outlined above.</p>', 1, 'bottom-a', 42, '2014-08-30 07:39:21', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 1, '{"prepare_content":"1","backgroundimage":"","layout":"_:default","moduleclass_sfx":"","cache":"1","cache_time":"900","cachemode":"static"}', 0, '*'),
(127, 'Preset Bottom B', '', '<br /><br />\r\n<img class="rt-image floatleft medmarginright " alt="Image" src="images/stories/demo/general/style-1.jpg" height="134" width="200" />\r\n<img class="rt-image " alt="Image" src="images/stories/demo/general/style-2.jpg" height="134" width="200" />', 1, 'bottom-b', 42, '2014-08-30 07:39:33', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 0, '{"prepare_content":"1","backgroundimage":"","layout":"_:default","moduleclass_sfx":"","cache":"1","cache_time":"900","cachemode":"static"}', 0, '*'),
(128, 'Contact Details', '', '<p class="medmarginbottom"><strong>Clarion</strong>, RocketTheme''s Joomla Template release for February 2012, with full 1.5 / 2.5 support.</p>\r\n\r\n<span class="text-icon info normalfont">9876 North West Boulevard</span>\r\n<br />\r\n<span class="text-icon normalfont  medpaddingbottom">Milwaukee, WI, 00000, USA</span>\r\n<br />\r\n<span class="text-icon normalfont phone">T +1 (555) 555-555-5555</span>\r\n<br />\r\n<span class="text-icon normalfont medpaddingbottom">F +1 (555) 555-555-5556</span>\r\n<br />\r\n<span class="text-icon email normalfont"><a class="nobold" href="#">noreply@rockettheme.com</a></span>', 0, 'bottom-a', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 'mod_custom', 1, 1, '{"prepare_content":"1","backgroundimage":"","layout":"_:default","moduleclass_sfx":"","cache":"1","cache_time":"900","cachemode":"static"}', 0, '*'),
(129, 'Network with Us', '', '<p>Connect with us via a selection of popular social media, networks and other platforms.</p>\r\n\r\n<span class="text-icon facebook normalfont medpaddingbottom">/rockettheme</span>\r\n<br />\r\n<span class="text-icon twitter normalfont medpaddingbottom">@rockettheme</span>\r\n<br />\r\n<span class="text-icon rss normalfont medpaddingbottom">RSS Feed</span>\r\n<br />\r\n<span class="text-icon vimeo normalfont medpaddingbottom">Video Feed</span>', 1, 'bottom-c', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 'mod_custom', 1, 1, '{"prepare_content":"1","backgroundimage":"","layout":"_:default","moduleclass_sfx":"","cache":"1","cache_time":"900","cachemode":"static"}', 0, '*'),
(130, 'Demo Information', '', '<p class="medmarginbottom">All demo content is for <strong>sample</strong> purposes only, intended to represent a live site. All content images are licensed from <a href="http://www.shutterstock.com/" target="_blank" class="nobold">shutterstock.com</a> for exclusive use on this demo only.</p>\r\n<span>Please download the <strong>RocketLauncher</strong> pack to install a copy of the base demo.</span>', 1, 'bottom-b', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 'mod_custom', 1, 1, '{"prepare_content":"1","backgroundimage":"","layout":"_:default","moduleclass_sfx":"","cache":"1","cache_time":"900","cachemode":"static"}', 0, '*'),
(131, 'Module Variations', '', '<p class="medmarginbottom">36 module class <strong>suffixes</strong>, both structural and stylistic, to <strong>individualize</strong> your modules.</p>\r\n<p><a class="nobold" href="index.php?option=com_content&amp;view=article&amp;id=2&amp;Itemid=109"><span>Read More +</span></a></p>', 1, 'mainbottom-a', 42, '2014-08-30 07:40:07', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 1, '{"prepare_content":"1","backgroundimage":"","layout":"_:default","moduleclass_sfx":"","cache":"1","cache_time":"900","cachemode":"static"}', 0, '*'),
(132, 'PNG Sources', '', '<p class="medmarginbottom"><strong>Customize</strong> the various image elements using the <strong>Adobe® Fireworks PNG</strong> sources.</p>\r\n<p><a class="nobold" href="index.php?option=com_content&amp;view=article&amp;id=8&amp;Itemid=124"><span>Read More +</span></a></p>', 1, 'mainbottom-b', 42, '2014-08-30 07:40:08', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 1, '{"prepare_content":"1","backgroundimage":"","layout":"_:default","moduleclass_sfx":"","cache":"1","cache_time":"900","cachemode":"static"}', 0, '*'),
