(134, 'Demo Installer', '', '<p class="medmarginbottom"><strong>RocketLauncher</strong> is a modified Joomla package to install a <strong>demo</strong> onto your server.</p><a class="nobold" href="index.php?option=com_content&amp;view=article&amp;id=7&amp;Itemid=123"><span>Read More +</span></a>', 1, 'mainbottom-d', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 'mod_custom', 1, 1, '{"prepare_content":"1","backgroundimage":"","layout":"_:default","moduleclass_sfx":"","cache":"1","cache_time":"900","cachemode":"static"}', 0, '*'),
