(142, 'Module 1', '', '<table border="0" cellspacing="0" cellpadding="5">\r\n<tbody>\r\n<tr>\r\n<td width="2"><img src="images/checkbox.gif" border="0" hspace="5" style="padding-bottom: 18px;" /></td>\r\n<td class="greybox"><span style="font-size: small;"><strong>Cash deposited directly <br />to your bank account. </strong></span></td>\r\n</tr>\r\n<tr>\r\n<td width="2"><img src="images/checkbox.gif" border="0" hspace="5" style="padding-bottom: 18px;" /></td>\r\n<td class="greybox"><span style="font-size: small;"><strong>Fast &amp; Easy Approval<br /> No FICO Score Check </strong></span></td>\r\n</tr>\r\n<tr>\r\n<td width="2"><img src="images/checkbox.gif" border="0" hspace="5" /></td>\r\n<td class="greybox"><span style="font-size: small;"><strong>Confidential &amp; Secure </strong></span></td>\r\n</tr>\r\n<tr>\r\n<td width="2"> </td>\r\n<td class="greybox"> </td>\r\n</tr>\r\n</tbody>\r\n</table>', 3, 'leftcreditmod', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 1, '{"prepare_content":"1","backgroundimage":"","layout":"_:default","moduleclass_sfx":"","cache":"1","cache_time":"900","cachemode":"static"}', 0, '*'),
(143, 'Location', '', '<div class="title5">\r\n<div class="rt-block">\r\n<div class="module-surround">\r\n<div class="module-title ">\r\n<h2 class="title" style="visibility: visible; color: #51c11d !important;"><span>Location</span></h2>\r\n</div>\r\n<div class="module-content">Get a Loan <strong><span style="color: #ff0000;">FAST!</span></strong><br />Apply online now and have money in your pocket tomorrow!</div>\r\n<div class="module-content"> </div>\r\n<div class="module-content"><strong>Office Address</strong></div>\r\n<div class="module-content">1835 Larkin Ave</div>\r\n<div class="module-content">Elgin, IL 60123</div>\r\n<div class="module-content"> </div>\r\n<div class="module-content"><strong>Mailing Address</strong></div>\r\n<div class="module-content">P.O. Box 5598</div>\r\n<div class="module-content">Elgin, IL 60121-5598</div>\r\n</div>\r\n</div>\r\n</div>', 3, 'leftcreditmod', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 1, '{"prepare_content":"1","backgroundimage":"","layout":"_:default","moduleclass_sfx":"","cache":"1","cache_time":"900","cachemode":"static"}', 0, '*'),
(144, 'Credit Lenders', '', '<div class="title5">\r\n<div class="rt-block">\r\n<div class="module-surround">\r\n<div class="module-title ">\r\n<h2 class="title" style="visibility: visible; color: #51c11d !important;"><span>All Credit Lenders</span></h2>\r\n</div>\r\n</div>\r\n<div class="module-content"><a href="mailto:internet@cp.allcreditlenders.net">internet@cp.allcreditlenders.net</a></div>\r\n<div class="module-content">\r\n<p><strong>Direct Phone </strong> 1-847-836-8593<br /> <strong>Direct Fax </strong> 1-224-293-6247</p>\r\n</div>\r\n</div>\r\n</div>', 3, 'leftcreditmod', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 1, '{"prepare_content":"1","backgroundimage":"","layout":"_:default","moduleclass_sfx":"","cache":"1","cache_time":"900","cachemode":"static"}', 0, '*'),
