(146, 'Roktab', '', '', 1, 'roktab', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_roktabs', 1, 0, '{"style":"base","content_type":"joomla","joomla_all":"0","catid":["16"],"featured":"1","k2_all":"0","k2_children":"0","k2_featured":"1","k2_image_size":"L","itemsOrdering":"order","strip_tags":"a,i,br,img,p,span,b,strong,object,embed,pdf,docman,edocs","show_readmore":"0","readmore":"Read more...","show_thumbnails":"1","thumb_width":"90","thumbnail_link":"1","width":"930","tabs_count":"6","duration":"600","transition_type":"scrolling","transition_fx":"Quad.easeInOut","linksMargins":"0","navscrolling":"1","tabs_position":"top","tabs_event":"click","tabs_title":"content","tabs_incremental":"Tab ","tabs_hideh6":"1","tabs_prefixed":"0","tabs_showicons":"0","tabs_iconside":"left","tabs_iconpath":"__module__\\/images","tabs_icon":"icon_home.gif,icon_security.gif,icon_comment.gif,icon_world.gif,icon_note.gif","autoplay":"0","autoplay_delay":"2000","moduleclass_sfx":"","cache":"0","module_cache":"1","cache_time":"900"}', 0, '*'),
(147, 'Disclosure', '', '<div style="text-align: justify; color: #ffffff;">\r\n<ul style="list-style-type: square; font-size: 1.05em;">\r\n<li style="padding-bottom: 5px;">Loans obtained from the Companies affiliated with this website are for short term financial needs only and not as a long-term financial solution. A short term loan such as an installment loan, line of credit cash advance, credit service agreement, also known as cash advance are short-term loans given to the borrower for a short period of time. Purpose of these short term loans is to provide the borrower a short-term financial relief. These loans are not a long-term financial solution. Borrowers with debt and credit difficulties should seek out professional financial advice.</li>\r\n<li style="padding-bottom: 5px;">The Website does not constitute an offer or solicitation to offer a loan.</li>\r\n<li style="padding-bottom: 5px;">You are under no obligation or requirement to apply for credit or accept the terms of any loan and you will not be charged fee unless you accept a loan or credit plan.</li>\r\n<li style="padding-bottom: 5px;">Each loan, the rates and terms will vary by individual and by state. Loans are NOT available in some states.</li>\r\n<li style="padding-bottom: 5px;">Due to state and verification requirements, not all applicants for online loans may be eligible for instant approval by the Companies affiliated with this website.</li>\r\n<li style="padding-bottom: 5px;">We do not perform traditional credit checks as part of its credit transaction approval process, but does verify applicant information via national databases including, but not limited to, Tele-Track and CL Verify. If you have defaulted on past transactions, you may be declined for a cash advance from this lender.</li>\r\n<li style="padding-bottom: 5px;">The locations and Companies referred to on this Website included several different Companies and entities and not all locations and Companies are affiliated with All Credit Lenders.</li>\r\n</ul>\r\n</div>', 1, 'bottom-a', 42, '2014-08-30 07:39:23', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 1, '{"prepare_content":"1","backgroundimage":"","layout":"_:default","moduleclass_sfx":"","cache":"1","cache_time":"900","cachemode":"static"}', 0, '*'),
