(163, 'Logo, Apply Now, Members', '', '<div style="float: left;"><a><img src="templates/rt_clarion/images/logo/dark/logo.png" border="0" /></a></div>\r\n<div style="float: right; padding-top: 15px;"><a href="https://www.allcreditlenders.biz/MemberPage.aspx?subpage=applyForLoan"> <img src="templates/rt_clarion/images/logo/dark/apply_now_bt1.png" border="0" /> </a> <a href="https://www.allcreditlenders.biz/MemberPage.aspx?subpage=customerLogin" target="_blank"> <img src="templates/rt_clarion/images/logo/dark/member_bt.png" border="0" /> </a></div>', 1, 'navigation-a', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 0, '{"prepare_content":"1","backgroundimage":"","layout":"_:default","moduleclass_sfx":"flush","cache":"1","cache_time":"900","cachemode":"static"}', 0, '*'),
(164, 'Short Application', '', '<script type="text/javascript" src="templates/rt_clarion/js/jquery-1.3.2.min.js"></script>\r\n<script type="text/javascript" src="templates/rt_clarion/js/jquery.maskedinput-1.0.js"></script>\r\n<script type="text/javascript" src="templates/rt_clarion/js/jquery.autotab-1.1b.js"></script>\r\n<script type="text/javascript">// <![CDATA[\r\njQuery(document).ready(function(){\r\n          jQuery("#sCtele").mask("999-999-9999");  \r\n      });\r\n// ]]></script>\r\n<div class="rt-block" style="padding: 0px 15px 15px 15px;">\r\n<div class="module-surround">\r\n<div class="module-title ">\r\n<h2 class="title" style="border-bottom-width: 1px; border-bottom-style: solid; border-bottom-color: #00913e; color: #51c11d !important; visibility: visible;"><span>Short</span> Application</h2>\r\n</div>\r\n<form id="sapply" action="" method="post" name="sapply"><!-- <div class="module-content">Get a Loan <strong><span style="color: #ff0000;">FAST!</span></strong><br>Apply online now and have money <br>in your pocket tomorrow!</div>\r\n               -->\r\n<table cellspacing="2" cellpadding="3">\r\n<tbody>\r\n<tr>\r\n<td><input id="fname" class="tdwidth" onfocus="this.value==''First Name''? this.value='''':this.value=this.value" onblur="this.value==''''? this.value=''First Name'':this.value=this.value" type="text" name="fname" value="First Name" /></td>\r\n</tr>\r\n<tr>\r\n<td><input id="lname" class="tdwidth" onfocus="this.value==''Last Name''? this.value='''':this.value=this.value" onblur="this.value==''''? this.value=''Last Name'':this.value=this.value" type="text" name="lname" value="Last Name" /></td>\r\n</tr>\r\n<tr>\r\n<td><input id="email" class="tdwidth" onfocus="this.value==''Email''? this.value='''':this.value=this.value" onblur="this.value==''''? this.value=''Email'':this.value=this.value" type="text" name="email" value="Email" /></td>\r\n</tr>\r\n<tr>\r\n<td><input id="sCtele" class="tdwidth" onfocus="this.value==''Cell Phone''? this.value='''':this.value=this.value" onblur="this.value==''''? this.value=''Cell Phone'':this.value=this.value" type="text" name="sCtele" value="Cell Phone" /></td>\r\n</tr>\r\n<tr>\r\n<td><input id="income" class="tdwidth" onfocus="this.value==''1111''? this.value='''':this.value=this.value" onblur="this.value==''''? this.value=''1111'':this.value=this.value" type="text" name="income" value="1111" /></td>\r\n</tr>\r\n<tr>\r\n<td><input id="scheck" type="checkbox" name="scheck" value="1" />I have read and understand the <a class="modal" href="index.php?option=com_content&amp;view=article&amp;id=85&amp;tmpl=component" title="Terms" rel="{handler: ''iframe'', size: {x: 875, y: 550}, onClose: function() {}}"> Terms &amp; Conditions </a> and <a class="modal" href="index.php?option=com_content&amp;view=article&amp;id=84&amp;tmpl=component" title="Privacy" rel="{handler: ''iframe'', size: {x: 875, y: 550}, onClose: function() {}}">Privacy Policy</a> of this loan.</td>\r\n</tr>\r\n<tr>\r\n<td><strong>We can communicate with you about your application by text.</strong></td>\r\n</tr>\r\n<tr>\r\n<td><a class="readon" onclick="return svalidateField();"><span>Submit</span></a></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<input type="hidden" name="3183a036451b2ab3d2f769a5efd8ccf8" value="1" /></form></div>\r\n</div>\r\n<script type="text/javascript">// <![CDATA[\r\n//code for auto tab\r\n      function autotab(original,destination,e)\r\n      {\r\n         //alert(e.which)\r\n          if(original.value.match(/\\s/g))\r\n          {   \r\n            original.value=original.value.replace(/\\s/g,'''');\r\n          }\r\n          else if(original.value.length==original.getAttribute("maxlength"))\r\n          {    \r\n           if (e.which!=8 && e.which!=0 && e.which!=32 && e.which!=37 && e.which!=38 && e.which!=39 && e.which!=40  && e.which!=35 && e.which!=36 && e.which!=45 && e.which!=46) \r\n            {\r\n              destination.focus();\r\n            }\r\n          }\r\n      }\r\n      function nospace (original) \r\n      {\r\n          //alert(original.value)\r\n        if(original.value.match(/\\s/g))\r\n          {  \r\n            original.value=original.value.replace(/\\s/g,'''');\r\n          }\r\n        \r\n      }\r\n      \r\n      function isemail(Email) // it will return true or false\r\n      { \r\n        regex=/^(([^<>()[\\]\\\\.,;:\\s@\\"]+(\\.[^<>()[\\]\\\\.,;:\\s@\\"]+)*)|(\\".+\\"))@((\\[[0-9]{1,3}\\.[0-9]{1,3}\\.[0-9]{1,3}\\.[0-9]{1,3}\\])|(([a-zA-Z\\-0-9]+\\.)+[a-zA-Z]{2,}))$/;\r\n        //alert(regex.test(Email);\r\n        return regex.test(Email);\r\n      } \r\n      function svalidateField()\r\n      { \r\n      	\r\n      	  var msg_file="";\r\n      	\r\n      		  if(document.getElementById(''fname'').value=="First Name" || document.getElementById(''fname'').value.trim() == "")\r\n      		  {\r\n      			 msg_file+=''Please enter first name \\n'';\r\n      \r\n      		  }\r\n      		  \r\n      		   if(document.getElementById(''lname'').value=="Last Name" || document.getElementById(''lname'').value.trim() == "")\r\n      		  {\r\n      			 msg_file+=''Please enter last name \\n'';\r\n      \r\n      		  }   \r\n                 \r\n      		  if(document.getElementById(''email'').value=="Email" || document.getElementById(''email'').value.trim() == "") \r\n      		  {\r\n      		   /* alert(''Please enter email address'');\r\n      			return false;*/\r\n      			 msg_file+=''Please enter email address \\n'';\r\n      		  }\r\n      		if (document.getElementById(''email'').value!="Email" && isemail(document.getElementById(''email'').value)==false)\r\n      		   {\r\n      			  msg_file+=''Please enter a valid e-mail address\\n'';\r\n      		   }\r\n      			\r\n      		 \r\n      		  if(document.getElementById(''sCtele'').value=="Cell Phone" || document.getElementById(''sCtele'').value.trim() == "")\r\n      		  {\r\n      			 msg_file+=''Please enter cell phone \\n'';\r\n      \r\n      		  }\r\n      		   if(document.getElementById(''scheck'').checked==false)\r\n      		  {\r\n      			 msg_file+=''Please agree with our Terms & Conditions and Privacy Policy\\n'';\r\n      \r\n      		  }\r\n      		      \r\n            if(msg_file!="")      \r\n             { \r\n                alert(msg_file);\r\n                   return false;                   \r\n             }\r\n             else\r\n             { 		  \r\n              window.location = "https://www.allcreditlenders.biz/MemberPage.aspx?subpage=applyForLoan&firstName=" + document.getElementById(''fname'').value \r\n              + "&lastName=" + document.getElementById(''lname'').value + "&email=" + document.getElementById(''email'').value + "&homePhone=" + document.getElementById(''sCtele'').value + "&input[name=''income'']=" + document.getElementById(''income'').value;\r\n              //document.sapply.submit();\r\n             }\r\n      \r\n       }\r\n// ]]></script>', 2, 'leftcreditmod', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 0, '{"prepare_content":"1","backgroundimage":"","layout":"_:default","moduleclass_sfx":"","cache":"1","cache_time":"900","cachemode":"static"}', 0, '*'),
