(171, 'Location', '', '<div class="title5">\r\n<div class="rt-block">\r\n<div class="module-surround">\r\n<div class="module-title ">\r\n<h3>Location</h3>\r\n</div>\r\n<h4>Get a Loan <span class="red"><strong>FAST!</strong></span></h4>\r\n<p>Apply online now and have money in your pocket tomorrow!</p>\r\n<p><strong>Office Address</strong></p>\r\n<p>1835 Larkin Ave<br />Elgin, IL 60123</p>\r\n<p><strong>Mailing Address</strong></p>\r\n<p>P.O. Box 5598<br />Elgin, IL 60121-5598</p>\r\n</div>\r\n</div>\r\n</div>', 3, 'sidebar', 42, '2015-10-08 18:58:40', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 0, '{"prepare_content":"1","backgroundimage":"","layout":"_:default","moduleclass_sfx":" header","cache":"1","cache_time":"900","cachemode":"static"}', 0, '*'),
(172, 'Discolsure', '', '<h4>DISCLOSURE</h4>\r\n<ul>\r\n<li>Loans obtained from the Companies affiliated with this website are for short term financial needs only and not as a long-term financial solution. A short term loan such as an installment loan, line of credit cash advance, credit service agreement, also known as cash advance are short-term loans given to the borrower for a short period of time. Purpose of these short term loans is to provide the borrower a short-term financial relief. These loans are not a long-term financial solution. Borrowers with debt and credit difficulties should seek out professional financial advice.</li>\r\n<li>The Website does not constitute an offer or solicitation to offer a loan.</li>\r\n<li>You are under no obligation or requirement to apply for credit or accept the terms of any loan and you will not be charged fee unless you accept a loan or credit plan.</li>\r\n<li>Each loan, the rates and terms will vary by individual and by state. Loans are NOT available in some states.</li>\r\n<li>Due to state and verification requirements, not all applicants for online loans may be eligible for instant approval by the Companies affiliated with this website.</li>\r\n<li>We do not perform traditional credit checks as part of its credit transaction approval process, but does verify applicant information via national databases including, but not limited to, Tele-Track and CL Verify. If you have defaulted on past transactions, you may be declined for a cash advance from this lender.</li>\r\n<li>The locations and Companies referred to on this Website included several different Companies and entities and not all locations and Companies are affiliated with All Credit Lenders.</li>\r\n</ul>', 0, 'footer', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 1, '{"prepare_content":"0","backgroundimage":"","layout":"_:default","moduleclass_sfx":"","cache":"1","cache_time":"900","cachemode":"static"}', 0, '*'),
